insert into files values ('doi:10.7281/T1/PXEROL/ADBD3W', 'doi:10.7281/T1/PXEROL', 'ZIP Archive', '33850343', 'burnincohort.zip', 'This zip file includes a subset of the data included in fullpopulation.zip.  Burnincohort.zip includes data on the 406 participants randomized prior to the first adjustment of the randomization probabilities; these 406 participants provide an unbiased population for comparison across the 4 treatment groups. The files pertaining to the burn-in cohort have file names that parallel the file names used for files including the full study population but end in 406. The burn-in files include data for each participant from randomization to end of trial (200 and 1000 IU groups) or randomization to switchdate or end of trial, whichever came first (2000 and 4000 IU groups). In general, there is a burn-in cohort file for every full population file; however, there are exceptions to this rule (e.g., there is no burn-in version of the switchdates file, there is no burn-in cohort file with primary outcome paper data – the burn-in cohort was not one of the primary outcome paper analysis populations). T', '12', '02-Mar-2022');
insert into files values ('doi:10.7281/T1/PXEROL/WMVVCY', 'doi:10.7281/T1/PXEROL', 'ZIP Archive', '4131648', 'documentation.zip', 'Documentation materials included in this zip file include:  a documentation notebook that includes a list of files comprising the database, general comments on the database, comments on specific files, a SAS Proc Contents listing of each file and the associated data collection form (if applicable), and other materials to help familiarize the user with STURDY and to help the user navigate the data such as the final study consent forms, design summary, analysis hints, information on the questionnaires and scales collected during the trial, and a list of publications from the trial.  The study Protocol and Manual of Procedures documents are also included in documentation.zip.', '13', '02-Mar-2022');
insert into files values ('doi:10.7281/T1/PXEROL/TRHRL2', 'doi:10.7281/T1/PXEROL', 'ZIP Archive', '53172223', 'fullpopulation.zip', 'This zip file includes files pertaining to the full study population (688 randomized participants plus screenees who were not randomized). Each data file corresponds to a specific data collection form or type of data. Fullpopulation.zip also includes two files that support the analyses included in the primary outcome paper published by the Annals of Internal Medicine (annalsdat.sas7bdat and annalsdatFeb2018.sas7bdat). This folder contains all files in sas7bdat format and csv format.', '13', '02-Mar-2022');
