insert into files values ('doi:10.7281/T18G8HM0/155', 'doi:10.7281/T18G8HM0', 'ZIP Archive', '5911762', 'WRTDS_Beta_Coefficients (v4).zip', 'This folder contains R scripts for the extraction and graphical presentation of WRTDS model coefficients, as a means of interpreting concentration-discharge relationships in riverine monitoring data. The essential steps and associated files are described using a case study on suspended sediment concentration in Susquehanna River at Conowingo Dam, MD. The data and scripts stored here are also those used in the associated journal article.', '23', '08-Jun-2023');
insert into files values ('doi:10.7281/T1D798BQ/YDGOYV', 'doi:10.7281/T1D798BQ', 'ZIP Archive', '47501', 'Code.zip', 'Matlab scripts used to generate figures and analyze data: (1) PlotAve.m takes in dataTime.mat and generates Figure 4a. (2) Gains.m takes in dataTime.mat, computes time domain average for each fish, saves gains as Gains.mat, and generates Supplemental Figures 1 and 2. (3) PlotExemplary.m takes in dataTime.mat and Gains.mat and generates Figure 3. (4) CompareGains.m takes in Gains.mat, performs comparisons, saves Summary.mat, generates Figures 5, 6, 7, and 8. (5) Stats.m performs statistical hypothesis testing. Dependencies/ contains 5 functions called by the data analysis scripts.', '19', '31-May-2016');
insert into files values ('doi:10.7281/T1D798BQ/ZT5GCQ', 'doi:10.7281/T1D798BQ', 'ZIP Archive', '46302', 'CollectionLog.zip', 'Data collection log with day, fish, conductivity, profile, replicate, and number (trial of day) for every trial.', '15', '31-May-2016');
insert into files values ('doi:10.7281/T1D798BQ/1EG5GK', 'doi:10.7281/T1D798BQ', 'ZIP Archive', '44701342', 'Data.zip', '(1) dataTime.mat is the data{trial} MATLAB structure containing all the metadata and time domain velocity data for every trial. It is the input to Gains.m (2) Gains.mat is the avedata{Profile}{Fish}{Conductivity} MATLAB structure containing all time domain data before and after averaging and all the frequency domain data for each profile, fish and conductivity. It is generated by Gains and used to generate the supplemental figures. It is the input to CompareGains.m. (3) Summary.mat contains all the variables used in generating Figures 5, 6, 7, 8. It is generated by CompareGains.m and these variables are used by Stats.m for the statistical hypothesis testing.', '14', '31-May-2016');
