insert into files values ('doi:10.7281/T1/N1X6I4/D5CQ0Y', 'doi:10.7281/T1/N1X6I4', 'ZIP Archive', '161073287', 'TaxCourtPLRCorpus.zip', 'Curated and pre-processed corpus from two sources:  (1) Tax Court Memorandum and Summary Opinions scraped from the Tax Court website.  (2) IRS Private Letter Rulings (PLRs) scraped from the IRS website.  Processing includes OCRing PDFs, removing page numbers, removing likely errors, adding underscores between collocations (e.g. tax_year, sec_351), preprocessing case citations to a uniform format (e.g. 348_us_426), and preparing to be run through word2vec.', '109', '23-Jul-2020');
insert into files values ('doi:10.7281/T1/N1X6I4/SZF0HP', 'doi:10.7281/T1/N1X6I4', 'ZIP Archive', '211672166', 'TaxVectors.zip', '500-dimension vector representation for tax-law terms and collocations (e.g. “tax year”, which is represented as “tax_year”) derived using (Mikolov 2013)’s word2vec implementation using skip-gram with negative sampling; words with a frequency of less than 10 were discarded; 5 iterations through the data; 15 negative samples were used per focus word; words with a unigram probability above 10^-3 were probabilistically discarded; only static windows were used; the training data was all tax-law documents, specifically the curated tax corpus (PLRs and Tax Court unreported decisions) plus tax-specific cases in the Federal case.law corpus.', '70', '23-Jul-2020');
