insert into files values ('doi:10.7281/T1MW2F2Z/SOHLWC', 'doi:10.7281/T1MW2F2Z', 'ZIP Archive', '188529098', 'CLS Formation.zip', 'This zip file contains 2D images of CLS (capillary like structure) formation from endothelial progenitor cells (EPC) under differing conditions of matrix elasticity and vascular endothelial growth factor (VEGF) levels (Figure 2A)., These images were taken using a light microscope and occur in tiff and/or jpeg. This zip file also includes  real-time PCR data for expression MMP-1, MMP-2, and MT1-MMP Figure 2B and 2C) in the form of an Excel spreadsheet. Finally, it contains 3D images taken using confocal micrsoscope in tif format (Figure 3B ii and iii). The database associated with these 3D images is not included.', '5', '18-Dec-2013');
insert into files values ('doi:10.7281/T1MW2F2Z/HZW2QA', 'doi:10.7281/T1MW2F2Z', 'MS Word', '55296', 'Folder Details_Hanjaya-Putra et al. 2010.doc', 'This Word document provides more detail on the content of some folders, subfolders, and in some cases, individual files. The document also contains a list of abbreviations and acronyms used for folder/file names and the corresponding definition or full name.', '4', '18-Dec-2013');
insert into files values ('doi:10.7281/T1MW2F2Z/EV1XHO', 'doi:10.7281/T1MW2F2Z', 'ZIP Archive', '54834043', 'MT1-MMP_Cdc42.zip', 'This zip file contains images of CLS formation on EPCs treated with siRNA targeting MT1-MMP and Cdc42 genes on different substrates (Figure 5).  It also contains the resulting PCR data of the expressions of Cdc42 and MT1-MMP in Excel format. Finally, this zip file contains the results from the Western Blot test for the relative amounts of MT1-MMP or Cdc42 in RNAi transfected EPCs.', '3', '18-Dec-2013');
insert into files values ('doi:10.7281/T1MW2F2Z/2WRNVM', 'doi:10.7281/T1MW2F2Z', 'ZIP Archive', '205181160', 'Quantification of CLSs.zip', 'This zip file contains the results of the image analysis on the 2D images of CLS formation (Figure 3A). Images were analyzed using Metamorph software.  The zip file also contains transmission electron miscrospscopy images of vacuole formation on different substrates (Figure 4).', '3', '18-Dec-2013');
insert into files values ('doi:10.7281/T1MW2F2Z/BE9FUI', 'doi:10.7281/T1MW2F2Z', 'ZIP Archive', '55683', 'Viscoelasticity.zip', 'This zip file contains measurements on the viscoelasticity of the hydrogels (Figure 1A and 1B). There are slight differences between the two files (Rheology summary data (2).xlsx and Rheology summary data .xlsx), but the data is comprehensive between them.', '6', '18-Dec-2013');
