insert into files values ('doi:10.7281/T1/XNZRR8/CKER5R', 'doi:10.7281/T1/XNZRR8', 'ZIP Archive', '7673813', 'Cyclic_Voltammetry.zip', 'Cyclic voltammetry (CV) measurements were performed in a one-chamber, three-electrode cell using a PGSTAT302 potentiostat. A 2 mm2 Pt electrode from BASi was used as the working electrode with a platinum wire serving as the counter electrode relative to an Ag/AgCl (nonaqueous) reference electrode submerged in either 0.01 M AgNO3/0.1 M n-Bu4PF6 in anhydrous acetonitrile or 0.01 M AgNO3/0.1 M n-Bu4Cl in anhydrous acetonitrile (MeCN). Measurements were taken in either 0.1 M n-Bu4PF6 (in MeCN) electrolyte solution or 0.1 M n-Bu4Cl (in MeCN) at various scan rates from 10 mV/s to 250 mV/s. Potentials relative to the Ag/Ag+ couple to which the Fc/Fc+ couple was measured to be 262 mV (Figure S17). The potential for ferrocene redox is -4.8 eV relative to vacuum. Energy levels of the highest occupied molecular orbital (HOMO) were calculated according to the equations:insert into files values ('doi:10.7281/T1/XNZRR8/OXUH50', 'doi:10.7281/T1/XNZRR8', 'ZIP Archive', '1001347', 'DSC.zip', 'Differential scanning calorimetry (DSC) measurements, using 2–3 mg of material, were conducted under nitrogen scan rate of 10°C/min when heating and 20°C/min for cooling with a TA DSC-Q20 instrument.', '3', '21-Apr-2022');
insert into files values ('doi:10.7281/T1/XNZRR8/WRZDUC', 'doi:10.7281/T1/XNZRR8', 'ZIP Archive', '17873477', 'OECT.zip', 'Measurements were conducted using a KeySight 1500 Semiconductor Device Analyzer. Transfer curves were obtained by measuring the Vg from 0 V to -1 V with a step size of -10 mV and VD = -0.6 V. Output curves were measured from 100 mV to -1 V with a step size of -11 mV, and Vg ranged from 0 V to -700 mV with a step size of -50 mV. However, for polymers like P3MEEMT and P3HT, Vg ranged from -600 mV to -1.05 V with a step size of -50 mV with KCl. Afterward, the original setup listed before was used. The reference electrode that was used was Ag/AgCl (sat''d KCl) purchased from GAMRY instruments. The Electrode potential is 199 mV vs Normal Hydrogen Electrode (NHE).', '3', '21-Apr-2022');
insert into files values ('doi:10.7281/T1/XNZRR8/EVNKCI', 'doi:10.7281/T1/XNZRR8', 'ZIP Archive', '787590', 'UVVIS_Characterization.zip', 'Absorption spectra were obtained using a Lambda 950 UV-vis spectrometer with an operating range of 175–3300 nm. A universal reflectance accessory was used to measure thin film characterization. Polymers were spin-coated by the method outlined above on borosilicate glass slides.', '3', '21-Apr-2022');
insert into files values ('doi:10.7281/T1/XNZRR8/ZFQCY0', 'doi:10.7281/T1/XNZRR8', 'ZIP Archive', '72451335', 'XRD.zip', 'Polymers were dissolved in appropriate solvents noted above and drop-cast on Si/SiO2 (300 nm of thermal oxide growth) substrate to form at least 100 nm of film thickness. The thin films were then collected and analyzed using a Bruker D8 Focus X-ray Diffractometer analyzer. Quantitative analysis was performed with a DIFFRACplus Software utilizing DIFFRACplus EVA and TOPAS programs. Measurements provided intensity distribution related to the angle 2θ. The instrument was calibrated with a NIST standard reference piece of polystyrene or Al2O3.', '3', '21-Apr-2022');
