insert into files values ('doi:10.7281/T1KW5CX5/346', 'doi:10.7281/T1KW5CX5', 'ZIP Archive', '30107470', 'A2. LSRB_WRTDS_model_run.zip', 'This zipped folder contains R scripts used for running the WRTDS analysis based on files in zipped folder #1. It also contains the stored 24 (= 8 x 3) .Rdata files as products of WRTDS runs for eight water-quality constituents (i.e., total nitrogen, dissolved nitrogen, dissolved nitrate plus nitrite, dissolved Kjeldahl nitrogen, total phosphorus, dissolved phosphorus, dissolved orthophosphate, and suspended sediment) at each of the three monitoring sites in the lower Susquehanna River Basin (SRB). Major file types include .R and .Rdata.', '14', '07-Apr-2016');
