insert into files values ('doi:10.7281/T1KW5CX5/348', 'doi:10.7281/T1KW5CX5', 'ZIP Archive', '578209', 'A4. LSRB_load_plotting.zip', 'This zipped folder contains the data and R scripts used for making plots of nutrient and sediment seasonal loading trends at the three monitoring sites in the lower Susquehanna River Basin (SRB) (i.e., figures contained in folder No.5). Major file types include .R, .Rdata, .csv, and .xlsx.', '12', '07-Apr-2016');
