insert into files values ('doi:10.7281/T1/XGVRX0/EOZVW3', 'doi:10.7281/T1/XGVRX0', 'ZIP Archive', '1098308', 'Figure 1.zip', 'Average threshold voltages were calculated from the control and main experiments, and the changes of threshold voltages are indicated in this figure when different concentrations of MBP were added for the main experiment and control experiment. All the biomolecules were diluted in 0.05× PBS solution and all the experiments were repeated on at least four samples. The inset indicates the average value.', '3', '23-Jun-2022');
insert into files values ('doi:10.7281/T1/XGVRX0/UWUCBO', 'doi:10.7281/T1/XGVRX0', 'ZIP Archive', '1046983', 'Figure 2.zip', 'Average threshold voltages were calculated from transfer curves of the anti-MBP receptor/MBP analyte, and the changes of threshold voltage are indicated when different concentrations of MBP were added for the main experiment. All the biomolecules were diluted in 1× PBS solution, and all the experiments were repeated on at least four samples. The inset indicates the average value.', '3', '23-Jun-2022');
insert into files values ('doi:10.7281/T1/XGVRX0/CIUD6S', 'doi:10.7281/T1/XGVRX0', 'ZIP Archive', '1512818', 'Figure 3.zip', 'Average threshold voltages were calculated from transfer curves of surface MBP & cortisol antibody analyte control experiment, surface BSA & MBP antibody analyte control experiment and surface MBP & anti-MBP analyte main experiment. The changes of threshold voltage are indicated in this figure when different concentrations of MBP antibody were added for the main experiment. All the experiments were repeated at least on 4 samples. The inset indicates the average value.', '3', '23-Jun-2022');
insert into files values ('doi:10.7281/T1/XGVRX0/HPFCXZ', 'doi:10.7281/T1/XGVRX0', 'ZIP Archive', '1529745', 'Figure 4.zip', 'Average threshold voltages were calculated from the transfer curves of different concentrations. The blue line is RBD with MBP antibody, the black line is the main experiment, which is RBD with S1 protein antibody, and the red line is only BSA with S1 protein antibody. Relative current change with different concentrations. ID is the measured drain current, Igate leakage is the current caused by gate leakage, and I0 is the drain current when no antibody is added (pure PBS) as the analyte. At least three samples were measured at each point. The inset indicates the average threshold voltage value.', '3', '23-Jun-2022');
insert into files values ('doi:10.7281/T1/XGVRX0/ZDUIAE', 'doi:10.7281/T1/XGVRX0', 'ZIP Archive', '18540', 'Figure 5.zip', 'Average surface zeta potential for the PTCOOH film, PTCOOH film with MBP antibody immobilization, PTCOOH film with MBP antibody, and BSA and PTCOOH film with MBP antibody, BSA, and MBP.', '3', '23-Jun-2022');
insert into files values ('doi:10.7281/T1/XGVRX0/KFHURH', 'doi:10.7281/T1/XGVRX0', 'ZIP Archive', '3153453', 'Figure 6.zip', '(a) Average open circuit potential value and open circuit potential change versus different concentrations of MBP. (b) Average open circuit potential value and open circuit potential change versus different concentrations of S1 antibody. The insets indicate the average value.', '3', '23-Jun-2022');
