insert into files values ('doi:10.7281/T1/NL3HTW/RX1XXT', 'doi:10.7281/T1/NL3HTW', 'ZIP Archive', '428843658', 'all_bins2.zip', 'This is a zip file of a folder containing 666 fasta file of the sequences assigned to 666 metagenome reconstructed genomes (MAGs), not filtered by completion or contamination. Files within this folder follow the naming convention CB33.bin.[0-9]{1-3}.fa.gz and CBrest.bin.[0-9]{1-3}.fa.gz. These files are gzip files of fasta files which contain all of the contigs assigned to that MAG.', '7', '28-Feb-2022');
