insert into files values ('doi:10.7281/T1/NL3HTW/SYI3WV', 'doi:10.7281/T1/NL3HTW', 'Plain Text', '210207', 'merged_paired_water_quality_data.txt', 'Tab delimited text file of the sample metadata associated with the water sampled at the time of collection. This includes both information about the sites themselves (e.g. station, TotalDepth), discharge and preciptation on the day of collection, library processing information (e.g. qPCR ct, sequencing_ID) and chemical information associated with the water that was collected.', '12', '28-Feb-2022');
insert into files values ('doi:10.7281/T1/NL3HTW/711', 'doi:10.7281/T1/NL3HTW', 'Plain Text', '5321586', 'otu_annotations_faprotax.txt', 'Tab delimited text file containing predicted functions for each OTU in the dataset. Functional predictions based on FAPROTAX output using the taxonomic name associated with the OTU as input. Cells values of 1 indicate the function is associated with that OTU, while 0 indicates the function is not associated with that OTU. Rows and column sums can be any number greater than or equal to 0.', '7', '16-May-2023');
insert into files values ('doi:10.7281/T1/NL3HTW/TYJPN1', 'doi:10.7281/T1/NL3HTW', 'Unknown', '14805766', 'OTU_sequence_reps.fasta', 'Fasta text file of all of the ASV sequences in the rarefied ASV table. Headers represent ASV names that match column header names in final_rarefied_table.best.txt.', '7', '28-Feb-2022');
