insert into files values ('doi:10.7281/T1/QVAHMD/LMW63R', 'doi:10.7281/T1/QVAHMD', 'JSON', '3959963', '06_cases0thru34.json', 'In an attempt to fine-tune the Xia et al. coref model to caselaw, we hand annotated 35 randomly selected cases (randomly selected from both federal and state cases).  This was fairly time consuming.  This is a JSON file, with each case being a json line.  The format largely follows the Spanbert input form.  The coref is stored in the “clusters” entry.', '2', '18-May-2022');
