insert into files values ('doi:10.7281/T1/QVAHMD/VAO1HN', 'doi:10.7281/T1/QVAHMD', 'ZIP Archive', '5055937', '08_TestSplit1.zip', 'This contains the event chains for the 2783 cases (0.3 percent of corpus) that was held out (i.e. not used in training the PMI measures, including not considering any citations to or from them) and used in running cloze.py to get the test results reported.', '3', '18-May-2022');
insert into files values ('doi:10.7281/T1/QVAHMD/DWVKKN', 'doi:10.7281/T1/QVAHMD', 'ZIP Archive', '5305113', '09_TestSplit2.zip', 'This contains the event chains for 2874 cases (0.3 percent of corpus) that were held out (i.e. not used in training the PMI measures, including not considering any citations to or from them).  These cases were used for neither training nor for the testing reported in the paper.  This is intended as an additional “held out” set for further testing (or for hyperparameter tuning).', '2', '18-May-2022');
insert into files values ('doi:10.7281/T1/QVAHMD/ABAJNK', 'doi:10.7281/T1/QVAHMD', 'ZIP Archive', '1208741685', '10_coref_output.zip', 'This contains the output of running Xia et al. (2020)’s coref model on all 965,467 federal cases in the corpus.  For those who have case.law Researcher Access, we are happy to share the full coref output, including the underlying tokens.  But for this public version, only the coref spans for each file are available, since one can reconstruct the full corpus if one also has the underlying tokens.  The tokenization was done using SpanBERT/spanbert-base-cased.', '2', '18-May-2022');
