insert into files values ('doi:10.7281/T1/BDLMJG/TUN6OI', 'doi:10.7281/T1/BDLMJG', 'ZIP Archive', '2325190', 'MSW Rules Comments.zip', 'Three folders containing a set of files with comments on the draft versions of the proposed municipal solid waste rules: “Pre 2013 Comments” folder contains one file with minutes of the “2nd Meeting of the Committee to examine the role of waste pickers in municipal solid waste management and suggest necessary amendments to the Municipal Solid Wastes (Management and Handling) Rules, 2000” held in January 2011. “2013 Draft and Comments” contains letters and comments submitted by 6 organizations on the 2013 draft version of the revised rules, minutes of a meeting of several civil society organizations in Bangalore to discuss the proposed rules in November 2013, a copy of an order issued by the Karnataka High Court and the minutes of a meeting held at the Ministry of Environment and Forests in April 2014. “2015 Draft and Comments” contains the responses of five organizations on the 2015 proposed revisions. Total files: 18; File formats: MS Word and PDF', '3', '17-Jul-2018');
