insert into files values ('doi:10.7281/T1/OM3OMQ/A2MRWX', 'doi:10.7281/T1/OM3OMQ', 'ZIP Archive', '1352', '2_Figure_6.zip', 'This zipped folder contains two python dictionary objects saved in Pickle format.  The file “Fyw_obs.pkl” contains a “LH” and TW” key with the modeled estimates of the mean annual young water fraction for each watershed (i.e., the closed circles in Figure 6).  Similarly, the file “Fyw_obs_novar.pkl” contains the estimates for the mean annual young water fraction assuming no within year variability (i.e., the open circles in Figure 6).', '25', '23-Oct-2017');
insert into files values ('doi:10.7281/T1/OM3OMQ/ATNPCB', 'doi:10.7281/T1/OM3OMQ', 'ZIP Archive', '47725954', '3_Figure_7.zip', 'This zipped folder contains eight python dictionary objects saved in Pickle format. The files ending in “36s” have results using the optimal parameter set, while the files ending in “37s” have results assuming no inverse storage effect (i.e., lambda=0). The files beginning with “frac_temp” have 4 layers of keys.  The first key [“TW”,“LH”] indicates either Lower Hafren or Tanllwyth.  The second key [0,1,2,3,4,5] refers to five different rainfall scenarios.  Number zero is full rainfall variability.  Number one is number zero minus seasonality.  Number twp is number one minus within storm variability.  Number three is number two minus between storm variability.  Number four is no variability.  Number five is the historic period from 1999-2008. The third key [“yearly”, “summer”, “dec_mean”, “winter”, “winter_mean”, “jun_mean”, “summer_mean”, “mean”] indicates a time period of averaging. For example, “yearly” contains the mean age fraction of water per year, “dec_mean” contains the mean ag', '7', '23-Oct-2017');
insert into files values ('doi:10.7281/T1/OM3OMQ/TQVRXZ', 'doi:10.7281/T1/OM3OMQ', 'ZIP Archive', '4637202', '4_Figure_8.zip', 'This zipped folder contains a python dictionary saved in Pickle format.  It contains the file “pattern_example_out_4_LH.pkl”, which is data used to plot Figure 8.   The first key is the number 0 thru 5 referring to panels a thru f of Figure 8.  The second key is the number 0-2 referring to the three subpanels of each panel from top to bottom.  The last set of keys are “P” (precipitation in mm/day), “Q” (discharge in mm/day), “Q_old” (discharge older than 90 days old in mm/day), “Q_young” (discharge younger than 90 days old in mm/day), “Fyw” (fraction of young water), “pws” (precipitation weighted storage or storage-based young water index in mm), and “t” (time in days).', '26', '23-Oct-2017');
insert into files values ('doi:10.7281/T1/OM3OMQ/LEEOO2', 'doi:10.7281/T1/OM3OMQ', 'ZIP Archive', '158623875', '5_Figure_9.zip', 'This zipped folder contains two python dictionaries saved in Pickle format.  The file “CC_01_PQ.pickle” contains keys for “LH” or “TW.  The second key is the scenario which is either “hist” (corresponding to the historic baseline), 2 (corresponding to the median change in ET), 50 (corresponding to the median change in ET and median change in rainfall, and 101 (corresponding to the median change in ET and extreme change in rainfall).  Each key contains an array with the backwards transit time distribution varying by age (366 rows representing a day each) and time (5845 columns representing a day each, from 1993 – 2008).  The CC_01_Q.pickle structure is similar except the final array is discharge over 5845 days in mm/day.', '7', '23-Oct-2017');
insert into files values ('doi:10.7281/T1/OM3OMQ/Z6KGYZ', 'doi:10.7281/T1/OM3OMQ', 'ZIP Archive', '8137', '6_Rainfall_generator_model.zip', 'These python scripts run the rainfall generator described in the manuscript and supplemental materials.  A brief description of each script is commented at the top of the code.  The main script is “def_rain_gen_v4.py”.  It takes a start data, end date, and parameter set as input, and returns a daily rainfall time-series.  In the process of generating the rainfall time-series, it uses the script “def_within_storm_estimates.py”, which determines the distribution of rainfall within a single storm event.  The file “config_vars_v7a” contains some of the parameters used by the scripts.  These scripts are called by other scripts (not archived here) that produced the final modeled output data contained in the Figure_7.zip folder.', '35', '23-Oct-2017');
insert into files values ('doi:10.7281/T1/OM3OMQ/PSSAEA', 'doi:10.7281/T1/OM3OMQ', 'ZIP Archive', '8290', '7_Rainfall_runoff_model.zip', 'These python scripts run the rainfall-runoff model described in the manuscript.  A brief description of each script is commented at the top of the code.  The main script is “def_rr_model_g_v12”.  It takes run dates, a rainfall time-series, a potential ET time-series, and parameters for the catchment sensitivity function as input.  It returns a time-series for discharge.  There are also various options for returning estimates of the simulated ET and storage anomaly.  In the process of generating the rainfall time-series, it uses the script “def_SQ_lookup.py” to convert discharge to the equivalent storage anomaly value.  Finally, the script “utils_v10.py” contains several short functions for calculating statistics and other tasks. The file “config_vars_v7a” contains some of the parameters used by the scripts.  These scripts are called by other scripts (not archived here) that produced the final modeled output data contained in the Figure_7.zip and the Figure_9.zip folders.', '31', '23-Oct-2017');
