insert into files values ('doi:10.7281/T1/C4RVLS/1445', 'doi:10.7281/T1/C4RVLS', 'Plain Text', '4471', '00_README.txt', 'This README contains important instructions on how to download this dataset.', '1', '09-Jan-2024');
insert into files values ('doi:10.7281/T1/C4RVLS/1446', 'doi:10.7281/T1/C4RVLS', 'Adobe PDF', '312547', '0_FigureS1.pdf', 'Figure S1. Example eye position traces for animals with right ear ototoxicity in response to whole-body static tilts. Responses are included for Ch150 (A, right eye; D, left eye), Ch154 (B, right eye; E, left eye), and Ch156 (C, right eye; F, left eye). The stimulus was delivered by a 6-DOF motion platform and consists of a ramp-up (dark gray shading), a 40 s plateau at 20° of tilt (light gray shading), and a ramp-down (dark gray shading). All traces correspond to reorientations about an azimuth angle of form θ = +150°. Black, yellow, and purple traces show X, Y and Z components of 3-dimensional rotational eye position, respectively, for both eyes, following the right-hand-rule sign convention. Thicker segments during the last 5 seconds of each static tilt stimulus indicate the steady state position, computed by averaging rotational eye position over the last 5 seconds of the stimulus.', '13', '04-Apr-2023');
insert into files values ('doi:10.7281/T1/C4RVLS/1447', 'doi:10.7281/T1/C4RVLS', 'Adobe PDF', '1802571', '0_FigureS2.pdf', 'Figure S2. Example eye position and velocity traces for animals with right ear ototoxicity in response to whole-body sinusoidal translations. Responses are included for Ch150 (B, eye position; C, eye velocity), Ch154 (D, eye position; E, eye velocity), and Ch156 (F, eye position; G, eye velocity). The stimulus was delivered by a 6-DOF motion platform and consists of a 1-Hz sinusoidal motion with a peak linear acceleration of 3 m/s2 (A), about the lateral/Y axis. Black, yellow, and purple traces show X, Y and Z components of 3-dimensional rotational eye position, respectively, following the right-hand-rule sign convention. Light green, light blue, and red show left-anterior, right-posterior (LARP), right-anterior, left-posterior (RALP), and Z components of 3-dimensional rotational eye velocity, respectively, also following the right-hand-rule sign convention. Right eye position/velocity is shown in dashed lines, and left eye position/velocity is shown in solid lines.', '11', '04-Apr-2023');
insert into files values ('doi:10.7281/T1/C4RVLS/1448', 'doi:10.7281/T1/C4RVLS', 'Adobe PDF', '746085', '0_FigureS3.pdf', 'Figure S3. Example eye position traces for animals with right ear ototoxicity followed by left ear implantation in response to "virtual static tilts” delivered by prosthetic stimulation of the utricle (A-F) and saccule (G-L). Responses are included for Ch150 (A,G, right eye; D,J, left eye), Ch154 (B,H, right eye; E,K, left eye), and Ch156 (C,I, right eye; F,L, left eye). The gray shaded region depicts the 40 s duration of a pulse rate step to 250 pulses/s. Black, yellow, and purple traces show X, Y and Z components of 3-dimensional rotational eye position, respectively, for both eyes, following the right-hand-rule sign convention. Thicker segments during the last 5 seconds of each “virtual tilt” (pulse rate step) stimulus indicate the steady state position, computed by averaging rotational eye position over the last 5 seconds of the stimulus.', '10', '04-Apr-2023');
insert into files values ('doi:10.7281/T1/C4RVLS/1449', 'doi:10.7281/T1/C4RVLS', 'Adobe PDF', '3572196', '0_FigureS4.pdf', 'Figure S4. Example eye position and velocity traces for animals with right ear ototoxicity followed by left ear implantation in response to "virtual sinusoidal translations” delivered by prosthetic stimulation of the utricle (A-G) and saccule (H-N). Responses are included for Ch150 (B,I, eye position; C,J, eye velocity), Ch154 (D,K, eye position; E,L, eye velocity), and Ch156 (F,M, eye position; G,N, eye velocity). The stimulus was encoded by a pulse frequency-modulated sinusoid (A,H). Black, yellow, and purple traces show X, Y and Z components of 3-dimensional rotational eye position, respectively, following the right-hand-rule sign convention. Light green, light blue, and red show left-anterior, right-posterior (LARP), right-anterior, left-posterior (RALP), and Z components of 3-dimensional rotational eye velocity, respectively, also following the right-hand-rule sign convention. Right eye position/velocity is shown in dashed lines, and left eye position/velocity is shown in solid li', '9', '04-Apr-2023');
insert into files values ('doi:10.7281/T1/C4RVLS/1450', 'doi:10.7281/T1/C4RVLS', 'Adobe PDF', '223239', '0_FigureS5.pdf', 'Figure S5. Ocular rotational velocity vectors in response to sinusoidal otolith-targeted electrical stimulation from stationary animals. The peak eye velocities to given electrical sinusoidal stimulation waveforms as shown in Figure 2CD are displayed for the utricle-targeting electrode pairs (A-F) and saccule-targeting electrode pairs (G-L) for each animal (rows). Each independent color depicts a different electrode pair. Ocular responses are shown as velocity rotation vectors for the right eye (A,C,E,G,I,K) and the left eye (B,D,F,H,J,L). Magnitude of vectors depict eye velocity in m/s.', '8', '04-Apr-2023');
insert into files values ('doi:10.7281/T1/C4RVLS/1451', 'doi:10.7281/T1/C4RVLS', 'Adobe PDF', '447960', '0_FigureS6.pdf', 'Figure S6. Rotational velocity vectors of otolith-ocular responses for the right eye (A,C,E) and left eye (B,D,F) during sinusoidal translations for normal animals (A,B, N=6) (44), animals with right ear ototoxicity (C,D, N=5), and animals with right ear ototoxicity followed by left ear implantation without electrical stimulation (E,F, N=3). The colors indicate the translational axis the animal was moved along sinusoidally at 1 Hz with a maximum acceleration of 3 m/s2 as shown in the legend. Magnitude of vectors represent degrees per second. The different markers indicate different animals as displayed in the legend.', '10', '04-Apr-2023');
insert into files values ('doi:10.7281/T1/C4RVLS/1452', 'doi:10.7281/T1/C4RVLS', 'Adobe PDF', '450378', '0_FigureS7.pdf', 'Figure S7. Rotational position vectors of otolith-ocular responses for the right eye (A,C,E) and left eye (B,D,F) during static tilts for normal animals (A,B, N=6) (36), animals with right ear ototoxicity (C,D, N=5), and animals with right ear ototoxicity followed by left ear implantation without electrical stimulation (E,F, N=3). The colors indicate which axis the animal was reoriented about by +20° as shown in the legend. Rotation vectors follow the right-hand rule. Magnitude of vectors depicts approximate positional degrees. Different markers indicate different animals as displayed in the legend.', '10', '04-Apr-2023');
