insert into files values ('doi:10.7281/T1/IVVFCM/1687', 'doi:10.7281/T1/IVVFCM', 'ZIP Archive', '662256679', 'trace_transfer.zip', 'This zip file contains trajectory data for 5 experiment types (laboratory experiments, CO2, 1-human, 2-human, and 6-human). ivTrace was used to obtain trajectories from laboratory experiments, CO2, 1-human, and 2-human experiments. Folders for these experiments are divided by date, each date containing a folder for each stimulus used, and each folder contains a "full.txt" file containing the final corrected trajectories from ivTrace. These trajectories can be processed to extract information on landing behavior in MATLAB using the script "process_trajectories.m" found on Github at https://github.com/GordusLab/Giraldo-Rankin-Turner-Corver-et-al-2023', '1', '21-Apr-2023');
