insert into files values ('doi:10.7281/T1/A9NKJ7/FKW8TV', 'doi:10.7281/T1/A9NKJ7', 'ZIP Archive', '202423', 'Nanotube image analysis code.zip', 'All the MATLAB files used for image analysis including the scripts for Figures 2, 5, and 6.', '10', '21-Oct-2020');
insert into files values ('doi:10.7281/T1/A9NKJ7/314NOL', 'doi:10.7281/T1/A9NKJ7', 'Adobe PDF', '448220', 'ReadMe.pdf', 'A file describing the data organization and code files.', '18', '21-Oct-2020');
insert into files values ('doi:10.7281/T1/HWU9TZ/4455', 'doi:10.7281/T1/HWU9TZ', 'Unknown', '18038', 'FMQs.HiP.out', 'This file contains the values we used for the Fayalite-magnetite-quartz (FMQ) buffer at various P-T conditions, where log K = log fO2. Generated by SUPCRT (Johnson et al., 1992), using the Berman (1988) thermodynamic database for properties of minerals.', '4', '28-May-2024');
insert into files values ('doi:10.7281/T1/HWU9TZ/4456', 'doi:10.7281/T1/HWU9TZ', 'ZIP Archive', '7144373', 'Mafic_fluids.zip', 'Model results for fluids in equilibrium with mafic mineral assemblages at P-T conditions of 2–3 GPa and 400–800°C to encompass hot and cold subduction zones. Minerals are specified in the input files and their saturation controls equilibrium concentrations of aqueous species. Aqueous species dissociation reactions, mineral dissolution reactions, and associated equilibrium constants are listed in the output files. Log fO2 is varied from FMQ-2 to FMQ+4. Saturation with a sulfur-bearing mineral (pyrrhotite, pyrite or anhydrite) determines sulfur solubility. Full fluid speciation, mineral saturation states and hypothetical solid solutions can be found in the output files.', '4', '28-May-2024');
insert into files values ('doi:10.7281/T1/HWU9TZ/4457', 'doi:10.7281/T1/HWU9TZ', 'ZIP Archive', '836598', 'NM05_anh-solub_H2O-NaCl.zip', 'Model representation of high-pressure experiments by Newton & Manning (2005) on anhydrite solubility in H2O–NaCl solutions. Here pH was adjusted in the input file to obtain equimolar concentration of Ca and S in the fluid, and dissociation constants (log K’s) for Na2SO4 = 2Na+ + SO42-  and CaCl2 = Ca2+ + 2Cl-  were adjusted to obtain anhydrite solubilities (i.e. [Ca]fluid = [S]fluid) consistent with the Newton and Manning experiments. This folder contains subfolders for each experimental temperature (600, 700 and 800°C), further subdivided by NaCl concentration. Log K’s of important neutral species were adjusted to include activity coefficients in increasingly concentrated solutions. Adopted log fO2 ’s were FMQ+1.7 at 600°C, FMQ+1.4 at 700°C, and FMQ+1.2 at 800°C. Results from the output files are used in Fig. 1b and 2 of the main text.', '4', '28-May-2024');
insert into files values ('doi:10.7281/T1/HWU9TZ/4458', 'doi:10.7281/T1/HWU9TZ', 'ZIP Archive', '1006751', 'NM05_anh-solub_pureH2O.zip', 'Model representation of high-pressure experiments by Newton & Manning (2005) on anhydrite solubility in pure water. Here pH was adjusted in the input file to obtain equimolar concentration of Ca and S in the fluid, and the dissociation constant (log K) for CaHSO4+ = Ca2+ + H+ + SO42-  was adjusted to obtain anhydrite solubilities (i.e. [Ca]fluid = [S]fluid) consistent with the Newton and Manning experiments. This folder contains subfolders for each experimental temperature (600, 700 and 800°C), further subdivided by oxygen fugacity (FMQ+0.25 to FMQ+4.1). Results from the output files are used in Fig. 1 of the main text.', '4', '28-May-2024');
insert into files values ('doi:10.7281/T1/HWU9TZ/4459', 'doi:10.7281/T1/HWU9TZ', 'Plain Text', '4239', 'README.txt', 'Please read first in order to use the files contained within this dataset.', '5', '28-May-2024');
insert into files values ('doi:10.7281/T1/HWU9TZ/4460', 'doi:10.7281/T1/HWU9TZ', 'ZIP Archive', '18281290', 'Thermodynamic_databases.zip', 'Data files containing the equilibrium constants of aqueous species dissociation reactions and mineral dissolution reactions at specified pressures and temperatures, consistent with the Deep Earth Water model. New sulfur-bearing species CaHSO4+ , Na2SO40 and NaHSO40  , H2SO40 were added to these files, and updated log K values are provided for NaSO4-, S3- and CaCl20 , based on the thermodynamic parameters provided in Table 2 of the main text.', '4', '28-May-2024');
insert into files values ('doi:10.7281/T1/HWU9TZ/4461', 'doi:10.7281/T1/HWU9TZ', 'ZIP Archive', '5886788', 'Ultramafic_fluids.zip', 'Model results for fluids in equilibrium with ultramafic mineral assemblages at P-T conditions of 2–3 GPa and 400–800°C to encompass hot and cold subduction zones. Minerals are specified in the input files and their saturation controls equilibrium concentrations of aqueous species. Aqueous species dissociation reactions, mineral dissolution reactions, and associated equilibrium constants are listed in the output files. Log fO2 is varied from FMQ-2 to FMQ+4. Saturation with a sulfur-bearing mineral (pyrrhotite, pyrite or anhydrite) determines sulfur solubility. Full fluid speciation, mineral saturation states and hypothetical solid solutions can be found in the output files.', '4', '28-May-2024');
