insert into dataset values ('doi:10.7281/T1/LJZQPI', 'Data association with the publication entitled: ''Demonstrating the Impact of POLST Forms on Hospital Care Requires Information not Contained in State Registries''', 'https://doi.org/10.7281/T1/LJZQPI', 'Files contain project data and statistical code in R associated with the related publication. Background: Physician Orders for Life-Sustaining Treatment (POLST) programs have expanded rapidly, but evaluating their impact on hospital care is challenging. Objectives: To demonstrate how careful study design can reveal POLST’s impact at hospital admission and why analyses of state registry data are unlikely to capture POLST’s effects. Design: Prospective cohort study Setting and Participants: Adult in-patients with Do Not Intubate and/or Do Not Resuscitate (DNR/I) orders in the electronic medical record at the time of discharge from Johns Hopkins Hospital over 18 months. For patients with unplanned readmissions within 30 days, records were reviewed to determine if a Maryland Medical Order for Life-Sustaining Treatment (MOLST) form was presented and for the time from readmission to a DNR/I order in the EMR. Analyses were stratified by whether patients could communicate or were accompanied b', '21-Jun-2019', '14', '2', '105', '1', '2');
insert into dataset values ('doi:10.7281/T1/4F90KQ', 'Data associated with publication "Biologically inspired catheter for endovascular sensing and navigation"', 'https://doi.org/10.7281/T1/4F90KQ', 'Minimally invasive treatment of vascular disease demands dynamic navigation through complex blood vessel pathways and accurate placement of an interventional device, which has resulted in increased reliance on fluoroscopic guidance and commensurate radiation exposure to the patient and staff. Here we introduce a guidance system inspired by electric fish that incorporates measurements from a newly designed electrogenic sensory catheter with preoperative imaging to provide continuous feedback to guide vascular procedures without additional contrast injection, radiation, image registration, or external tracking. Electrodes near the catheter tip simultaneously create a weak electric field and measure the impedance, which changes with the internal geometry of the vessel as the catheter advances through the vasculature. The impedance time series is then mapped to a preoperative vessel model to determine the relative position of the catheter within the vessel tree. We present navigation in a', '09-Apr-2020', '157', '4', '1', '2', '2');
