insert into dataset values ('doi:10.7281/T1/87PH8T', 'Data and software associated with the publication “De novo learning versus adaptation of continuous control in a manual tracking task”', 'https://doi.org/10.7281/T1/87PH8T', 'This collection contains the raw data and analysis code to reproduce the figures in the above publication. We sought to test whether human participants were capable of building controllers de novo to counter either a rotation or a mirror-reversal of visual feedback. To do so, we trained participants to counter these perturbations in a point-to-point reaching task and assessed their control capabilities in a sum-of-sinusoids tracking task. We analyzed their reaching trajectories using a frequency-domain system identification approach. The data were collected in the BLAM Lab at Johns Hopkins University. A README.md file is included in every .zip file with instructions on how to run the analyses. Each .zip file can be run independently of the others.', '30-Jun-2021', '86', '4', '115', 'NA', '2');
insert into dataset values ('doi:10.7281/T1/87PH8T', 'Data and software associated with the publication “De novo learning versus adaptation of continuous control in a manual tracking task”', 'https://doi.org/10.7281/T1/87PH8T', 'This collection contains the raw data and analysis code to reproduce the figures in the above publication. We sought to test whether human participants were capable of building controllers de novo to counter either a rotation or a mirror-reversal of visual feedback. To do so, we trained participants to counter these perturbations in a point-to-point reaching task and assessed their control capabilities in a sum-of-sinusoids tracking task. We analyzed their reaching trajectories using a frequency-domain system identification approach. The data were collected in the BLAM Lab at Johns Hopkins University. A README.md file is included in every .zip file with instructions on how to run the analyses. Each .zip file can be run independently of the others.', '30-Jun-2021', '86', '4', '116', 'NA', '2');
insert into dataset values ('doi:10.7281/T1/87PH8T', 'Data and software associated with the publication “De novo learning versus adaptation of continuous control in a manual tracking task”', 'https://doi.org/10.7281/T1/87PH8T', 'This collection contains the raw data and analysis code to reproduce the figures in the above publication. We sought to test whether human participants were capable of building controllers de novo to counter either a rotation or a mirror-reversal of visual feedback. To do so, we trained participants to counter these perturbations in a point-to-point reaching task and assessed their control capabilities in a sum-of-sinusoids tracking task. We analyzed their reaching trajectories using a frequency-domain system identification approach. The data were collected in the BLAM Lab at Johns Hopkins University. A README.md file is included in every .zip file with instructions on how to run the analyses. Each .zip file can be run independently of the others.', '30-Jun-2021', '86', '4', '117', 'NA', '2');
insert into dataset values ('doi:10.7281/T1/EP0W7Y', 'Dataset: Audio-visual representations of object drops', 'https://doi.org/10.7281/T1/EP0W7Y', 'As robots perform manipulation tasks and interact with objects, it is probable that they accidentally drop objects that subsequently bounce out of their visual fields (e.g., due to an inadequate grasp of an unfamiliar object). To enable robots to recover from such errors, we draw upon the concept of object permanence—objects remain in existence even when they are not being sensed (e.g., seen) directly. This dataset was created to address the above challenge. The data was collected by having a Kinova Gen3 Robot Arm repeatedly pick up a wooden cube (3cm x 3cm x 3cm) and release the cube 0.3 meters above a table surface. A 7-channel microphone array was used to record the impact sound from when the robot gripper opened to drop the cube. A camera mounted on the robot’s wrist observed the beginning of the cube’s trajectory before the cube bounced out of view, and a ceiling camera recorded the rest of the trajectory. Audio recordings were saved as WAV files, and the cube’s trajectory was sav', '28-Oct-2020', '40', '4', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/VSW3JU', 'Data and code associated with the publication: Characterization of geographic mobility among participants in facility- and community-based tuberculosis case finding in urban Uganda', 'https://doi.org/10.7281/T1/VSW3JU', 'This dataset is an anonymized subset of the data collected by the STOMP-TB study (A Comprehensive Snapshot of Tuberculosis Transmission in an Urban Ugandan Community). The dataset includes records from: 1. patients who were diagnosed with pulmonary TB through routine care at one of four health facilities in Kampala, Uganda; 2. control patients who underwent TB evaluation with a negative result at the same facilities; 3. patients who were diagnosed with TB during a community-based active case finding campaign; and 4. control individuals who tested negative for TB during a community-based active case finding campaign. The included variables were used for analysis of geographic mobility and its association with TB disease in the publication “Characterization of geographic mobility among participants in facility- and community-based tuberculosis case finding in urban Uganda” by KO Robsky et al. (PLOS One, published May 14, 2021).', '26-May-2021', '87', '4', '125', 'NA', '2');
insert into dataset values ('doi:10.7281/T1/VSW3JU', 'Data and code associated with the publication: Characterization of geographic mobility among participants in facility- and community-based tuberculosis case finding in urban Uganda', 'https://doi.org/10.7281/T1/VSW3JU', 'This dataset is an anonymized subset of the data collected by the STOMP-TB study (A Comprehensive Snapshot of Tuberculosis Transmission in an Urban Ugandan Community). The dataset includes records from: 1. patients who were diagnosed with pulmonary TB through routine care at one of four health facilities in Kampala, Uganda; 2. control patients who underwent TB evaluation with a negative result at the same facilities; 3. patients who were diagnosed with TB during a community-based active case finding campaign; and 4. control individuals who tested negative for TB during a community-based active case finding campaign. The included variables were used for analysis of geographic mobility and its association with TB disease in the publication “Characterization of geographic mobility among participants in facility- and community-based tuberculosis case finding in urban Uganda” by KO Robsky et al. (PLOS One, published May 14, 2021).', '26-May-2021', '87', '4', '126', 'NA', '2');
insert into dataset values ('doi:10.7281/T1/EHSEV2', 'Data associated with the publication: Sedimentary pyrite formation in a seasonally oxygen-stressed estuary: potential imprints of microbial ecology and position-specific isotope fractionation', 'https://doi.org/10.7281/T1/EHSEV2', 'This study focuses on geochemical analyses of shallow sediments from two sites in Chesapeake Bay. We used these analyses to study the effects of seasonal oxygen decline and biological turnover on pyrite burial rates and pyrite sulfur isotope compositions. Pyrite burial in marine and estuarine sediments is a key process that impacts oxygen levels in the ocean-atmosphere system over geological timescales. Pyrite’s sulfur isotope composition can also be used to study ancient environmental conditions. We found that at both studied sites, pyrite primarily forms in the summer and dissolves in the winter. The more frequently ventilated site had higher pyrite concentrations because of higher rates of formation in the summer, which may be influenced by sulfur oxidizing microbial communities. Despite differences in rates of pyrite formation between sites, sulfur isotope ratios (34S/32S) of pyrite are similar between the sites and are lower than the 34S/32S ratios of coexisting pyrite precursors.', '03-Apr-2023', '9', '4', '161', '1', '2');
insert into dataset values ('doi:10.7281/T1/EHSEV2', 'Data associated with the publication: Sedimentary pyrite formation in a seasonally oxygen-stressed estuary: potential imprints of microbial ecology and position-specific isotope fractionation', 'https://doi.org/10.7281/T1/EHSEV2', 'This study focuses on geochemical analyses of shallow sediments from two sites in Chesapeake Bay. We used these analyses to study the effects of seasonal oxygen decline and biological turnover on pyrite burial rates and pyrite sulfur isotope compositions. Pyrite burial in marine and estuarine sediments is a key process that impacts oxygen levels in the ocean-atmosphere system over geological timescales. Pyrite’s sulfur isotope composition can also be used to study ancient environmental conditions. We found that at both studied sites, pyrite primarily forms in the summer and dissolves in the winter. The more frequently ventilated site had higher pyrite concentrations because of higher rates of formation in the summer, which may be influenced by sulfur oxidizing microbial communities. Despite differences in rates of pyrite formation between sites, sulfur isotope ratios (34S/32S) of pyrite are similar between the sites and are lower than the 34S/32S ratios of coexisting pyrite precursors.', '03-Apr-2023', '9', '4', '162', '1', '2');
