insert into dataset values ('doi:10.7281/T1/FWDYPW', 'Data, code and supplementary figures associated with the publication: Control becomes habitual early on when learning a novel motor skill', 'https://doi.org/10.7281/T1/FWDYPW', 'This collection contains raw data and analysis code to reproduce the main figures in the above publication. This collection also contains supplementary figures associated with the publication. We examined how participants’ behavior became habitual as they learned a new continuous motor skill. Participants learned to control a cursor using a bimanual mapping by performing a combination of point-to-point reaches and continuous tracking. The data were collected in the BLAM Lab at Johns Hopkins University. A README.md file is included in every .zip file with instructions on how to run the analyses. Each .zip file can be run independently of the others.', '06-Oct-2022', '45', '5', '115', 'NA', '2');
