insert into dataset values ('doi:10.7281/T1/UP8RWD', 'Data associated with the publication: An extended minimal model of OGTT: Estimation of alpha- and beta-cell dysfunction, insulin resistance, and the incretin effect', 'https://doi.org/10.7281/T1/UP8RWD', 'Loss of insulin sensitivity, alpha- and beta-ll dysfunction, and impairment in incretin effect have all been implicated in the pathophysiology of type 2 diabetes (T2D). Parsimonious mathematical models are useful in quantifying parameters related to the pathophysiology of T2D. Here we extend the minimum model developed to describe the glucose-insulin-glucagon dynamics in the isoglycemic intravenous glucose infusion (IIGI) experiment to the oral glucose tolerance test (OGTT). The extended model describes glucose and hormone dynamics in OGTT including the contribution of the incretin hormones, glucose-dependent insulinotropic polypeptide (GIP) and glucagon-like peptide-1 (GLP-1), to insulin secretion. A new function describing glucose arrival from the gut is introduced. The model is fitted to OGTT data from 8 individuals with T2D and 8 weight-matched controls (CS) without diabetes to obtain parameters related to insulin sensitivity, beta- and alpha-cell function. The parameters, i.e., me', '07-Dec-2023', '21', '5', 'NA', '1', '2');
