insert into dataset values ('doi:10.7281/T1/ZQZX80', 'Data associated with the manuscript by Zhang et al. The impact of strain-specific biofilm properties on the retention of microplastic in stormwater biofilters', 'https://doi.org/10.7281/T1/ZQZX80', 'Stormwater biofilters have variable colloidal particle removal efficiencies that may be due to different characteristics of microorganisms colonizing them during normal operation. Little is known about how naturally occurring bacteria modify the surface properties of the filtration media, or how these modifications affect colloidal microplastic removal. We used simulated infiltration through model sand columns to study the impact of colonizing microorganisms on the retention of model colloidal microplastic particles, carboxyl-modified-latex (CML) beads. Four naturally occurring stormwater bacterial strains inhibited bead retention compared to a clean bed in a cell-density independent manner, while a model biofilm forming microorganism (Pseudomonas aeruginosa) enhanced retention likely due to physical straining. Atomic force microscopy (AFM) was applied to analyze interaction energy between CML and each bacterial strain biofilm surface. We found that interaction energy between CML and e', '05-Dec-2019', '37', '6', '106', '1', '2');
