insert into dataset values ('doi:10.7281/T1/T81CEP', 'Data and code associated with the publication: Spatial distribution of people diagnosed with tuberculosis through routine and active case finding: a community-based study in Kampala, Uganda (STOMP-TB Study)', 'https://doi.org/10.7281/T1/T81CEP', 'Study Overview and Population: This was a community-based study conducted in Kisugu, Wabigalo, and Bukasa parishes in Kampala, Uganda (an area of 2.2 km2 with an estimated population of 49,527) from May 2018 through December 2019. The study site consists of 37 contiguous zones; zones are the smallest standard administrative area unit used by the Uganda Bureau of Statistics, with a median size of 0.05km2 within the study area. Case definition: A TB case was defined as any individual with a positive sputum smear or GeneXpert result, sputum culture positive for Mycobacterium tuberculosis, or documented initiation of TB treatment based on clinical judgment of pulmonary tuberculosis. In this analysis, we included only individuals who were age 15 years or older and residing within the study area; zone of residence was self-reported and verified using landmarks and Google Maps. Case Detection and Enrollment: The study prospectively enrolled TB patients in two phases: a facility-based phase (M', '24-Jun-2020', '61', '6', 'NA', 'NA', '2');
insert into dataset values ('doi:10.7281/T1/QUDBC6', 'Data associated with: The Maryland Food System Map', 'https://doi.org/10.7281/T1/QUDBC6', 'This dataset contains geospatial data, code, and documentation relevant to the Maryland Food System Map, a web mapping application maintained by the Johns Hopkins Center for a Livable Future between 2012 and 2023. Approximately 500 geospatial data layers that were featured on the application have been preserved here for use in future analyses of the food system in Maryland. The code behind the application has also been preserved in this dataset and can be used to better understand how the application worked and to develop similar applications in the future. The documentation provides more information about the Maryland Food System Map, including both the history of the application and how it was used. There is also metadata about when and where the data for data layers were obtained.', '12-Jun-2023', '263', '6', '138', '1', '2');
insert into dataset values ('doi:10.7281/T1/AVOEQR', 'Data associated with the publication: Cholinergic reinforcement signaling is impaired by amyloidosis prior to its synaptic loss.', 'https://doi.org/10.7281/T1/AVOEQR', 'Alzheimer''s Disease (AD) is associated with amyloidosis and dysfunction of the cholinergic system which is crucial for learning and memory. However, the nature of acetylcholine signaling within regions of cholinergic-dependent plasticity and how it changes with experience is poorly understood, much less the impact of amyloidosis on this signaling. Therefore, we optically measure the release profile of acetylcholine to unexpected, predicted, and predictive events in visual cortex (VC)—a site of known cholinergic-dependent plasticity—in a preclinical mouse model of AD that develops amyloidosis. We find that acetylcholine exhibits reinforcement signaling qualities, reporting behaviorally-relevant outcomes and displaying release profiles to predictive and predicted events that change as a consequence of experience. We identify three stages of amyloidosis occurring prior to the degeneration of cholinergic synapses within VC and observe that cholinergic responses in amyloid-bearing mice beco', '12-Oct-2023', '24', '6', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/VNFY91', 'Data associated with the publication: Trends in estuarine pyrite formation point to an alternative model for Paleozoic pyrite burial', 'https://doi.org/10.7281/T1/VNFY91', 'This data set contains three components. Component 1 is a set of geochemical data from sediment cores collected from the Chesapeake Bay (Maryland and Virginia, USA). Component 2 is a spreadsheet containing a modified copy of a geochemical dataset downloaded from Phase 1 of the Sedimentary Geochemistry and Paleoenvironments repository (Farrell et al., 2021; doi.org/10.1111/gbi.12462) in August 2023. A text file associated with Component 2 describes how the data in the spreadsheet have been filtered from the original SGP download. Component 3 contains a modified section of code from the COPSE biogeochemical model (Lenton et al., 2018; doi.org/10.1016/j.earscirev.2017.12.004) as well a Matlab file (.mat format) that contains vectors for use in the modified section of code.', '15-Sep-2023', '36', '6', '161', '1', '2');
insert into dataset values ('doi:10.7281/T1/VNFY91', 'Data associated with the publication: Trends in estuarine pyrite formation point to an alternative model for Paleozoic pyrite burial', 'https://doi.org/10.7281/T1/VNFY91', 'This data set contains three components. Component 1 is a set of geochemical data from sediment cores collected from the Chesapeake Bay (Maryland and Virginia, USA). Component 2 is a spreadsheet containing a modified copy of a geochemical dataset downloaded from Phase 1 of the Sedimentary Geochemistry and Paleoenvironments repository (Farrell et al., 2021; doi.org/10.1111/gbi.12462) in August 2023. A text file associated with Component 2 describes how the data in the spreadsheet have been filtered from the original SGP download. Component 3 contains a modified section of code from the COPSE biogeochemical model (Lenton et al., 2018; doi.org/10.1016/j.earscirev.2017.12.004) as well a Matlab file (.mat format) that contains vectors for use in the modified section of code.', '15-Sep-2023', '36', '6', '162', '1', '2');
