insert into dataset values ('doi:10.7281/T1/C6MCOX', 'Data and software associated with publication "Sensory Cues Modulate Smooth Pursuit and Active Sensing Movements"', 'https://doi.org/10.7281/T1/C6MCOX', 'This project includes data from experiments conducted with weakly electric fish Eigenmannia virescens while tracking a moving refuge. In this project we studied how the sensory cues in the environment modulate the smooth pursuit and active sensing movements of Eigenmannia. To examine this, we altered the visual and electrosensory cues for refuge tracking and measured the fore-aft movements of the fish. Specifically, we altered the length and structure of the refuge and performed experiments with light and in complete darkness. The data were collected in the LIMBS laboratory at JHU. The project includes raw data files for each experiment conducted with the fish, processed data files, and MATLAB scripts for data analysis and reproduction of the result figures of Uyanik and Stamper et al., Frontiers in Behavioral Neuroscience (Special Issue on Active Sensing), 2019.', '29-Apr-2019', '439', '7', '4', '1', '2');
