insert into dataset values ('doi:10.7281/T1/IFSXNV', 'Data and code associated with the publication: Automatic Annotation of Hip Anatomy in Fluoroscopy for Robust and Efficient 2D/3D Registration', 'https://doi.org/10.7281/T1/IFSXNV', 'This collection contains data and code associated with the IPCAI/IJCARS 2020 paper “Automatic Annotation of Hip Anatomy in Fluoroscopy for Robust and Efficient 2D/3D Registration.” The data hosted here consists of annotated datasets of actual hip fluoroscopy, CT and derived data from six lower torso cadaveric specimens. Documentation and examples for using the dataset and Python code for training and testing the proposed models are also included. Higher-level information, including clinical motivations, prior works, algorithmic details, applications to 2D/3D registration, and experimental details, may be found in the companion paper which is available at https://arxiv.org/abs/1911.07042 or https://doi.org/10.1007/s11548-020-02162-7. We hope that this code and data will be useful in the development of new computer-assisted capabilities that leverage fluoroscopy.', '15-Oct-2020', '2153', '7', 'NA', 'NA', '1');
insert into dataset values ('doi:10.7281/T1/0L0OA0', 'Data associated with: Toward accurate cerebral blood flow estimation in mice after accounting for anesthesia', 'https://doi.org/10.7281/T1/0L0OA0', 'The deposited data contains the dataset of an MRI study focusing at correcting the anesthetic effects of isoflurane on CBF measurements in mice. Major data are the original MRI data generated by the Bruker Biospec 11.7T MRI system with other data generated from the processing of the original data using the MATLAB.', '08-May-2023', '14', '7', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/PIVKJ7', 'Data associated with the publication: Internal states as a source of subject-dependent movement variability are represented by large-scale brain networks.', 'https://doi.org/10.7281/T1/PIVKJ7', 'This repository contains the data and scripts used to generate the plots for the publication “Internal states as a source of subject-dependent movement variability and their representation by large-scale networks in the human brain.” It contains 6 folders. _data contains neural and behavioral data at various stages of processing as .mat files. _figures is where the figures will be saved after running the scripts saved as a .pdf. _library contains scripts downloaded from MATLAB’s File Exchange used for generating the figures. _scripts contains custom MATLAB scripts .m files used to generate the figures. Run MAIN.m to generate figures. Scripts and functions were created using MATLAB_R2021b. _table contains tables used for generating figures. It contains excel files and .txt files. _toolboxes contains the version of the open-source software used to generate the figures. The intended use of this code is to generate the figures for the publication from the processed data.', '16-Nov-2023', '7', '7', 'NA', '2', '2');
insert into dataset values ('doi:10.7281/T1/QQ77OB', 'Data and supplemental material associated with the publication: De novo motor learning of a bimanual control task over multiple days of practice', 'https://doi.org/10.7281/T1/QQ77OB', 'This repository contains Supplemental Materials for the above publication, along with raw data and code for analysis and plotting of data. In this paper, we examined how participants learned to control an on-screen cursor via a non-intuitive bimanual control interface over multiple days of practice. The data were collected in the BLAM Lab at Johns Hopkins University. A readme.txt file is included in every .zip file with instructions on how to run the analyses. Each .zip file can be run independently of the others.', '27-Sep-2022', '47', '6', '115', '1', '2');
