insert into dataset values ('doi:10.7281/T1/NLHSKE', 'Data associated with the publication: Reaction path model of the formation of abiotic immiscible hydrocarbon fluids in subducted carbonated serpentinites, Lanzo Massif (Western Italian Alps)', 'https://doi.org/10.7281/T1/NLHSKE', 'This data file contains supplementary information of the manuscript titled of “Reaction Path Model of the Formation of Abiotic Immiscible Hydrocarbon Fluids in Subducted Carbonated Serpentinites, Lanzo Massif (Western Italian Alps)”. The model simulated H2 fluid reacting with carbonated serpentinites consisting of aragonite and serpentinite. The initial rock compositions are 15 vol% aragonite and 85 vol% serpentinite; 30 vol% aragonite and 70 vol% serpentinite; and 50 vol% aragonite and 50 vol% serpentinite. The reactions were modeled at 400 to 500 °C and 1.0 to 2.0 GPa with fluid/rock (F/R) ratio of 0.1 and trace amount of initial C in fluids. The word document contains the description of model files and tables about the summary of the initial and final fluid compositions and mineral assemblages. The files contain model results at 2.0 GPa 400 °C, 1.0 GPa 400 °C, 1.5 GPa 400 °C, 2.0 GPa 450 °C, and 2.0 GPa, 500 °C. Each file consists of the EQ6 code package including DATA0, data1, EQ6', '02-Jun-2023', '92', '9', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/UDTJPD', 'Data associated with publication “Variability in Locomotor Dynamics Reveals the Critical Role of Feedback in Task Control”', 'https://doi.org/10.7281/T1/UDTJPD', 'This project includes data from experiments conducted with weakly electric fish Eigenmannia virescens while tracking a moving a refuge. In this project, we studied the effect of sensory feedback on the variability of task performance. To examine this, we used data-driven system identification techniques to estimate transfer function models for the input—output behavioral response and the plant dynamics of the fish. We then, back-calculated associated sensorimotor controllers both in feedforward and feedback control topologies. Swapping controllers and plants across individuals in different control topologies allowed us to analyze the effect of sensory feedback on the variability of task performance. The project includes the data files for each experiment conducted with the fish.', '20-Feb-2020', '242', '10', '1', 'NA', '2');
