insert into dataset values ('doi:10.7281/T1/I0H3GY', 'Data associated with the publication: Expanding the monolayer scope for nucleic acid-based electrochemical sensors beyond thiols on gold: Alkylphosphonic acids on ITO', 'https://doi.org/10.7281/T1/I0H3GY', 'Electrochemical biosensors are a powerful and rapidly evolving molecular monitoring technology. Evidenced by the success of the continuous glucose monitor in managing Type 1 Diabetes, these sensors are capable of precise, accurate measurements in unprocessed biological environments. Nucleic acid-based electrochemical sensors (NBEs) are a specific type of biosensor that employs the target binding and conformational dynamics of nucleic acids for signal transduction. Currently, the vast majority of NBEs are fabricated via self-assembly of alkylthiols on Au electrodes. However, this architecture is limited in scope, as Au electrodes are not universally deployable for all potential NBE applications. Here, to expand the repertoire of materials on which NBEs can be made, we describe the multistep procedure for creating sensing monolayers of alkylphosphonic acids on a conductive oxide surface. Using such monolayers on indium tin oxide (ITO)-coated glass slides, we couple redox reporter-modifie', '21-Jul-2023', '23', '12', '144', '1', '2');
