insert into dataset values ('doi:10.7281/T1/VZYIRV', 'Data associated with the publication: Temporal interference current stimulation in peripheral nerves is not driven by envelope extraction', 'https://doi.org/10.7281/T1/VZYIRV', 'Most data consists of electromyogram data from the rat biceps femoris and plantar muscles following electrical stimulation of the sciatic nerve. We used a variety of stimulation parameters, which are shared in the accompanying article. We created COMSOL models of the fields that these stimulation parameters created, which are also shared. We include the signals processing steps to reproduce our figures, for transparency.', '17-Apr-2023', '101', '13', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/XTSKOW', 'Data and software associated with publication "High-resolution behavioral mapping of electric fishes in Amazonian habitats"', 'https://doi.org/10.7281/T1/XTSKOW', 'This project includes datasets with recordings of weakly electric fish Eigenmannia virescens using grids of spatially distributed electrodes. These were collected in the LIMBS laboratory at JHU in 2014, and at the Terra Ronca cave in Brazil in 2016. The project also includes code for (1) analyzing the overhead images or video and extracting fish locations, (2) implementing the algorithms described in the publication for estimating fish positions and orientations using electrode measurements alone, and (3) reproducing the result figures from the publication that show the efficacy of electrode-based tracking as compared to video-based tracking.', '19-Sep-2017', '1817', '29', '1', '1', '2');
