insert into dataset values ('doi:10.7281/T1/FIS2QT', 'Data and code associated with the publication “Feedbacks driving interdecadal variability in Southern Ocean convection in climate models: A coupled oscillator mechanism”', 'https://doi.org/10.7281/T1/FIS2QT', 'This dataset contains output from three coupled climate models used to look at the variability of Southern Ocean. Model output generated using the ESM2Mc model described in Galbraith et al., Climate variability and radiocarbon in the CM2Mc Earth System Model , Journal of Climate., 24 , 4230-4254, https://doi.org/10.1175/2011JCLI3919.1 with several variants of the mixing coefficient. Runscript for the AREDI400 version of the model showing all parameters is provided as file 27. Files are divided into datasets followed by “.nc”, Matlab scripts (flat text) followed by a “.m”, and a flat text runscript file without a suffix.', '17-Jun-2020', '108', '28', 'NA', 'NA', '2');
insert into dataset values ('doi:10.7281/T1/VWR4GR', 'Data and software associated with Seviour et al. 2017, The Stability of Mars’ Annular Polar Vortex', 'https://doi.org/10.7281/T1/VWR4GR', 'The Martian polar atmosphere is known to have a persistent local minimum in potential vorticity (PV) near the winter pole, with a region of high PV encircling it. This finding is surprising since an isolated band of PV is barotropically unstable, a result going back to Rayleigh. Here we investigate the stability of a Mars-like annular vortex using numerical integrations of the rotating shallow water equations. We show how the mode of instability and its growth rate depends upon the latitude and width of the annulus. By introducing thermal relaxation towards an annular equilibrium profile with a time scale similar to that of the instability, we are able to simulate a persistent annular vortex with similar characteristics as that observed in the Martian atmosphere. This time scale, typically 0.5-2 sols, is similar to radiative relaxation time scales for Mars’ polar atmosphere. We also demonstrate that the persistence of an annular vortex is robust to topographic forcing, as long as it is', '23-Feb-2017', '55', '14', '53', '1', '2');
