insert into dataset values ('doi:10.7281/T1/WVEABK', 'Data associated with the publication: Perceptual specializations for processing species-specific vocalizations in the common marmoset (Callithrix jacchus)', 'https://doi.org/10.7281/T1/WVEABK', 'How humans and animals segregate sensory information into discrete, behaviorally meaningful categories is one of the hallmark questions in neuroscience. Much of the research around this topic in the auditory system has centered around human speech perception, in which categorical processes result in an enhanced sensitivity for acoustically meaningful differences and a reduced sensitivity for nonmeaningful distinctions. Much less is known about whether non-human primates process their species-specific vocalizations in a similar manner. We address this question in the common marmoset, a small arboreal New World primate with a rich vocal repertoire produced across a range of behavioral contexts. We first show that marmosets perceptually categorize their vocalizations in ways that correspond to previously defined call types for this species. Next, we show that marmosets are differentially sensitive to changes in particular acoustic features of their most common call types, and that these s', '25-May-2023', '87', '15', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/OM3OMQ', 'Data and code associated with the publication “Sensitivity of catchment transit times to rainfall variability under present and future climates”', 'https://doi.org/10.7281/T1/OM3OMQ', 'This data and code were used to generate the figures in the publication “Sensitivity of catchment transit times to rainfall variability under present and future climates”.', '23-Oct-2017', '255', '16', '56', '1', '2');
insert into dataset values ('doi:10.7281/T1/ORP47N', 'Data associated with the publication: Bilateral widefield calcium imaging reveals circuit asymmetries and lateralized functional activation of mouse auditory cortex.', 'https://doi.org/10.7281/T1/ORP47N', 'The deposited data includes MATLAB scripts (.m files) and the corresponding data (.mat files) required to reproduce the figures in the publication. Additional calcium dynamic traces for each animal are also included. Data are stored in either .mat files or .tif files. Some text files (.txt) are included for instruction on using the MATLAB scripts (.m files) for generating figures.', '12-Oct-2023', '32', '17', '140', '1', '2');
