insert into dataset values ('doi:10.7281/T1/HRK27V', 'Data associated with the publication: The cellular architecture of memory modules in Drosophila supports stochastic input integration', 'https://doi.org/10.7281/T1/HRK27V', 'Article abstract: The ability to associate neutral stimuli with valence information and to store these associations as memories forms the basis for decision making. To determine the underlying computational principles, we build a realistic computational model of a central decision module within the Drosophila mushroom body (MB), the fly’s center for learning and memory. Our model combines the electron microscopy-based architecture of one MB output neuron (MBON-alpha 3), the synaptic connectivity of its 948 presynaptic Kenyon cells (KCs), and its in vivo membrane properties obtained from patch-clamp recordings. We show that this neuron is electrotonically compact and that synaptic input corresponding to simulated odor input robustly drives its spiking behavior. Therefore, sparse innervation by KCs can efficiently control and modulate MBON activity in response to learning with minimal requirements on the specificity of synaptic localization. This architecture allows efficient storage of', '07-Mar-2022', '148', '17', '134', '1', '2');
insert into dataset values ('doi:10.7281/T1/HRK27V', 'Data associated with the publication: The cellular architecture of memory modules in Drosophila supports stochastic input integration', 'https://doi.org/10.7281/T1/HRK27V', 'Article abstract: The ability to associate neutral stimuli with valence information and to store these associations as memories forms the basis for decision making. To determine the underlying computational principles, we build a realistic computational model of a central decision module within the Drosophila mushroom body (MB), the fly’s center for learning and memory. Our model combines the electron microscopy-based architecture of one MB output neuron (MBON-alpha 3), the synaptic connectivity of its 948 presynaptic Kenyon cells (KCs), and its in vivo membrane properties obtained from patch-clamp recordings. We show that this neuron is electrotonically compact and that synaptic input corresponding to simulated odor input robustly drives its spiking behavior. Therefore, sparse innervation by KCs can efficiently control and modulate MBON activity in response to learning with minimal requirements on the specificity of synaptic localization. This architecture allows efficient storage of', '07-Mar-2022', '148', '17', '135', '1', '2');
insert into dataset values ('doi:10.7281/T1/7ELIJW', 'Data associated with publication: AbdomenAtlas-8K: Annotating 8,000 CT volumes for multi-organ segmentation in three weeks', 'https://doi.org/10.7281/T1/7ELIJW', 'AbdomenAtlas 1.0 is a fully annotated CT dataset, comprising 5,195 CT volumes that include per-voxel annotations for nine anatomical structures: the spleen, liver, (L/R) kidneys, stomach, gallbladder, pancreas, aorta, and inferior vena cava (IVC). The CT volumes are sourced from 26 hospitals across eight countries. More information can be found at Dataset | Zongwei Zhou and the associated publications and GitHub site listed in the Software section. This collection consists of duplicate copies of the full CT dataset in the Files section to provide two options for downloading. The complete AbdomenAtlas 314GB uncompressed .zip file may take 2 to 8 hours to download depending on network speeds and connection stability. The second “BDMAP” sets are the same files split into approximately 20GB folders that generally download in less than one hour on slower networks. See the README for instructions for downloading and viewing individual files as samples before downloading complete sets.', '26-Apr-2024', '144', '18', '160', '1', '2');
insert into dataset values ('doi:10.7281/T1/U5GUV3', 'Data associated with the publication: Stability of N-Heterocyclic carbene monolayers under continuous voltammetric interrogation', 'https://doi.org/10.7281/T1/U5GUV3', 'N-Heterocyclic carbenes (NHCs) are promising monolayer-forming ligands that can overcome limitations of thiol-based monolayers in terms of stability, surface functionality and reactivity across a variety of transition metal surfaces. Recent publications have reported the ability of NHCs to support biomolecular receptors on gold substrates for sensing applications, and improved tolerance to prolonged biofluid exposure relative to thiols. However, important questions remain regarding the stability of these monolayers when subjected to voltage perturbations, which is needed for applications with electrochemical platforms. Here, we investigate the ability of two NHCs, 1,3-diisopropylbenzimidazole and 5-(ethoxycarbonyl)-1,3-diisopropylbenzimidazole, to form monolayers via self-assembly from methanolic solutions of their trifluoromethanesulfonate salts. We compare the electrochemical behavior of the resulting monolayers relative to that of benchmark mercaptohexanol monolayers in phosphate-bu', '16-Aug-2023', '34', '22', '144', '1', '2');
insert into dataset values ('doi:10.7281/T1/U5GUV3', 'Data associated with the publication: Stability of N-Heterocyclic carbene monolayers under continuous voltammetric interrogation', 'https://doi.org/10.7281/T1/U5GUV3', 'N-Heterocyclic carbenes (NHCs) are promising monolayer-forming ligands that can overcome limitations of thiol-based monolayers in terms of stability, surface functionality and reactivity across a variety of transition metal surfaces. Recent publications have reported the ability of NHCs to support biomolecular receptors on gold substrates for sensing applications, and improved tolerance to prolonged biofluid exposure relative to thiols. However, important questions remain regarding the stability of these monolayers when subjected to voltage perturbations, which is needed for applications with electrochemical platforms. Here, we investigate the ability of two NHCs, 1,3-diisopropylbenzimidazole and 5-(ethoxycarbonyl)-1,3-diisopropylbenzimidazole, to form monolayers via self-assembly from methanolic solutions of their trifluoromethanesulfonate salts. We compare the electrochemical behavior of the resulting monolayers relative to that of benchmark mercaptohexanol monolayers in phosphate-bu', '16-Aug-2023', '34', '22', '145', '1', '2');
