insert into dataset values ('doi:10.7281/T1/U5GUV3', 'Data associated with the publication: Stability of N-Heterocyclic carbene monolayers under continuous voltammetric interrogation', 'https://doi.org/10.7281/T1/U5GUV3', 'N-Heterocyclic carbenes (NHCs) are promising monolayer-forming ligands that can overcome limitations of thiol-based monolayers in terms of stability, surface functionality and reactivity across a variety of transition metal surfaces. Recent publications have reported the ability of NHCs to support biomolecular receptors on gold substrates for sensing applications, and improved tolerance to prolonged biofluid exposure relative to thiols. However, important questions remain regarding the stability of these monolayers when subjected to voltage perturbations, which is needed for applications with electrochemical platforms. Here, we investigate the ability of two NHCs, 1,3-diisopropylbenzimidazole and 5-(ethoxycarbonyl)-1,3-diisopropylbenzimidazole, to form monolayers via self-assembly from methanolic solutions of their trifluoromethanesulfonate salts. We compare the electrochemical behavior of the resulting monolayers relative to that of benchmark mercaptohexanol monolayers in phosphate-bu', '16-Aug-2023', '34', '22', '147', '1', '2');
insert into dataset values ('doi:10.7281/T1/IHPXXR', 'Data associated with the publication: Explaining the decay of nucleic acid-based sensors under continuous voltammetric interrogation', 'https://doi.org/10.7281/T1/IHPXXR', 'Nucleic acid-based electrochemical sensors (NBEs) can support continuous and highly selective molecular monitoring in biological fluids, in vitro and in vivo, via affinity-based interactions. Such interactions afford a sensing versatility that is not supported by strategies that depend on target-specific reactivity. Thus, NBEs have significantly expanded the scope of molecules that can be monitored continuously in biological systems. However, the technology is limited by the lability of the thiol-based monolayers employed for sensor fabrication. Seeking to understand the main drivers of monolayer degradation, we studied four possible mechanisms of NBEs decay: (i) passive desorption of monolayer elements in undisturbed sensors, (ii) voltage-induced desorption under continuous voltammetric interrogation, (iii) competitive displacement by thiolated molecules naturally present in biofluids like serum, and (iv) protein binding. Our results indicate that voltage-induced desorption of monolay', '15-May-2023', '33', '23', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/DX9DL8', 'Data and software associated with publication "Closed-Loop Control of Active Sensing Movements Regulates Sensory Slip”', 'https://doi.org/10.7281/T1/DX9DL8', 'This project includes datasets of experiments conducted with weakly electric fish Eigenmannia virescens while tracking a moving refuge. In this project we studied how the reafferent feedback shapes the active movement of E. viresecens. To test this, we created a novel experimental apparatus that allowed us to manipulate the gain of reafferent feedback in freely swimming weakly electric fish in different experimental topologies -- open- and closed-loop control. The data were collected in the LIMBS laboratory at JHU in 2016. The project includes raw (.csv) as well as the processed data (.mat) files for closed-loop and open-loop experimental framework, MATLAB scripts for data analysis, reproduction of the result figures and table data of statistical analysis from Biswas et al., Current Biology, 2018.', '12-Nov-2018', '385', '12', '1', '1', '2');
