insert into dataset values ('doi:10.7281/T1/CZDPSX', 'Head CT Scans associated with ''Validated automatic brain extraction of head CT images''', 'https://doi.org/10.7281/T1/CZDPSX', 'The data consists of 35 different subject''s non-contrast CT scan, with 2 subjects having 2 scans but every other subject having one scan (in tarballs). One subject additionally has 2 scans, but from the same time point, but with different convolution kernels. Each scan has at least one reader''s manual segmentation of the image to delineate the mask of the brain areas (including cerebrospinal fluid (CSF)). The data are from the Minimally-Invasive Surgery plus rt-PA for Intracerebral hemorrhage Evacuation (MISTIE) Phases II and III clinical trials the Clot Lysis: Evaluating Accelerated Resolution of Intraventricular Hemorrhage (CLEAR) Phase III clinical trial. Each tarball contains a series of NIfTI (Neuroimaging Informatics Technology Initiative) files. These files can be read using common tools such as ITK-SNAP (http://www.itksnap.org/pmwiki/pmwiki.php), Mango (http://ric.uthscsa.edu/mango/), or Papaya (http://ric.uthscsa.edu/mango/papaya.html). Each image has manual segmentation from', '18-Sep-2019', '17372', '39', 'NA', 'NA', '1');
insert into dataset values ('doi:10.7281/T1/QS3QFT', 'Data and code associated with the publication: Mode switching in organisms for solving explore-vs-exploit problems.', 'https://doi.org/10.7281/T1/QS3QFT', 'This project includes datasets and codes pertinent to the study of how organisms solve the explore–exploit conflict while performing tasks where the same category of movement is used for both gathering information (“explore”) and achieving task goals (“exploit”). The datasets contain (1) an experimental dataset from a novel study on weakly electric fish Eigenmannia virescens while tracking a stationary refuge, and (2) published experimental datasets from ten phylogenetically diverse organisms from amoebae to humans, used for reanalysis. The experimental dataset from the stationary shuttle tracking of weakly electric fish was collected in the LIMBS laboratory at JHU in 2021.', '26-Mar-2024', '247', '98', '1', '1', '2');
