insert into dataset values ('doi:10.7281/T1/D06YVM', 'Data associated with the publication "Concretely Annotated Corpora"', 'https://doi.org/10.7281/T1/D06YVM', 'Under the heading Concretely Annotated, we are processing a variety of standard corpora with multiple popular NLP tool-chains, collected together under a single data schema we have created that we refer to as CONCRETE. We envision a multimodal workflow, where, e.g., knowledge can be extracted from both text and audio. We developed CONCRETE to record and share annotations on structured human language data – both text and speech.', '12-Jul-2017', '2203', '205', '58', '1', '3');
