insert into dataset values ('doi:10.7281/T1/HWU9TZ', 'Data associated with the publication: Oxidized sulfur species in slab fluids as a source of enriched sulfur isotope signatures in arcs', 'https://doi.org/10.7281/T1/HWU9TZ', 'This dataset contains files used for and generated by the EQ3 software (Wolery, 1992), and constitute the results of thermodynamic modeling used to calculate aqueous speciation of fluids at high pressures and temperatures based on thermodynamic properties consistent with the Deep Earth Water model (Huang & Sverjensky, 2019). They constitute the main results discussed in our manuscript entitled “Oxidized sulfur species in slab fluids as a source of enriched sulfur isotope signatures in arcs”. These files are separated into various folders, representing different P-T conditions and chemical systems. The “Newton and Manning model” folder contains files used to construct Figures 1 and 2, and represent our model representation of the high-pressure experiments on anhydrite solubility conducted by Newton and Manning (2005), which was used to constrain the thermodynamic properties of the complexes CaHSO4+, Na2SO4 and CaCl2. The “Subduction zone fluids” folder contains our model subduction zone', '28-May-2024', '29', '7', 'NA', '1', '4');
