insert into dataset values ('doi:10.7281/T1/GTUUUG', 'Data associated with the publication: Stick-slip unfolding favors self-association of expanded HTT mRNA', 'https://doi.org/10.7281/T1/GTUUUG', 'In Huntington’s Disease (HD) and related disorders, expansion of CAG trinucleotide repeats produces a toxic gain of function in affected neurons. Expanded huntingtin (expHTT) mRNA forms aggregates that sequester essential RNA binding proteins, dysregulating mRNA processing and translation. The physical basis of RNA aggregation has been difficult to disentangle owing to the heterogeneous structure of the CAG repeats. Here, we probe the folding and unfolding pathways of expHTT mRNA using single-molecule force spectroscopy. Whereas normal HTT mRNAs unfold reversibly and cooperatively, expHTT mRNAs with 20 or 40 CAG repeats slip and unravel non-cooperatively at low tension. Slippage of CAG base pairs is punctuated by concerted rearrangement of adjacent CCG trinucleotides, trapping partially folded structures that readily base pair with another RNA strand. We suggest that the conformational entropy of the CAG repeats, combined with stable CCG base pairs, creates a stick-slip behavior that e', '08-Jul-2024', '0', '19', '151', '1', '2');
