insert into dataset values ('doi:10.7281/T1/JDHWJN', 'Data associated with the publication: Optimized periphery-core interface increases fitness of the Bacillus subtilis glmS ribozyme', 'https://doi.org/10.7281/T1/JDHWJN', 'This dataset is related to a manuscript to be submitted to Nucleic Acids Research, describing high-throughput mutational screen and molecular dynamics simulation of a ribozyme. Like other functional RNAs, ribozymes encode a conserved catalytic center supported by peripheral domains that vary among ribozyme sub-families. To understand how core-periphery interactions contribute to ribozyme fitness, we compared the cleavage kinetics of all single base substitutions at 152 sites across the Bacillus subtilis glmS ribozyme by high-throughput sequencing (ClvSeq). The in vitro activity map mirrored phylogenetic sequence conservation in glmS ribozymes, indicating that biological fitness reports all biochemically important positions. The results showed that most deleterious mutations lower activity by impairing ribozyme self-assembly. All-atom molecular dynamics simulations of the complete ribozyme revealed how individual mutations in the core or the IL4 peripheral loop rewire the network of hyd', '19-Jul-2024', '0', '9', '151', '1', '2');
