insert into dataset values ('doi:10.7281/T1/V4BATB', 'Data associated with the publication: Limiting the broadcast range of a secreting cell during intercellular 2 signaling using protease-mediated degradation', 'https://doi.org/10.7281/T1/V4BATB', 'Synthetic biology is revolutionizing our approaches to biocomputing, diagnostics, and environmental monitoring through the use of designed genetic circuits that perform a function within a single cell. More complex functions can be performed by multiple cells that coordinate as they perform different subtasks. Cell−cell communication using molecular signals is particularly suited for aiding in this communication, but the number of molecules that can be used in different communication channels is limited. Here we investigate how proteases can limit the transmission range of communicating cells. We find that adding barrierpepsin to Saccharomyces cerevisiae cells in two dimensional multicellular networks that use α-factor signaling prevents cells beyond a specific radius from responding to α-factor signals. Such limiting of the broadcast range of cells could allow multiple cells to use the same signaling molecules to direct different communication processes and functions, provided that th', '31-Jul-2024', '16', '15', '165', '1', '2');
