insert into dataset values ('doi:10.7281/T1/THLC8N', 'Data and software associated with the publication: Control and recalibration of path integration in place cells using optic flow', 'https://doi.org/10.7281/T1/THLC8N', 'This repository includes the dataset and code used in the study of the influence of optic flow on rodent hippocampal place cells and in recalibrating the path integrator. The dataset contains post-processed CA1 place cell electrophysiology data, animal behavior data, and experiment control and sensor data recorded from 5 Long-Evans rats as they ran laps in the Dome VR apparatus. The experiment manipulation is described in the publication "Control and recalibration of path integration in place cells using optic flow”.', '13-Mar-2024', '11', '3', '1', '1', '2');
