insert into dataset values ('doi:10.7281/T1/XOL4BR', 'Data associated with the publication: Does chatting with chatbots improve language learning performance? A meta-analysis of chatbot-assisted language learning', 'https://doi.org/10.7281/T1/XOL4BR', 'Given the importance of conversation practice in language learning, chatbots, especially ChatGPT, have attracted considerable attention for their ability to converse with learners using natural language. This review contributes to the literature by examining the currently unclear overall effect of using chatbots on language learning performance and comprehensively identifying important study characteristics that affect the overall effectiveness. We meta-analyzed 70 effect sizes from 28 studies, using robust variance estimation. The effects were assessed based on 18 study characteristics about learners, chatbots, learning objectives, context, communication/interaction, and methodological and pedagogical designs. Results indicated that using chatbots produced a positive overall effect on language learning performance (g = 0.486), compared to non-chatbot conditions. Moreover, four characteristics (i.e., educational level, language level, interface design, and interaction capability) affec', '31-May-2024', '5', '4', '119', '1', '2');
