insert into dataset values ('doi:10.7281/T1/KOTDPY', 'Data associated with the publication: Nonstationarity in the global terrestrial water cycle and its interlinkages in the Anthropocene', 'https://doi.org/10.7281/T1/KOTDPY', 'The datasets include 1) the nonstationarity index, its relative importance metric, and the associated metric components for all variables that have been reported; 2) time series of all variables of interest for 20 hotspot regions, along with the region mask information; 3) mutual information and RMSE results for all evaluated variables in OL and DA simulations; and 4) core code to calculate the nonstationarity index.', '30-Aug-2024', '0', '39', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T1/RE5GOK', 'Data and code associated with the publication: Tuning N-Heterocyclic Carbene Wingtips to Form Electrochemically Stable Adlayers on Metals.', 'https://doi.org/10.7281/T1/RE5GOK', 'Self-assembled monolayers (SAMs) are employed in electrochemical biosensors to passivate and functionalize electrode surfaces. These monolayers prevent the occurrence of undesired electrochemical reactions and act as scaffolds for coupling bioaffinity reagents. Thiols are the most common adlayer used for this application; however, the thiol-gold bond is susceptible to competitive displacement by naturally occurring solvated thiols in biological fluids, as well as to desorption under continuous voltage interrogation. To overcome these issues, N-heterocyclic carbene (NHC) monolayers have been proposed as an alternative for electrochemical biosensor applications due to the strong carbon-gold bond. To maximize the effectiveness of NHCs for SAMs, a thorough understanding of both the steric effects of wingtip substituents and NHC precursor type to the passivation of electrode surfaces is required. In this study, five different NHC wingtips as well as two kinds of NHC precursors were evaluate', '29-Aug-2024', '7', '7', '144', '1', '2');
