insert into dataset values ('doi:10.7281/T1/RDLYMJ', 'Data and code associated with the publication: SARS-CoV-2 variants from long-term, persistently infected immunocompromised patients have altered syncytia formation, temperature-dependent replication, and escape neutralization with convalescent plasma', 'https://doi.org/10.7281/T1/RDLYMJ', 'SARS-CoV-2 infection of immunocompromised individuals often leads to prolonged detection of viral RNA and infectious virus in nasal specimens, presumably due to the lack of induction of an appropriate adaptive immune response. Mutations identified in virus sequences obtained from persistently infected patients bear signatures of immune evasion and have some overlap with sequences present in variants of concern. We characterized virus isolates from two COVID-19 patients undergoing immunosuppressive cancer therapy, with all isolates obtained greater than 100 days after the initial COVID-19 diagnoses and compared to an isolate from the start of the infection. Isolates from an individual who never mounted an antibody response specific to SARS-CoV-2 despite the administration of convalescent plasma showed slight reductions in plaque size and some showed temperature-dependent replication attenuation on human nasal epithelial cell culture compared to the virus that initiated infection. An iso', '13-Sep-2024', '0', '17', 'NA', '1', '2');
insert into dataset values ('doi:10.7281/T15Q4T12', 'Data associated with publication “Walking dynamics are symmetric (enough)”', 'https://doi.org/10.7281/T15Q4T12', 'Data files and source code associated with the statistical methods and plots from the publication. From the publication abstract: Many biological phenomena such as locomotion, circadian cycles and breathing are rhythmic in nature and can be modelled as rhythmic dynamical systems. Dynamical systems modelling often involves neglecting certain characteristics of a physical system as a modelling convenience. For example, human locomotion is frequently treated as symmetric about the sagittal plane. In this work, we test this assumption by examining human walking dynamics around the steady state (limit-cycle). Here, we adapt statistical cross-validation in order to examine whether there are statistically significant asymmetries and, even if so, test the consequences of assuming bilateral symmetry anyway. Indeed, we identify significant asymmetries in the dynamics of human walking, but nevertheless show that ignoring these asymmetries results in a more consistent and predictive model. In gene', '25-Aug-2015', '38', '1', '1', '1', 'NA');
