insert into dataset values ('doi:10.7281/T1J10120', 'Data and code for the report: Ferguson, Gray, and Davis: an analysis of recorded crime incidents and arrests in Baltimore City, March 2010 through December 2015"', 'https://doi.org/10.7281/T1J10120', 'This collection includes: (1) the report and its appendices, (2) raw data files from the Baltimore Police Department downloaded from the Open Baltimore portal on February 3, 2016, and (3) an R project with associated analysis code that reproduces the key results of the report included herein: Morgan, Stephen L. and Joel A. Pally. "Ferguson, Gray, and Davis: An Analysis of Recorded Crime Incidents and Arrests in Baltimore City, March 2010 through December 2015." A Report Prepared for the 21st Century Cities Initiative at Johns Hopkins University. Baltimore, MD: Johns Hopkins University, 2016.', '15-Jun-2016', '92', '1', '14', '1', 'NA');
