insert into dataset values ('doi:10.7281/T1/WBR06U', 'Current-voltage raw data and spectra for thiophene polymer characterization and sensing responses', 'https://doi.org/10.7281/T1/WBR06U', 'This dataset is backup information for the publication whose abstract is reproduced here. NO2-responsive polymer-based organic field-effect transistors (OFETs) are described and room-temperature detection with high sensitivity entirely from the semiconductor was achieved. Two thiophene polymers, poly(bisdodecylquaterthiophene) and poly(bisdodecylthioquaterthiophene) (PQT12 and PQTS12, respectively), were used as active layers to detect a concentration at least as low as 1 ppm NO2. The proportional on-current change of OFETs using these polymers reached over 400% for PQTS12, which is among the highest sensitivities reported for an NO2-responsive device based on an organic semiconducting film. From measurements of cyclic voltammetry and the electronic characteristics, we found that the introduction of sulfurs into the side chains induces traps in films of the PQTS12 and also decreases domain sizes, both of which could contribute to the higher sensitivity of PQTS12 to NO2 gas compared to', '12-Jun-2017', '9', '1', '16', '1', 'NA');
