insert into dataset values ('doi:10.7281/T1/SP6KO3', 'Raw spectroscopic data from Californian rocks associated with the article ''Metamorphic records of multiple seismic cycles during subduction''', 'https://doi.org/10.7281/T1/SP6KO3', 'Large earthquakes occur in rocks undergoing high pressure/low temperature metamorphism during subduction. Rhythmic major-element zoning in garnet is a common product of such metamorphism, and one that must record a fundamental subduction process. Here we show that rhythmic major-element zoning in subduction-zone garnets from the Franciscan Complex, California developed in response to growth–dissolution cycles driven by pressure pulses. Using electron probe microanalysis and novel techniques in Raman and synchrotron Fourier transform infrared microspectroscopy, we demonstrate that at least four such pressure pulses, of magnitude 100–350 MPa, occurred over less than 300,000 years. These pressure magnitude and time scale constraints are most consistent with the garnet zoning having resulted from periodic overpressure development–dissipation cycles, related to pore-fluid pressure fluctuations linked to earthquake cycles. This study demonstrates that some metamorphic reactions can track ind', '22-Nov-2017', '28', '1', '55', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/CZZDLJ', 'Current-voltage, voltage-temperature, cyclic voltammetry, morphological, and spectroscopic raw data', 'https://doi.org/10.7281/T1/CZZDLJ', 'This dataset is backup information for the publication whose abstract is reproduced here. Air stable and soluble tetrabutylammonium fluoride (TBAF), is demonstrated as an efficient n-type dopant for the conjugated polymer ClBDPPV. Electron transfer from F− anions to the π-electron deﬁcient polymer ClBDPPV through anion-π electronic interactions is strongly corroborated by the combined the results of electron spin resonance (ESR), UV-Vis-NIR and ultraviolet photoelectron spectroscopy (UPS). Doping of ClBDPPV with 25 mol% TBAF boosts electrical conductivity to up to 0.62 S cm-1, among the highest conductivities that has been reported for solution processed n-type conjugated polymers, with a thermoelectric power factor of 0.63 μW m−1 K−2 in air. Importantly, the Seebeck coefficient agrees with recently published correlations to conductivity. Moreover, the F- doped ClBDPPV shows significant air stability, maintaining the conductivity of over 0.1 S cm-1 in a thick film after exposure to air', '22-Jun-2017', '6', '1', '16', '1', 'NA');
