insert into dataset values ('doi:10.7281/T1/YXVVML', 'Current-voltage raw data, molecular weight and morphology measurement data, and spectra for thiophene polymer characterization and thermoelectric measurements', 'https://doi.org/10.7281/T1/YXVVML', 'This dataset is backup information for the publication whose abstract is reproduced here. Four p-type polymers were synthesized by modifying poly(bisdodecylquaterthiophene) (PQT12) to increase oxidizability by p-dopants. A sulfur atom is inserted between the thiophene rings and dodecyl chains, and/or 3,4-ethylenedioxy groups are appended to thiophene rings of PQT12. Doped with NOBF4, PQTS12 (with sulfur in side chains) shows conductivity of 350 S cm-1, the highest reported nonionic conductivity among films made from dopant-polymer solutions. Doped with tetrafluorotetracyanoquinodimethane (F4TCNQ), PDTDE12 (with 3,4-ethylenedioxy groups on thiophene rings) shows conductivity of 140 S cm-1. The converse combinations of polymer and dopant, and formulations using a polymer with both the sulfur and ethylenedioxy modifications showed lower conductivities. The conductivities are stable in air without extrinsic ion contributions associated with PEDOT:PSS and that cannot support sustained curre', '16-Aug-2017', '6', '1', '16', '1', 'NA');
