insert into dataset values ('doi:10.7281/T1/YI383C', 'Current-voltage raw data for transistors and micrograph morphology images for films', 'https://doi.org/10.7281/T1/YI383C', 'This dataset is backup information for the publication whose abstract is reproduced here. Layer-by-layer deposited guanine and pentacene in organic field-effect transistors (OFETs) is introduced. Through adjusting the layer thickness ratio of guanine and pentacene, the tradeoff of two electronic parameters in OFETs, charge carrier mobility and current on/off ratio, was controlled. The charge mobility was enhanced by depositing the pentacene over and between guanine layers and by increasing the proportion of pentacene in the layer-by-layer system, while the current on/off ratio was increased via the decreased off current induced by the guanine layers. The tunable device performance was mainly ascribed to the trap and dopant neutralizing properties of the guanine layers, which would decrease the density of free hydroxyl groups in the OFETs. Furthermore, the cost of the devices could be reduced remarkably via the adoption of the low-cost guanine.', '16-Aug-2017', '3', '1', '16', '1', 'NA');
