insert into dataset values ('doi:10.7281/T1/7VKY8K', 'Data associated with the publication ''Nonvolatile Solid-State Charged-Polymer Gating of Topological Insulators into the Topological Insulating Regime''', 'https://doi.org/10.7281/T1/7VKY8K', 'Data tables and graphs in Igor Pro graphing software format producing figures in the associated publication. Abstract: We demonstrate the ability to reduce the carrier concentration of thin films of the topological insulator (TI) Bi2Se3 by utilizing a nonvolatile electrostatic gating via corona charging of electret polymers. Sufficient electric field can be imparted to a polymer-TI bilayer to result in significant electron density depletion, even without the continuous connection of a gate electrode or the chemical modification of the TI. We show that the Fermi level of Bi2Se3 is shifted toward the Dirac point with this method. Using terahertz spectroscopy, we find that the surface chemical potential is lowered into the bulk band gap (approximately 50 meV above the Dirac point and 170 meV below the conduction-band minimum), and it is stabilized in the intrinsic regime while enhancing electron mobility. The mobility of surface state electrons is enhanced to a value as high as approximat', '04-Jun-2018', '6', '1', '16', '1', 'NA');
