insert into dataset values ('doi:10.7281/T1/TP9B4Y', 'Data associated with publication “Where does Titan Sand Come From: Insight from Mechanical Properties of Titan Sand Candidates”', 'https://doi.org/10.7281/T1/TP9B4Y', 'The data files include original indentation data (load, depth, modulus, hardness) produced by a nanoindenter (Nanomechanics, Inc) for various Titan sand related materials, and AFM/SEM images of the indented cracks of some of materials. Extensive equatorial linear dunes exist on Titan, but the origin of the sand, which appears to be organic, is unknown. We used nanoindentation to study the mechanical properties of a few Titan sand candidates, several natural sands on Earth, and common materials used in the Titan Wind Tunnel, to understand the mobility of Titan sand. We measured the elastic modulus (E), hardness (H), and fracture toughness (Kc) of these materials. Tholin''s elastic modulus (10.4+/-0.5 GPa) and hardness (0.53+/-0.03 GPa) are both an order of magnitude smaller than silicate sand, which is also smaller than the mechanically weak white gypsum sand. With a magnitude smaller fracture toughness (Kc=0.036+/-0.007 MPa-m^(1/2)), tholin is also much more brittle than silicate sand.', '13-Jun-2018', '16', '1', '64', '1', 'NA');
