insert into dataset values ('doi:10.7281/T1/OSQSMY', 'Data associated with the publication “Sex Hormones and Change in N-Terminal Pro-B-Type Natriuretic Peptide Levels: The Multi-Ethnic Study of Atherosclerosis”', 'https://doi.org/10.7281/T1/OSQSMY', 'Sex hormones are thought to be involved in sex differences in cardiovascular disease (CVD). N-terminal pro-B type natriuretic peptide (NT-proBNP) is a strong predictor of CVD. NT-proBNP levels are higher in women than men, which may relate to sex hormones. We analyzed cross-sectional and longitudinal associations between sex hormones and NT-proBNP levels in 2,371 postmenopausal women and 2,688 men in MESA. We found that a more androgenic pattern of sex hormones was associated with lower NT-proBNP levels among women and men cross-sectionally, which may contribute to sex differences in NT-proBNP levels. However, in longitudinal analyses, a more androgenic pattern of sex hormones was associated with a greater change in NT-proBNP levels in women and may reflect a mechanism for increased CVD risk in women after menopause. This data collection includes the supplemental tables associated with our publication.', '17-Aug-2018', '12', '1', '62', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/OSQSMY', 'Data associated with the publication “Sex Hormones and Change in N-Terminal Pro-B-Type Natriuretic Peptide Levels: The Multi-Ethnic Study of Atherosclerosis”', 'https://doi.org/10.7281/T1/OSQSMY', 'Sex hormones are thought to be involved in sex differences in cardiovascular disease (CVD). N-terminal pro-B type natriuretic peptide (NT-proBNP) is a strong predictor of CVD. NT-proBNP levels are higher in women than men, which may relate to sex hormones. We analyzed cross-sectional and longitudinal associations between sex hormones and NT-proBNP levels in 2,371 postmenopausal women and 2,688 men in MESA. We found that a more androgenic pattern of sex hormones was associated with lower NT-proBNP levels among women and men cross-sectionally, which may contribute to sex differences in NT-proBNP levels. However, in longitudinal analyses, a more androgenic pattern of sex hormones was associated with a greater change in NT-proBNP levels in women and may reflect a mechanism for increased CVD risk in women after menopause. This data collection includes the supplemental tables associated with our publication.', '17-Aug-2018', '12', '1', '63', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/6Y08LS', 'Computing in the Engineering Core Curriculum at JHU', 'https://doi.org/10.7281/T1/6Y08LS', 'Report prepared at the behest of the dean of engineering at JHU between Summer 2016 and Spring 2017, 17 pages.', '22-Aug-2018', '7', '1', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/K3ONN5', 'Data associated with publication “Highly Contrasting Static Charging and Bias Stress Effects in Pentacene Transistors with Polystyrene Heterostructures Incorporating Oxidizable N,N’-bis(4-Methoxyphenyl)aniline Side Chains as Gate Dielectrics”', 'https://doi.org/10.7281/T1/K3ONN5', 'Charge storage and trapping properties of polymer dielectrics govern the charge densities of adjacent semiconductors and greatly influence the on-off switching voltage (threshold voltage, Vth) of organic field-effect transistors (OFETs) when the polymers are used as gate insulators. Intentional charging of polymer dielectrics in OFETs can change Vth and affect the bias stress. We describe a chemical design and fabrication protocol to construct multilayer-stack dielectrics for pentacene-based OFETs using different polystyrene (PS)-based polymers in each layer, with oxidizable N,N-bis(4-methoxyphenyl)anilino (TPAOMe)-substituted styrene copolymers in arbitrary vertical positions in the stacks. Thermal, byproduct-free crosslinking of benzocyclobutene subunits provides integrity to the multilayer structure by preventing dissolution of the previous deposited layer. Neutron reflectivity data verified the multilayer morphology. We compared the Vth shift before and after charging the stacks by', '19-Nov-2018', '4', '1', '16', '1', 'NA');
