insert into dataset values ('doi:10.7281/T1/ONZHUS', 'Coded quotations for codes relevant to the paper “Bringing fear into focus: The intersections of HIV and masculine gender norms in Côte d’Ivoire”', 'https://doi.org/10.7281/T1/ONZHUS', 'Using data from 73 in-depth interviews and 28 focus group discussions with 227 Ivoirian men collected between November and December 2016 across three urban sites, this qualitative research study aimed to explore the role masculinity plays in men’s engagement in the HIV care continuum in Côte d’Ivoire. The data posted here is a subset of the larger dataset and includes coded quotations (deidentified) relevant to the topic of the manuscript.', '08-Jul-2019', '11', '1', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/V3Z6DD', 'Data associated with "Effects of trifluoromethyl substituents on interfacial and bulk polarization of polystyrene gate dielectrics"', 'https://doi.org/10.7281/T1/V3Z6DD', 'From the publication abstract: The ability to control the bulk and interfacial polarization of dielectric polymers is important to their application in organic electronics. We examine the effect of the trifluoromethyl substituent on poly(3-trifluoromethylstyrene) (P3TFMS) as compared to unsubstituted polystyrene (PS) on the I-V relationships of pentacene-based organic field-effect transistors (OFETs). Single- and double-layered films of these polymers were used, with lower layers crosslinked through vinylbenzocyclobutene comonomers before deposition of upper layers. Control experiments verified that the electronic effect of the crosslinking was negligible. We found that the TFM substituent markedly and independently affected both the initial threshold voltage Vth and the nonvolatile, shifted Vth observed after the application of static gate voltage, depending on its position adjacent or apart from the pentacene. The trifluoromethyl-bearing polymers exhibited significantly lower magnitu', '23-Jan-2019', '6', '1', '16', '1', 'NA');
