insert into dataset values ('doi:10.7281/T1/BIJWVL', 'Data associated with publication “Dopant-Dependent Increase in Seebeck Coefficient and Electrical Conductivity in Blended Polymers with Offset Carrier Energies"', 'https://doi.org/10.7281/T1/BIJWVL', 'The strong and counterproductive interrelationship of thermoelectric parameters remains a bottleneck to improving thermoelectric performance, especially in polymer-based materials. In this paper, we decouple the electrical conductivity and Seebeck coefficient, achieving increases in at least one of these two parameters while the other is maintained or slightly increased as well. This is done using an alkylthio-substituted polythiophene (PQTS12) as additive in poly(bisdodecylquaterthiophene) (PQT12) with tetrafluorotetracyanoquinodimethane (F4TCNQ) and nitrosyl tetrafluoroborate (NOBF4) as dopants. The power factor increased two orders of magnitude with the PQTS12 additive at constant doping level. Using a second pair of polymers, poly(2,5-bis(3-dodecylthiophen-2-yl)thieno[3,2-b]thiophene (PBTTTC12) and poly(2,5-bis(3-dodecylthiothiophen-2-yl)thieno[3,2-b]thiophene, (PBTTTSC12), with higher mobilities, we also observed the decoupling of the Seebeck coefficient and electrical conductivit', '12-Mar-2019', '5', '1', '16', '1', 'NA');
