insert into dataset values ('doi:10.7281/T1/3XLWZX', 'Data associated with publication "Analytical Platform to Characterize Dopant Solution Concentrations, Charge Carrier Densities in Films and Interfaces, and Physical Diffusion in Polymers Utilizing Remote Field-Effect Transistors"', 'https://doi.org/10.7281/T1/3XLWZX', 'Characterizing doping effects in a conductive polymer and physical diffusion in a passive polymer were performed using a remote-gate field-effect transistor (RG FET) detection system that was able to measure the electrical potential perturbation of a polymer film coupled to the gate of a silicon FET. Poly(3-hexylthiophene) (P3HT) film doped using various concentrations of 2,3,5,6-tetrafluoro-7,7,8,8-tetracyanoquinodimethane (F4TCNQ) solutions imposed additional positive potentials on the P3HT RG, resulting in a lower threshold voltage (V_th) on the n-channel silicon FET. Changes in V_th were related to the induced hole concentrations and hole mobility in P3HT films by using our V_th shifting model for the RG FET. We discovered that the electron-donating P3HT and even inorganic materials, indium tin oxide and gold, showed similar electrical potential perturbations dependent on the concentration of F4TCNQ in overlying solutions as the dopant radical anions maximally covered the surfaces.', '14-Mar-2019', '7', '1', '16', '1', 'NA');
