insert into dataset values ('doi:10.7281/T1/ZOW11X', 'Data associated with the publication: Suppression of ionic doping by molecular dopants in conjugated polymers for improving specificity and sensitivity in biosensing applications', 'https://doi.org/10.7281/T1/ZOW11X', 'The original data for the publication. The data consists of spreadsheets showing the electronic characterizations of all the compositions, including different polymers and dopant levels, at different pH. The highest level of folders is labelled according to the type of device used. Then, subfolders are associated with different compositions or experimental conditions. The spreadsheets themselves contain raw electrical data for each combination. The spreadsheets are the sources of data used to construct the plots that report the observations and trends in the manuscript. Article abstract: Ionic doping effects in conjugated polymers often cause nonspecific signaling and a low selectivity of bioelectronic sensing. Using remote-gate field-effect transistor characterization of molecular and ionic doping in poly(3-hexylthiophene) (P3HT) and acid-functionalized polythiophene, poly[3-(3-carboxypropyl) thiophene-2,5-diyl] (PT-COOH), we discovered that proton doping effects on the interfacial po', '01-Feb-2021', '2', '1', '76', '1', 'NA');
