insert into dataset values ('doi:10.7281/T1/EWN8ZN', 'Data associated with publication: Unusually conductive organic-inorganic hybrid nanostructures derived from bio-inspired mineralization of peptide/pi-electron assemblies', 'https://doi.org/10.7281/T1/EWN8ZN', 'The data consists of all raw and processed data pertaining to this publication. SEM and 3D laser optical microscope images of various control experiments as well as SEM/EDS data for elemental analysis of the structures that formed; electrical measurement data for control samples and controlled electrical measurement data as well as images, conditions, and assumptions for conductivity calculations. From the article abstract: Supramolecular materials derived from pi-conjugated peptidic macromolecules are well-established to self-assemble into 1D nanostructures. In the presence of KOH, which was used to more fully dissolve the peptide macromolecules prior to triggering the self-assembly by way of exposure to HCl vapor, we report here an unexpected mineralization of KCl as templated presumably by the glutamic acid residues that were present along the backbone of the peptide macromolecules. In order to decouple the peptidic side chains from the central pi-electron unit, three-carbon spacers', '19-Jul-2021', '4', '1', '76', '1', 'NA');
