insert into dataset values ('doi:10.7281/T1/ENWXRU', 'Data associated with the publication: Trap-dominated nitrogen dioxide and ammonia responses of air-stable p-channel conjugated polymers from detailed bias stress analysis.', 'https://doi.org/10.7281/T1/ENWXRU', 'The data consists of graphs and spreadsheets showing the spectroscopic, physical, topographic, and electronic characterizations of different polymers and their electronic responses to bias stress and vapors over time. The folders group the files according to the type of response being studied. The files are the sources of data used to construct the plots that report the observations and trends in the manuscript.', '14-Jun-2022', '3', '1', '76', '1', 'NA');
