insert into dataset values ('doi:10.7281/T1/8OFLMF', 'Data associated with the publication: Evidence of pre-formed Lewis acid-base and Wheland-type complexes acting as dopants for p-type conjugated polymers', 'https://doi.org/10.7281/T1/8OFLMF', 'From the publication abstract: Efficient doping of polymer semiconductors is essential for their development as conductors. Although Lewis acids such as B(C6F5)3have shown promise as dopants for polymers, their doping mechanism is not fully understood. We created 1:1 zwitterionic (including “Wheland-type”) complexes of B(C6F5)3 with conjugated molecules difluorobis(triethylsilylethynyl)anthradithiophene (diF-TES-ADT) and didodecylthienothiophene (DTT-12) and characterized them with 1H NMR, UV−vis spectroscopy, EPR spectroscopy, optical and scanning electron microscopy energy-dispersive X-ray spectroscopy (SEM-EDS), and X-ray diffraction. We employed these complexes as p-dopants for three conjugated polymers and established their doping abilities by conductivity measurements, Seebeck studies, field effect transistor (FET), and remote-gate sensing (RG-FET) measurements. Conductivity changes were dependent on the conjugated molecule adduct component, consistent with the adduct itself serv', '17-Jun-2022', '4', '1', '76', '1', 'NA');
