insert into dataset values ('doi:10.7281/T1/IM9BZI', 'Data associated with the publication: The Basal Cambrian carbon isotope excursion (BACE) records a primary seawater signal.', 'https://doi.org/10.7281/T1/IM9BZI', 'This dataset includes carbonate Ca isotope (‰, n = 173) and Mg isotope (‰, n = 42) compositions and Mg/Ca (mmol/mol), Sr/[Ca+Mg] (mmol/mol), Mn/[Ca+Mg] (mmol/mol), and U/[Ca+Mg] (µmol/mol) major and trace elemental ratios (n = 186) of standards and samples from the Dunfee and Esmeralda members of the Deep Spring Formation at Mount Dunfee, NV, the lower Wood Canyon Formation at Echo Canyon, CA, and the La Ciénega Formation at Cerro Rajón, SO. It also includes facies descriptions of the Dunfee and Esmeralda members of the Deep Spring Formation at Mount Dunfee, NV.', '22-Apr-2024', '1', '1', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/IRMGH8', 'Data associated with the publication: Reduced control of SARS-CoV-2 infection associates with lower mucosal antibody responses in pregnancy', 'https://doi.org/10.7281/T1/IRMGH8', 'Pregnant patients are at greater risk of hospitalization with severe COVID-19 than non-pregnant people. This was a retrospective observational cohort study of remnant clinical specimens from patients who visited acute care hospitals within the Johns Hopkins Health System (JHHS) in the Baltimore, MD-Washington, DC area between October 2020-May 2022. Participants included confirmed SARS-CoV-2 infected pregnant people and matched non-pregnant people (matching criteria included age, race/ethnicity, area deprivation index, insurance status, and vaccination status to ensure matched demographics). The primary dependent measures were clinical COVID-19 outcomes, infectious virus recovery, viral RNA levels, and mucosal anti-spike (S) IgG titers from upper respiratory tract samples. A total of 452 individuals (117 pregnant and 335 non-pregnant) were included in the study, with both vaccinated and unvaccinated individuals represented. Pregnant patients were at increased risk of hospitalization (OR', '28-Feb-2024', '6', '1', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1RF5RZ7', 'Data associated with Wu et al. 2016 Tuning and stabilizing topological insulator Bi2Se3 in the intrinsic regime by charge extraction with organic overlayers', 'https://doi.org/10.7281/T1RF5RZ7', 'In this work, we use charge extraction via organic overlayer deposition to lower the chemical potential of topological insulator (TI) Bi2Se3 thin films into the intrinsic (bulk-insulating) regime. We demonstrate the tuning and stabilization of intrinsic topological insulators at high mobility with low-cost organic films. With the protection of the organic charge extraction layers tetrafluorotetracyanoquinodimethane or tris(acetylacetonato)cobalt(III) (Co(acac)3), the sample is stable in the atmosphere with chemical potential ∼135 meV above the Dirac point (85 meV below the conduction band minimum, well within the topological insulator regime) after four months, which is an extraordinary level of environmental stability. The Co complex demonstrates the use of an organometallic for modulating TI charge density. The mobility of surface state electrons is enhanced as high as ∼2000 cm2/V s. Even at room temperature, a true topologically insulating state is realized and stabilized for months', '02-Aug-2016', '14', '2', '16', '1', 'NA');
