insert into dataset values ('doi:10.7281/T14Q7RW8', 'Data associated with the PLOS publication "Correlates of intra-household ITN use in Liberia: A multilevel analysis of household survey data"', 'https://doi.org/10.7281/T14Q7RW8', 'Malaria is a major cause of morbidity and mortality in Liberia. Access is a key determinant of ITN use but it is not the only one; prior studies have identified individual, household, and community level factors that affect ITN use. However, studies have generally not assessed the psychosocial or ideational determinants of ITN use. Using 2014 household survey data, this manuscript examines the socio-demographic, ideational, household, and community factors associated with household member use of ITNs in Liberia. Multilevel modeling was used to assess fixed effects at the individual, household, and community levels, and random effects at the household and cluster levels. The data showed significant residual clustering at the household level, indicating that there were unmeasured factors operating at this level that are associated with ITN use. Age, sex, number of ITNs in household, and female caregiver’s perceived severity of malaria, perceived self-efficacy to detect a complicated case', '14-Jul-2016', '34', '2', '15', '1', 'NA');
insert into dataset values ('doi:10.7281/T1SF2T31', 'Cumulative patient data collected for LSOCA study', 'https://doi.org/10.7281/T1SF2T31', 'The Longitudinal Study of Ocular Complications of AIDS was a 15-year multi-center observational study which collected demographic, medical history, treatment, and vision-related data at quarterly visits from 2,392 patients with AIDS. Each SAS dataset in this collection relates to the cumulative patient-visits from a particular LSOCA form. For example, va.sas7bdat is the SAS dataset for the visual acuity data. Use the appropriate LSOCA form and SAS labels from the SAS PROC CONTENTS to decode each data item.', '02-Dec-2015', '81', '2', '13', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/SQ6FO9', 'Land cover map of the Ethiopian Blue Nile River Basin', 'https://doi.org/10.7281/T1/SQ6FO9', 'This dataset is a land cover map of the Ethiopian portion of the Blue Nile Basin, called the Abay Basin in Ethiopia. It was generated using remotely sensed data to classify land cover into eight broad classes: agriculture, grassland, woodland/shrub, forest, bare ground, urban/impervious surfaces, water, and seasonal water/marsh areas. We used data from Landsat spectral bands from 2000 to 2011, the Normalized Difference Vegetation Index (NDVI) and its temporal mean and variance, together with a digital elevation model, all at 30-m spatial resolution, as inputs to a supervised classifier. A Support Vector Machines algorithm (SVM) was chosen to deal with the size, variability and non-parametric nature of these data stacks. In post-processing, an image segmentation algorithm with a minimum mapping unit of about 0.5 hectares was used to convert per pixel classification results into an object based final map.', '24-Aug-2018', '36', '2', '59', '1', 'NA');
