insert into dataset values ('doi:10.7281/T1/KV9KNX', 'Data associated with publication "Contributions to Composite Conductivity and Seebeck Coefficient in Commercial  Bi2Te3 – Conjugated Polymer Composites"', 'https://doi.org/10.7281/T1/KV9KNX', 'We demonstrated the use of the as-received conjugated polymer P3HT (poly (3-hexylthiophene-2,5 diyl) doped with F4TCNQ (2,3,5,6-tetrafluoro-7,7,8,8-tetracyanoquinodimethane) as a matrix for forming a composite with as-received, commercially available p-type Bi2Te3 powder. The optimized formulation exhibits a power factor of up to 5.3 uW K-2 m-1, about nine times higher than the highest power factor we achieved from mixtures of only P3HT and F4TCNQ. The Bi2Te3 was responsible for increases in both Seebeck coefficient and electrical conductivity. P3HT, with higher hole mobility, was superior to PQT12 (poly(bisdodecylquaterthiophene), and F4TCNQ was at least as good as FeCl3, for matrix and dopant, respectively, for this purpose. The power factor obtained is about 40% of that reportedly obtained from synthesized Bi2Te3 nanowires in FeCl3-doped P3HT. We calculated the expected contributions of bulk Bi2Te3 to the composite conductivity and then examined the resistance caused by interfaces o', '08-Apr-2019', '7', '2', '76', '1', 'NA');
