insert into dataset values ('doi:10.7281/T1/TNHLOJ', 'Data associated with the publication "Cytokine, chemokine and cytokine receptor changes are associated with metabolic improvements after bariatric surgery."', 'https://doi.org/10.7281/T1/TNHLOJ', 'Obesity is associated with a chronic state of inflammation characterized by changes in adipokines and cytokines. We conducted a large, comprehensive profiling of cytokines, chemokines and secreted cytokine receptors in lean and obese individuals, and in obese patients undergoing bariatric surgery.', '04-Dec-2018', '15', '2', 'NA', '1', 'NA');
