insert into dataset values ('doi:10.7281/T1/YOFR1E', 'Data associated with ''Development of the Consumer Attitudes Towards Healthcare Scale''', 'https://doi.org/10.7281/T1/YOFR1E', 'Data supporting construction of a scale entitled the Consumerist Attitudes in Healthcare Scale. We used a literature-informed strategy to develop the Consumerist Attitudes towards Healthcare Scale, drawing items from related scales if these items represented the construct of consumerism. We conducted a targeted literature search to identify conceptual models that describe the patient as a consumer of healthcare. We also identified existing scales and questionnaires as a supply of items for inclusion. From the identified literature, we extracted a list of attitudes, preferences, and expectations for inclusion in our initial survey. We surveyed a nationally representative US population with a 45 item questionnaire that used 5-point Likert responses to assess consumeristic attitudes. We generated a polychoric correlation matrix and did exploratory factor analysis using a principal components solution. We sent the resulting scale to additional respondents twice for repeatability testing. W', '26-Jun-2019', '46', '2', '110', '1', 'NA');
