insert into dataset values ('doi:10.7281/T1/EOPWE4', 'Data associated with the publication ''Older Adults'' Perceptions of the Causes and Consequences of Healthcare Overuse: A Qualitative Study''', 'https://doi.org/10.7281/T1/EOPWE4', 'Data supporting the qualitative study aimed at learning how older adults perceive overuse of healthcare, if at all. We conducted five focus groups involving nearly forty participants at senior activity centers across Baltimore City. After each group session, the investigators reviewed the major themes emerging from the discussion and the questions were iteratively refined as needed. The audiotaped transcripts were professionally transcribed verbatim. We used a combination of conventional and directed approaches for qualitative content analysis. We found that nearly all expressed that they or an acquaintance had experienced some overtesting or overtreatment, expressing agreement that terms such as “unnecessary,” “wasteful” and “overdoing it” characterized these encounters. Major themes that were expressed as contributing to overuse were: (1) poor quality of communication between patients and doctors; (2) treating individual complaints instead of “the whole person”; (3) few efforts to en', '26-Jun-2019', '21', '2', '110', '1', 'NA');
