insert into dataset values ('doi:10.7281/T1/I3ILXO', 'Experimental data associated with ''Sequential biodegradation of 1,2,4-trichlorobenzene at oxic-anoxic groundwater interfaces in model laboratory columns''', 'https://doi.org/10.7281/T1/I3ILXO', 'This dataset contains several tables of experimentally measured values from a long-term column biodegradation study. Values from this dataset were used in calculations, graphs, and interpretations in the associated publication, as described in the Materials and Methods of the associated publication. Data includes concentrations of chlorobenzene congeners, anions, dissolved oxygen, and bacterial gene copy numbers.', '17-Apr-2020', '13', '2', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/QGOMA0', 'Data associated with publication “Compositional Measurements of Saturn’s Upper Atmosphere and Rings from Cassini INMS” in the Journal of Geophysical Research: Planets', 'https://doi.org/10.7281/T1/QGOMA0', 'These data comprise the end-products of our analyses. This includes the cleaned Cassini INMS mass spectrum from orbits 288, 290, 291, 292, and 293 for m/z 1 to 20 amu. The inbound density profiles of H2, He, CH4, H2O, and NH3 as well as the averaged mixing ratios of CH4, H2O, and NH3 are also included.', '13-May-2020', '23', '2', '64', '1', 'NA');
