insert into dataset values ('doi:10.7281/T1/AWWAKP', 'Data associated with the publication: Waugh, D.W. and Haine, T.W.N. (2020). How rapidly do the southern subtropical oceans respond to wind stress changes? Journal of Geophysical Research: Oceans', 'https://doi.org/10.7281/T1/AWWAKP', 'Model output from a Community Climate System Model version 4 (CCSM4) simulation, described in Waugh and Haine 2020.', '02-Jun-2020', '10', '2', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/CRHEAH', 'Data associated the publication: Static polystyrene gate charge density modulation of dinaphthothienothiophene with tetrafluorotetracyanoquinodimethane layer doping: Evidence from conductivity and Seebeck coefficient measurements and correlations', 'https://doi.org/10.7281/T1/CRHEAH', 'We relate the static charging of organic field effect transistor (OFET) gate dielectric polymers, the resulting change in threshold voltage shift, and the modulation of thermoelectric properties of the transistor semiconductor. We utilize a bottom gate OFET structure with cross-linkable polystyrene and plain polystyrene (XLPS/PS) bilayer dielectrics and dinaphthothienothiophene (DNTT) organic molecular semiconductor with tetrafluorotetracyanoquinodimethane (F4TCNQ) doping layer. The conductivity and Seebeck coefficient are measured before and after charging. We find that the conductivity increases significantly, while the Seebeck coefficient decreases correspondingly in a trend of S ∝ ln(σ) after the dielectrics were negatively charged, resulting in an average of 5-fold increase in power factor at the maximum charging level. Additionally, temperature-dependent conductivity measurements show that the activation energy decreases with the increasing conductivity. We calculate the Seebeck', '24-Aug-2020', '8', '2', '16', '1', 'NA');
