insert into dataset values ('doi:10.7281/T1/VCPZIK', 'Data associated with publication: Maximized hole trapping in a polystyrene transistor dielectric from a highly branched iminobis (aminoarene) side chain', 'https://doi.org/10.7281/T1/VCPZIK', 'We synthesized highly branched and electron donating side chain subunits and attached them to polystyrene (PS) used as a dielectric layer in a pentacene field effect transistor. The influence of these groups on dielectric function, charge retention and threshold voltage shifts (ΔVth) depending on their positions in dielectric multilayers was determined. We compared the observations made on an N-perphenylated iminobisaniline side chain with those from the same side chains modified with ZnO nanoparticles and with an adduct formed from tetracyanoethylene (TCNE). We also synthesized an analogue in which six methoxy groups are present instead of two amine nitrogens. At 6 mol % side chain, hopping transport was sufficient to cause shorting of the gate, while at 2 mol %, charge trapping was observable as transistor threshold voltage shifts (ΔVth). We created three types of devices: with the substituted PS layer as single layer dielectric, on top of a crosslinked PS layer but in contact with t', '05-Aug-2021', '7', '2', '16', '1', 'NA');
