insert into dataset values ('doi:10.7281/T1/F1GCSB', 'Data associated with the publication: Transplantation Elicits a Clonally Diverse CD8+ T Cell Response that is Comprised of Potent CD43+ Effectors.', 'https://doi.org/10.7281/T1/F1GCSB', 'TCRB sequences were obtained using the Framework Region 3 Amplifikation Sequencing platform. C57Bl/6 mice were grafted with Balb/c skin grafts. Before transplant or on day 10 post-transplant, CD8+ T cells were flow cytometrically sorted into CD44+ and CD44- populations that were positive or negative for the allogeneic epitope H-2L(d) QL9. Skin graft tissue and blood samples were also collected (unsorted).', '13-Sep-2023', '2', '2', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/YC5BS6', 'Data associated with the publication: A quantitative acoustic analysis of the vocal repertoire of the common marmoset (Callithrix jacchus).', 'https://doi.org/10.7281/T1/YC5BS6', 'Vocal recordings from marmoset colony, categorized by call types and subjects.', '18-Oct-2023', '4', '2', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/AGLFQ2', 'Data associated with: AHA grant 20SRG35490443 Cardiac Sarcomere Dysfunction in HFpEF.', 'https://doi.org/10.7281/T1/AGLFQ2', 'Heart failure with preserved ejection fraction (HFpEF) has few effective therapies yet exacts substantial mortality. Its multi-system nature has made animal modeling difficult, but recent efforts combining diet-induced obesity and hemodynamic stress are popular: mouse - L-NAME/high-fat diet (HFD), the ZSF1 rat which combines leptin deficiency with genetic-based diabetes, hypertensive and heart failure phenotypes, and an obese/hypertensive Göttingen minipig. We have reported that human HFpEF myocytes particular from patients who are obese display a profound reduction in systolic Ca2+-activated tension, that is negatively correlated with body mass index (Circulation. 2021;143:965–967). Here we tested whether such deficits are found in these three HFpEF animal models. Of the three models, we only find a change in systolic level calcium activated tension in the Göttingen minipig. The mouse and rat models show results that are superimposable with their respective controls. The data are from', '18-Mar-2024', '5', '2', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1C8276W', 'Data associated with the publication: Figure-ground organization in visual cortex for natural scenes.', 'https://doi.org/10.7281/T1C8276W', 'Figure-ground organization and border-ownership assignment are essential for understanding natural scenes. It has been shown that many neurons in the macaque visual cortex signal border-ownership in displays of simple geometric shapes such as squares, but how well these neurons resolve border-ownership in natural scenes is not known. We studied area V2 neurons in behaving macaques with static images of complex natural scenes. We found that about half of the neurons were border-ownership selective for contours in natural scenes and this selectivity originated from the image context. The border-ownership signals emerged within 70 ms after stimulus onset, only ~ 30 ms after response onset. A substantial fraction of neurons were highly consistent across scenes. Thus, the cortical mechanisms of figure-ground organization are fast and efficient even in images of complex natural scenes. Understanding how the brain performs this task so fast remains a challenge.', '22-Aug-2017', '53', '2', '32', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/ZPGBJW', 'Oral health during pregnancy in rural Nepal: a community-based cohort study of practices, periodontal status, and pregnancy outcomes', 'https://doi.org/10.7281/T1/ZPGBJW', 'Annually, almost three million babies die prior to 28 days of life; the number one cause of these deaths both in high- and low-income settings is complications arising from preterm birth. Therapeutic options for managing preterm birth are generally unavailable for 98% of the almost 15 million preterm babies born each year, and the evidence base for preventative interventions is lacking. One area that has been substantially neglected in developing countries is the role that poor oral health may play raising the likelihood of early spontaneous delivery. There is epidemiologic and microbiologic evidence for an association between maternal periodontal disease and preterm birth, however, causal mechanisms are not fully understood, and results from randomized trials intervening on mothers with periodontal therapies to reduce prematurity have been mixed. In 2014, we initiated a community-based project to examine this question in a high burden setting with low levels of confounding risk factor', '10-Jan-2019', '82', '3', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/LW2H2F', 'Data associated with A Comprehensive Snapshot of Tuberculosis Transmission in an Urban Ugandan Community (STOMP-TB Study)', 'https://doi.org/10.7281/T1/LW2H2F', 'Lack of access to health facilities may be a barrier to initiating and completing tuberculosis (TB) treatment. We aimed to evaluate whether distance from residence to health facility is associated with treatment outcomes. We conducted a retrospective cohort study of all patients initiating TB treatment at six health facilities in Kampala from 2014-2016. Six facilities (one public and five private) whose catchment areas include the parishes of Kisugu and Wabigalo were selected and data from all patients receiving treatment at these facilities were abstracted from routinely used TB registers. This data was used to investigate associations between distance to treating facility and unfavorable TB treatment outcomes.', '26-Nov-2019', '51', '3', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/2K70CX', 'Data associated with NNIPS-Nepal Quality of Maternal and Newborn Care Study', 'https://doi.org/10.7281/T1/2K70CX', 'This collection contains datasets and relevant data collection instruments associated with peer-reviewed publications generated from the NNIPS-Nepal Quality of Maternal and Newborn Care Study.', '13-Jan-2020', '79', '3', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/LR1FMH', 'Data associated with the publication: Geographic regions enriched with frail older adults', 'https://doi.org/10.7281/T1/LR1FMH', 'Frail individuals are at particular risk in public health emergencies. Information about the concentration of frail individuals is expected to be valuable to health departments and other organizations with resources to deploy such as shelter, hospital beds, and ventilators. Additionally, researchers benefit from granular measures of frailty in communities for health services research or community-based research. We aimed to generate the probability of frailty for 100% of U.S. Medicare beneficiaries in the U.S. using a claims-based frailty index and describe the regional prevalence of frailty. We used a cross-sectional design using data from April through October 2015. We included 100% of Medicare beneficiaries with parts A and B coverage (n= 31,609,883) and calculated the probability of frailty using a validated claims-based frailty index. We report the prevalence of frail adults within each census division, state, county and U.S. zip code as the proportion of Medicare beneficiaries wi', '30-Jul-2021', '18', '3', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/2PGJQU', 'Data associated with the publication: Synthetic data accelerates the development of generalizable learning-based algorithms for X-ray image analysis', 'https://doi.org/10.7281/T1/2PGJQU', 'This dataset contains training and testing data files associated with the SyntheX benchmark experiments. It corresponds to three SyntheX applications, namely hip imaging, surgical tool detection and covid. The usage of the dataset is documented in https://github.com/arcadelab/SyntheX.', '08-Mar-2023', '93', '3', 'NA', '1', 'NA');
