insert into dataset values ('doi:10.7281/T18G8HM0', 'Data associated with An Improved Method for Interpretation of Riverine Concentration-Discharge Relationships Indicates Long-Term Shifts in Reservoir Sediment Trapping', 'https://doi.org/10.7281/T18G8HM0', 'Derived from river monitoring data, concentration-discharge (C-Q) relationships are powerful indicators of export dynamics. Proper interpretation of such relationships can be made complex, however, if the ln(C)~ln(Q) relationships are nonlinear or if the relationships change over time, season, or discharge. Methods of addressing these issues by ‘binning’ data can introduce artifacts that obscure underlying interactions among time, discharge, and season. Here we illustrate these issues and propose an alternative method that uses the regression coefficients of the recently-developed WRTDS (‘Weighted Regressions on Time, Discharge, and Season’) model for examining (C-Q) relationships in long-term, discretely-sampled data for various water-quality constituents, including their uncertainties. The method is applied to sediment concentration data from Susquehanna River at Conowingo Dam, Maryland to illustrate how the coefficients can be accessed and presented in ways that provide additional i', '08-Jun-2023', '37', '2', '37', '1', 'NA');
