insert into dataset values ('doi:10.7281/T1/L8UP2G', 'Universal vs. Conditional 3-day follow up visit for children with unclassified fever at the community level: a cluster-randomized, community-based non-inferiority trial in Kalemie, Democratic Republic of Congo', 'https://doi.org/10.7281/T1/L8UP2G', 'Our group conducted a community-based non-inferiority trial in rural Democratic Republic of Congo to examine whether or not simplified approaches to following up children with uncomplicated fever would result in similar clinical failure rates as currently recommended more intensive follow up regimens. Between 2014 and 2016, we enrolled >4,000 children with uncomplicated fever from 28 communities in and around Kalemie, DRC. Eligible children were enrolled, provided either the current recommended universal follow-up advice (i.e. all return to CHW regardless of progression of illness) or the proposed simpler conditional follow-up advice (i.e. return to CHW only if illness continues or worsens). The primary outcome of the study was clinical failure, based on a range of clinical criteria assessed by CHWs at a home-based visit 7 days after enrollment', '17-Apr-2018', '30', '4', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/VAQP5N', 'Data associated with the publication “Nutritional Resilience in Nepal Following the Earthquake of 2015” by Andrew Thorne-Lyman et al.', 'https://doi.org/10.7281/T1/VAQP5N', 'Data posted include six datasets, three for 2014 and three for 2016, at the household, woman and child level respectively for each year. These data come from annual cross-sectional surveys conducted in 7 earthquake affected areas (Village Development Committees’, with 3 wards per VDC). During each round of data collection, all consenting households living in the households meeting eligibility criteria (presence of a child under-5 years of age and/or a reproductive aged woman married in the past 2 years), were enumerated and enrolled. The datasets contain longitudinal linkages that are made in the paper across household, child and women’s data. All datasets are de-identified, no birth dates or geolocations are included. Data files are formatted for STATA, and include MS Excel outputs.', '24-Oct-2018', '34', '4', '68', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/VDZAZY', 'Data associated with the publication: Success for All: A Quantitative Synthesis of U. S. Evaluations', 'https://doi.org/10.7281/T1/VDZAZY', 'Success for All (SFA) is a comprehensive whole-school approach designed to help high-poverty elementary schools increase the reading success of their students. It is designed to ensure success in grades K-2 and then build on this success in later grades. SFA combines instruction emphasizing phonics and cooperative learning, one-to-small group tutoring for students who need it in the primary grades, frequent assessment and regrouping, parent involvement, distributed leadership, and extensive training and coaching. Over a 33-year period, SFA has been extensively evaluated, mostly by researchers unconnected to the program. This quantitative synthesis reviews the findings of these evaluations. Seventeen U.S. studies meeting rigorous inclusion standards had a mean effect size of +0.24 (p < .05) on independent measures. Effects were largest for low achievers (ES = +0.54, p < .01). Although outcomes vary across studies, mean impacts support the effectiveness of Success for All for the reading', '28-Aug-2020', '77', '4', '119', '1', 'NA');
