insert into dataset values ('doi:10.7281/T1/JYAHTN', 'Data associated with publication: Developing a hydrological monitoring and sub-seasonal to seasonal forecasting system for South and Southeast Asian river basins', 'https://doi.org/10.7281/T1/JYAHTN', 'The dataset contains monthly spatial root zone soil moisture (1m) and surface soil moisture (10cm) for South and Southeast Asia. This soil moisture dataset was simulated within Noah-Multiparameterization land surface model within the NASA’s Land Information System. The simulations spatial resolution of this dataset is 5 km. This dataset is provided by three sets of simulations, namely retrospective, hindcast with real initial condition (HindcastRIC), and hindcast with climatological initial conditions (HindcastCIC) simulation. The retrospective simulation is driven by Global Data Assimilation System (GDAS) and Climate Hazards InfraRed Precipitation products (CHIRP and CHIRPS) meteorological forcing fields. The HindcastRIC simulation is driven by downscaled NASA Goddard Earth Observing System Model - sub-seasonal to seasonal (GEOS-S2S) meteorological forecasts with initial condition the same as retrospective simulation (i.e. “real” initial condition). The HindcastCIC simulation is also', '24-Nov-2020', '14', '4', '69', '1', 'NA');
