insert into dataset values ('doi:10.7281/T1/QISGRU', 'Data associated with the publication: Coadded Spectroscopic Stellar Parameters and Abundances from the LAMOST Low Resolution Survey', 'https://doi.org/10.7281/T1/QISGRU', 'I combine duplicate spectroscopic stellar parameter estimates in the LAMOST Data Release 6 Low Resolution Spectral Survey A, F, G, and K Type stellar parameter catalog. The process of combining multiple sets of spectroscopic stellar parameter estimates typically reduces the uncertainty on the estimates by a factor of two. Moreover, this trivializes the process of performing coordinate-based cross-matching with other catalogs. Similarly, I combine duplicate stellar abundance estimates for the Xiang et al. (2019) catalog which was produced using LAMOST Data Release 5 Low Resolution Spectral Survey data. These data have numerous applications in stellar, galactic, and exoplanet astronomy.', '26-Jan-2021', '138', '4', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/QXKY4B', 'Data and code associated with publication: Impact of satellite clinics on geographic access to assisted reproductive technology services in the United States', 'https://doi.org/10.7281/T1/QXKY4B', 'The presence of either a main or satellite assisted reproductive technology (ART) clinic in a US Census Core Based Statistical Area (CBSA) was modeled using logistic regression. The presence of main and satellite clinics were modeled separately as a function of CBSA median income and CBSA female population age 20-45. The counts of clinics was explored in relation to medical practice number of ART cycles. The impact of a state insurance mandate for in vitro fertilization (IVF) on the number of clinics per capita was also investigated. Finally, the number of satellite and main clinics per practice was compiled with respect to US geographic region.', '03-Sep-2021', '65', '4', '130', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/QXKY4B', 'Data and code associated with publication: Impact of satellite clinics on geographic access to assisted reproductive technology services in the United States', 'https://doi.org/10.7281/T1/QXKY4B', 'The presence of either a main or satellite assisted reproductive technology (ART) clinic in a US Census Core Based Statistical Area (CBSA) was modeled using logistic regression. The presence of main and satellite clinics were modeled separately as a function of CBSA median income and CBSA female population age 20-45. The counts of clinics was explored in relation to medical practice number of ART cycles. The impact of a state insurance mandate for in vitro fertilization (IVF) on the number of clinics per capita was also investigated. Finally, the number of satellite and main clinics per practice was compiled with respect to US geographic region.', '03-Sep-2021', '65', '4', '131', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/6I0KPP', 'Data associated with publication: Evidence for the late arrival of hot Jupiters in systems with high host-star obliquities', 'https://doi.org/10.7281/T1/6I0KPP', 'In the associated publication, we homogeneously derive photospheric stellar parameters from photometry and then run stellar models in MESA to derive convective envelope masses. This data archive includes a machine-readable table containing the input and output data for the isochrone analysis as well as the surface convective envelope masses we derived using MESA models. The data archive also includes directories for each star containing the MESA configuration files for each star and the MESA output files for each star.', '05-Jul-2022', '13', '3', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/RTSGO0', 'Data associated with the publication: Intrinsically disordered interaction network in an RNA chaperone revealed by native mass spectrometry', 'https://doi.org/10.7281/T1/RTSGO0', 'This collection contains the raw native mass spectrometry (nMS) data for Energy-Resolved Mass Spectra (ERMS), collisional cross section (CCS) calculations, and surface-induced unfolding (SIU) plots. It also contains molecular dynamics (MD) trajectories of WT Hfq. From the abstract: RNA-binding proteins contain intrinsically disordered regions whose functions in RNA recognition are poorly understood. The RNA chaperone Hfq is a homohexamer that contains six flexible C-terminal domains (CTDs). The effect of the CTDs on Hfq’s integrity and RNA binding has been challenging to study because of their sequence identity and inherent disorder. We used native mass spectrometry coupled with surface-induced dissociation and molecular dynamics simulations to disentangle the arrangement of the CTDs and their impact on the stability of Escherichia coli Hfq with and without RNA. The results show that the CTDs stabilize the Hfq hexamer through multiple interactions with the core and between CTDs. RNA bi', '15-Nov-2022', '29', '4', '151', '1', 'NA');
