insert into dataset values ('doi:10.7281/T1MW2F2Z', 'Data associated with: Vascular endothelial growth factor and substrate mechanics regulate in vitro tubulogenesis of endothelial progenitor cells.', 'https://doi.org/10.7281/T1MW2F2Z', 'Endothelial progenitor cells (EPCs) in the circulatory system have been suggested to maintain vascular homeostasis and contribute to adult vascular regeneration and repair. These processes require that EPCs break down the extracellular matrix (ECM), migrate, differentiate and undergo tube morphogenesis. Evidently, the ECM plays a critical role by providing biochemical and biophysical cues that regulate cellular behaviour. Using a chemically and mechanically tunable hydrogel to study tube morphogenesis in vitro, we show that vascular endothelial growth factor (VEGF) and substrate mechanics co-regulate tubulogenesis of EPCs. High levels of VEGF are required to initiate tube morphogenesis and activate matrix metalloproteinases (MMPs), which enable EPC migration. Under these conditions, the elasticity of the substrate affects the progression of tube morphogenesis. With decreases in substrate stiffness, we observe decreased MMP expression while increased cellular elongation, with intracel l', '25-Aug-2015', '21', '5', '41', '1', 'NA');
