insert into dataset values ('doi:10.7281/T1VD6WC7', 'Data associated with the publication: Long-term trends of nutrients and sediment from the nontidal Chesapeake watershed: an assessment of progress by river and season', 'https://doi.org/10.7281/T1VD6WC7', 'From the study abstract: To assess historical loads of nitrogen (N), phosphorus (P), and suspended sediment (SS) from the nontidal Chesapeake Bay watershed (NTCBW), we analyzed decadal seasonal trends of flow-normalized loads at the fall-line of nine major rivers that account for >90% of NTCBW flow. Evaluations of loads by season revealed N, P, and SS load magnitudes have been highest in January-March and lowest in July-September, but the temporal trends have followed similar decadal-scale patterns in all seasons, with notable exceptions. Generally, total N (TN) load has dropped since the late 1980s, but particulate nutrients and SS have risen since the mid-1990s. The majority of these rises were from Susquehanna River and relate to diminished net trapping at the Conowingo Reservoir. Substantial rises in SS were also observed, however, in other rivers. Moreover, the summed rise in particulate P load from other rivers is of similar magnitude as from Susquehanna. Dissolved nutrient loads', '12-Apr-2016', '62', '5', '37', '1', 'NA');
