insert into dataset values ('doi:10.7281/T1QN64NW', 'Data associated with the publication: Decadal-scale export of nitrogen, phosphorus, and sediment from the Susquehanna River basin, USA: Analysis and synthesis of temporal and spatial patterns', 'https://doi.org/10.7281/T1QN64NW', 'From the study abstract: The export of nitrogen (N), phosphorus (P), and suspended sediment (SS) is a long-standing management concern for the Chesapeake Bay watershed, USA. Here we present a comprehensive evaluation of nutrient and sediment loads over the last three decades at multiple locations in the Susquehanna River basin (SRB), Chesapeake''s largest tributary watershed. Sediment and nutrient riverine loadings, including both dissolved and particulate fractions, have generally declined at all sites upstream of Conowingo Dam (non-tidal SRB outlet). Period-of-record declines in riverine yield are generally smaller than those in source input, suggesting the possibility of legacy contributions. Consistent with other watershed studies, these results reinforce the importance of considering lag time between the implementation of management actions and achievement of river quality improvement. Whereas flow-normalized loadings for particulate species have increased recently below Conowingo', '10-Jun-2016', '102', '5', '39', '1', 'NA');
