insert into dataset values ('doi:10.7281/T1/Y2PVKD', 'Light attenuation in the ocean by yellowing materials: Earth System Model simulations', 'https://doi.org/10.7281/T1/Y2PVKD', 'Colored detrital matter (CDM) consists of dissolved organic molecules and detrital materials that impart a yellow shift to the ocean’s color. We ran two climate model simulations: one of an ocean including CDM (”Yellow Ocean”) and one without (”Green Ocean”). The differences between these simulations show the impacts of decreased water clarity in the Yellow Ocean. Implications for ocean biogeochemistry and physics are presented in the associated publications.', '13-Mar-2018', '15', '5', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/6JMKIG', 'Meteorological station data associated with publication Stettz et al. (2019) Estimating variability in downwelling surface shortwave radiation in a tropical highland environment. PLOS ONE.', 'https://doi.org/10.7281/T1/6JMKIG', 'The data included in these files are daily maximum temperature, daily minimum temperature, and daily average incoming solar radiation for four sites in the Blue Nile Highlands of Ethiopia. They were used to calibrate statistical models of solar radiation as a function of diurnal temperature range and to evaluate solar radiation estimates from existing meteorological reanalysis systems. The purpose is to obtain estimates of daily solar radiation for areas where measurements are not available, as many meteorological data sets do not include information on incoming solar radiation, yet it is a required input for many biophysical models.', '15-Jan-2019', '16', '5', '59', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/6JMKIG', 'Meteorological station data associated with publication Stettz et al. (2019) Estimating variability in downwelling surface shortwave radiation in a tropical highland environment. PLOS ONE.', 'https://doi.org/10.7281/T1/6JMKIG', 'The data included in these files are daily maximum temperature, daily minimum temperature, and daily average incoming solar radiation for four sites in the Blue Nile Highlands of Ethiopia. They were used to calibrate statistical models of solar radiation as a function of diurnal temperature range and to evaluate solar radiation estimates from existing meteorological reanalysis systems. The purpose is to obtain estimates of daily solar radiation for areas where measurements are not available, as many meteorological data sets do not include information on incoming solar radiation, yet it is a required input for many biophysical models.', '15-Jan-2019', '16', '5', '60', '1', 'NA');
