insert into dataset values ('doi:10.7281/T1/UMDMQK', 'The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Annual Survey Datasets 2013-2016', 'https://doi.org/10.7281/T1/UMDMQK', 'The Feed the Future Innovation Lab for Nutrition, with funding from the USAID, conducted a series of four annual surveys – The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Surveys – in Nepal from 2013-2016. The aim of the surveys was to assess nutritional status, diet and morbidity of preschool aged children and their mothers, and recently married, nulliparous women, and household food security, agricultural practices, participation in services and programs, among other factors, and examine associations between agricultural practices and food security, nutritional status, diet and health. The broader goal was guide policy and program interventions that may influence household food security, poverty, and the diets, health and nutrition of pre-school children and their mothers. The PoSHAN surveys were conducted in a total of 21 sub-district units or Village Development Committees (VDCs), each in a unique district. The VDCs in PoSHAN form a nationally representative s', '30-May-2019', '279', '5', '102', '1', 'NA');
