insert into dataset values ('doi:10.7281/T1/4ZCOC4', 'Data associated with publication “Assimilating GRACE into a Land Surface Model in the presence of an irrigation-induced groundwater trend”', 'https://doi.org/10.7281/T1/4ZCOC4', 'The datasets include monthly time-varying greenness vegetation fraction and daily output of a set of four simulations performed with the Noah-Multiparameterization Land Surface Model v3.6 within NASA Land Information System. All simulations are conducted for the main GRACE data period (April 2002 to June 2017) at 0.125° spatial resolution forced by the North America Land Data Assimilation System-Phase 2 (NLDAS-2) meteorological forcing fields. Simulation outputs include surface water and energy fluxes and storages.', '06-Apr-2020', '37', '5', 'NA', '1', 'NA');
