insert into dataset values ('doi:10.7281/T1/NEACHP', 'Data associated with the publication: Optical properties of organic hazes in water-rich exoplanet atmospheres: Implications for observations with JWST', 'https://doi.org/10.7281/T1/NEACHP', 'We report the optical properties of two haze analogous to those produced in temperate water-rich exoplanet atmospheres. Their optical constants (the real refractive indices, n, and the extinction coefficients, k) are derived from 0.4 to 28.6 μm, covering optical wavelengths accessible with Hubble and ground-based facilities and the entire JWST wavelength range. The optical constants of our water-rich derived exoplanet hazes differ from those of the Titan-like hazes, therefore affecting transmission, thermal emission, and reflected light spectra of exoplanets to different extents. The two sets of optical constants reported here are applicable for temperate water-rich exoplanet atmospheres and can be used for current and future observational and modeling efforts of such atmospheres.', '06-Jan-2023', '153', '5', 'NA', '1', 'NA');
