insert into dataset values ('doi:10.7281/T1/B1QTXI', 'Estadística Agrícola de la República, 1899-1900/ Agricultural Statistics from Mexico, 1899-1900', 'https://doi.org/10.7281/T1/B1QTXI', 'In 1898, the Mexican Agricultural Society proposed a comprehensive survey of Mexico''s agricultural properties to be presented at the Paris Exposition in 1900. In collaboration with the national Department of Fomento, or Development, they proposed and revised a table requesting information on agricultural activity across the country by property. Asserting that the Statistical Office already had much information to hand, Fomento officials removed numerous columns from the proposed table. They then circulated the resultant survey to every municipal president in Mexico in summer 1899. This dataset is built on transcriptions of the tables returned by municipal and state officials. It represents about 1,400 municipalities from 18 states and territories. The EstadisticaAgricola1899_AllData file includes all the transcribed data at the property level. The EstadisticaAgricola1899_SummaryStatistics file includes data summarized at the municipal level. The tables were transcribed as directly as p', '09-Jun-2023', '1644', '5', '158', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/B1QTXI', 'Estadística Agrícola de la República, 1899-1900/ Agricultural Statistics from Mexico, 1899-1900', 'https://doi.org/10.7281/T1/B1QTXI', 'In 1898, the Mexican Agricultural Society proposed a comprehensive survey of Mexico''s agricultural properties to be presented at the Paris Exposition in 1900. In collaboration with the national Department of Fomento, or Development, they proposed and revised a table requesting information on agricultural activity across the country by property. Asserting that the Statistical Office already had much information to hand, Fomento officials removed numerous columns from the proposed table. They then circulated the resultant survey to every municipal president in Mexico in summer 1899. This dataset is built on transcriptions of the tables returned by municipal and state officials. It represents about 1,400 municipalities from 18 states and territories. The EstadisticaAgricola1899_AllData file includes all the transcribed data at the property level. The EstadisticaAgricola1899_SummaryStatistics file includes data summarized at the municipal level. The tables were transcribed as directly as p', '09-Jun-2023', '1644', '5', '159', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/EQKCFP', 'Data associated with the publication: The influenza B virus Victoria and Yamagata lineages display distinct cell tropism and infection induced host gene expression in human nasal epithelial cell cultures', 'https://doi.org/10.7281/T1/EQKCFP', 'Understanding Influenza B virus infections is of critical importance in our efforts to control severe influenza and influenza-related disease. Until 2020, two genetic lineages of influenza B virus – Yamagata and Victoria – circulated in the population. These lineages are antigenically distinct but differences in virus replication or the induction of host cell responses after infection have not been carefully studied. Recent IBV clinical isolates of both lineages were obtained from influenza surveillance efforts of the Johns Hopkins Center of Excellence in Influenza Research and Response and characterized in vitro. B/Victoria and B/Yamagata clinical isolates were recognized less efficiently by serum from influenza-vaccinated individuals in comparison to the vaccine strains. B/Victoria lineages formed smaller plaques on MDCK cells compared to B/Yamagata, but infectious virus production in primary human nasal epithelial cell (hNEC) cultures showed no differences. While ciliated epithelial', '20-Oct-2023', '19', '5', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/8DBUAP', 'Data associated with the publication: Dimerization and autophosphorylation of the MST family of kinases are controlled by the same set of residues', 'https://doi.org/10.7281/T1/8DBUAP', 'This archive contains the raw data far-UV circular dichroism (CD) data collected on wild-type and variants of the human MST2 kinase domain.', '13-Jul-2023', '13', '5', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1KW5CX5', 'Data associated with Long-term seasonal trends of nitrogen, phosphorus, and suspended sediment load from the non-tidal Susquehanna River Basin to Chesapeake Bay', 'https://doi.org/10.7281/T1KW5CX5', 'From the study abstract: Reduction of nitrogen (N), phosphorus (P), and suspended sediment (SS) load has been a principal focus of Chesapeake Bay Watershed management for decades. To evaluate the progress of management actions in the Bay''s largest tributary, the Susquehanna River, we analyzed the long-term seasonal trends of flow-normalized N, P, and SS load over the last two to three decades, both above and below the Lower Susquehanna River Reservoir System. Our results indicate that annual and decadal-scale trends of nutrient and sediment load generally followed similar patterns in all four seasons, implying that changes in watershed function and land use had similar impacts on nutrient and sediment load at all times of the year. Above the reservoir system, the combined loads from the Marietta and Conestoga Stations indicate general trends of N, P, and SS reduction in the Susquehanna River Basin, which can most likely be attributed to a suite of management actions on point, agricultu', '07-Apr-2016', '76', '6', '37', '1', 'NA');
