insert into dataset values ('doi:10.7281/T1/DG7RDP', 'Data associated with Gnanadesikan, Kim, and Pradal, Impact of colored dissolved materials on the annual cycle of sea surface temperature: Potential implications for extreme ocean temperatures', 'https://doi.org/10.7281/T1/DG7RDP', 'Because colored dissolved materials (CDMs) trap incoming sunlight closer to the surface, they have the potential to affect sea surface temperatures. We compare two models, one with and one without CDMs, and show that their presence leads to an increase in the amplitude of the seasonal cycle over coastal and northern subpolar regions, which may exceed 2°C. The size and sign of the change are controlled by the interplay between enhanced shortwave heating of the surface, shading and cooling of the subsurface and the extent to which these are connected by vertical mixing. The changes in the seasonal cycle largely explain changes in the range of temperature extremes, an aspect of climate with important implications for ecosystem cycling. The modeled changes associated with CDMs have an intriguing resemblance to the observed trend in the annual cycle seen in recent decades, suggesting that more attention be paid to the role of “ocean yellowing” in global change.', '23-Jan-2019', '24', '6', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/XZ0CGJ', 'Fertility clinic locations and details in the United States', 'https://doi.org/10.7281/T1/XZ0CGJ', 'Dataset contains locations and details of fertility clinics in the United States. A systematic web-search completed in January 2021 of Assisted Reproductive Technology (ART) clinics in the United States found 471 main clinics with embryology labs and 586 satellite clinics without embryology labs for a total of 1,057 clinic locations in the United States performing or facilitating ART. A few assumptions were made about the details of the clinics. First, it was assumed that the medical director was the medical director listed in the 2018 Success Rates data from the CDC. All main clinics were assumed to be open to the public Monday through Friday unless otherwise specified on the practice’s website. For satellite clinics, it was assumed if not listed online that the services provided offered at that location were: consultations, bloodwork, and ultrasound monitoring. For main clinics, it was assumed if not listed online that the services provided were: consultations, bloodwork, ultrasound', '30-Jul-2021', '195', '6', '130', '1', 'NA');
