insert into dataset values ('doi:10.7281/T17P8W98', 'Data associated with: Endothelial cell responses to micropillar substrates of varying dimensions and stiffness', 'https://doi.org/10.7281/T17P8W98', 'Data files associated with seleted figures from the title publication. From the abstract: In the vascular niche, the extracellular matrix (ECM) provides a structural scaffold with a rich ligand landscape of essential matrix proteins that supports the organization and stabilization of endothelial cells (ECs) into functional blood vessels. Many of the physical interactions between ECs and macromolecular components of the ECM occur at both the micron and submicron scale. In addition, the elasticity of the ECM has been shown to be a critical factor in the progress of the angiogenic cascade. Here, we sought to determine the effect of substrate topography and elasticity (stiffness) on EC behavior. Utilizing a unique SiO2 substrate with an array of micropillars, we first demonstrate that micropillars with heights >3 μm significantly decrease EC adhesion and spreading. Fibronectin (Fn) patterning of 1 μm high micropillars enabled EC adhesion onto the micropillars and promoted alignment in a si', '25-Aug-2015', '52', '7', '41', '1', 'NA');
