insert into dataset values ('doi:10.7281/T1F769G3', 'Data associated with the Real-Time Monitoring of Under-Five Mortality (RMM) project', 'https://doi.org/10.7281/T1F769G3', 'The Real-Time Monitoring of Under-Five Mortality (RMM) project aimed to develop and test methods for producing estimates of child mortality for recent periods of one year or less. Three broad approaches were assessed: 1) community-based reporting of vital events; 2) calibration of facility data to represent deaths in the population; and 3) rapid survey methods. Between 2008 and 2013, we applied and rigorously evaluated at least two of these approaches in each of five countries in sub-Saharan Africa: Ethiopia, Ghana, Malawi, Mali, and Niger. The RMM project has generated an important body of evidence that can inform efforts to strengthen civil registration and vital statistics systems in low-income countries.', '16-Mar-2023', '78', '7', '49', '1', 'NA');
insert into dataset values ('doi:10.7281/T1F769G3', 'Data associated with the Real-Time Monitoring of Under-Five Mortality (RMM) project', 'https://doi.org/10.7281/T1F769G3', 'The Real-Time Monitoring of Under-Five Mortality (RMM) project aimed to develop and test methods for producing estimates of child mortality for recent periods of one year or less. Three broad approaches were assessed: 1) community-based reporting of vital events; 2) calibration of facility data to represent deaths in the population; and 3) rapid survey methods. Between 2008 and 2013, we applied and rigorously evaluated at least two of these approaches in each of five countries in sub-Saharan Africa: Ethiopia, Ghana, Malawi, Mali, and Niger. The RMM project has generated an important body of evidence that can inform efforts to strengthen civil registration and vital statistics systems in low-income countries.', '16-Mar-2023', '78', '7', '50', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/0EYOMQ', 'Data associated with the publication: Remote sensing-based vegetation and soil moisture constraints reduce irrigation estimation uncertainty', 'https://doi.org/10.7281/T1/0EYOMQ', 'The datasets include processed monthly ALEXI evapotranspiration (ET) product, the Kullback-Leibler Divergence metrics for surface soil moisture, and monthly output of simulations performed with the Noah-Multiparameterization Land Surface Model v4.0.1 within NASA Land Information System. The simulations are conducted for the period of 2018 at 0.125° spatial resolution forced by the North America Land Data Assimilation System-Phase 2 (NLDAS-2) meteorological forcing fields. Data is provided in NETCDF format including monthly irrigation water amount, greenness vegetation fraction, and ET.', '09-Mar-2022', '29', '7', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/OOMZS7', 'Data associated with the publication: Using neural networks to uncover the relationship between highly variable behavior and EEG during a working memory task with distractors.', 'https://doi.org/10.7281/T1/OOMZS7', 'The dataset contains all the data used in the paper “Using Neural Networks to Uncover the Relationship between Highly Variable Behavior and EEG during a Working Memory Task with Distractors”. Specifically, it includes, for 16 participants, the time-locked raw EEG data for the 540 trials and the corresponding raw reaction time.', '06-Jun-2022', '44', '7', 'NA', '1', 'NA');
