insert into dataset values ('doi:10.7281/T1RN35S8', 'Data associated with: Controlled activation of morphogenesis to generate a functional human microvasculature in a synthetic matrix', 'https://doi.org/10.7281/T1RN35S8', 'Understanding the role of the extracellular matrix (ECM) in vascular morphogenesis has been possible using natural ECMs as in vitro models to study the underlying molecular mechanisms. However, little is known about vascular morphogenesis in synthetic matrices where properties can be tuned toward both the basic understanding of tubulogenesis in modular environments and as a clinically relevant alternative to natural materials for regenerative medicine. We investigated synthetic, tunable hyaluronic acid (HA) hydrogels and determined both the adhesion and degradation parameters that enable human endothelial colony-forming cells (ECFCs) to form efficient vascular networks. Entrapped ECFCs underwent tubulogenesis dependent on the cellular interactions with the HA hydrogel during each stage of vascular morphogenesis. Vacuole and lumen formed through integrins α5β1 and αVβ3, while branching and sprouting were enabled by HA hydrogel degradation. Vascular networks formed within HA hydrogels co', '25-Aug-2015', '26', '8', '41', '1', 'NA');
