insert into dataset values ('doi:10.7281/T1057CVH', 'Data associated with: Controlling Colloidal Particles with Electric Fields', 'https://doi.org/10.7281/T1057CVH', 'In this instructional review, we discuss how to control individual colloids and ensembles of colloids using electric fields. We provide background on the electrokinetic transport mechanisms and kT-scale equilibrium colloidal interactions that enable such control. We also describe the experimental configurations, microscopy methods, image analyses, and material systems for which these mechanisms have been successfully employed. Methods are presented for creating various structures including colloidal chains, quasi-2D colloidal crystals, and 3D colloidal crystals. We also describe electric-field-mediated feedback control of the colloidal crystal size as well as colloidal crystal assembly and disassembly. Finally, we discuss future extensions of these methods that aim to incorporate accurate colloidal crystallization dynamic models into electric-field-mediated feedback control to allow rapid assembly, disassembly, and repair of defect-free colloidal structures.', '25-Aug-2015', '54', '8', '35', '1', 'NA');
insert into dataset values ('doi:10.7281/T1057CVH', 'Data associated with: Controlling Colloidal Particles with Electric Fields', 'https://doi.org/10.7281/T1057CVH', 'In this instructional review, we discuss how to control individual colloids and ensembles of colloids using electric fields. We provide background on the electrokinetic transport mechanisms and kT-scale equilibrium colloidal interactions that enable such control. We also describe the experimental configurations, microscopy methods, image analyses, and material systems for which these mechanisms have been successfully employed. Methods are presented for creating various structures including colloidal chains, quasi-2D colloidal crystals, and 3D colloidal crystals. We also describe electric-field-mediated feedback control of the colloidal crystal size as well as colloidal crystal assembly and disassembly. Finally, we discuss future extensions of these methods that aim to incorporate accurate colloidal crystallization dynamic models into electric-field-mediated feedback control to allow rapid assembly, disassembly, and repair of defect-free colloidal structures.', '25-Aug-2015', '54', '8', '36', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/DP2U9M', 'Datasets associated with “Validating a dimension of doubt in decision-making: a proposed endophenotype for obsessive-compulsive disorder”', 'https://doi.org/10.7281/T1/DP2U9M', 'Doubt is subjective uncertainty about one’s perceptions and recall. It can impair decision-making and is a prominent feature of obsessive-compulsive disorder (OCD). We propose that evaluation of doubt during decision-making provides a useful endophenotype with which to study the underlying pathophysiology of OCD and potentially other psychopathologies. For the current study, we developed a new instrument, the Doubt Questionnaire, to clinically assess doubt, and evaluated its psychometric properties. The random dot motion task was used to measure reaction time and subjective certainty, at varying levels of perceptual difficulty, in individuals who scored high and low on doubt, and in individuals with and without OCD. We found that doubt scores were significantly higher in OCD cases than controls. Drift diffusion modeling revealed that high doubt scores predicted slower evidence accumulation than did low doubt scores; and OCD diagnosis lower than controls. At higher levels of dot coheren', '10-Jul-2019', '168', '7', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/UXPNT5', 'Data associated with the publication: "In our culture, if you quarantine someone, you stigmatize them": Qualitative insights on barriers to observing COVID-19 prevention behaviors in Côte d’Ivoire', 'https://doi.org/10.7281/T1/UXPNT5', 'While vaccines are now authorized for use against the SARS-CoV2 virus, they remain inaccessible for much of the world and widespread hesitancy persists. Ending the COVID-19 pandemic depends on continued prevention behaviors such as mask wearing, distancing, hand hygiene, and limiting large gatherings. Similarly, stigma related to COVID-19 has received little attention from the global south. The Breakthrough ACTION project led by Johns Hopkins Center for Communication Programs conducted a qualitative study in November 2020 in Côte d’Ivoire to explore people’s experience with and perceptions of the COVID-19 pandemic. We conducted 24 focus group discussions and 29 in-depth interviews with members of the general population and health providers which have allowed for the analysis of vaccine perceptions, attitudes and practices related to prevention behaviors, and stigma.', '08-Apr-2022', '33', '8', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/NU0VS7', 'Data associated with the publication: Similarities in storage and transport of sulfate in forested and suburban watersheds, despite anthropogenically elevated suburban sulfate', 'https://doi.org/10.7281/T1/NU0VS7', 'This study focuses on differences in sources and dynamics of sulfate in a forested versus suburban streams in an unglaciated region underlain by schist. Sulfate in streams is both an important nutrient and potential pollutant that is linked with the nitrogen, carbon, and phosphorus cycles. There are uncertainties about how suburban sulfate sources including septic, fertilizer, road salt, and infrastructure impact sulfate fluxes. We studied suburban and forested headwater catchments nested within a 381-ha catchment to estimate the magnitude of sulfate sources and evaluate the effects of land use on transport to streams. Data for this study include discharge, sulfate concentrations, water hydrogen and oxygen values, and sulfate sulfur and oxygen isotope data, as well as results of models described in the paper.', '02-Jan-2024', '16', '8', '161', '1', 'NA');
