insert into dataset values ('doi:10.7281/T1/KTOG9W', 'Data associated with the publication: Iron oxide nanoparticles inhibit tumor progression and suppress lung metastases in mouse models of breast cancer', 'https://doi.org/10.7281/T1/KTOG9W', 'Systemic exposure to starch-coated iron oxide nanoparticles (IONPs) can stimulate antitumor T cell responses, even when little IONP is retained within the tumor. Here, we demonstrate in mouse models of metastatic breast cancer that IONPs can alter the host immune landscape leading to systemic immune-mediated disease suppression. We report that a single intravenous injection of IONPs can inhibit primary tumor growth, suppress metastases, and extend survival. Gene expression analysis revealed activation of Toll-like receptor (TLR) pathways involving signaling via Toll/Interleukin-1 Receptor domain-containing adaptor-inducing IFN-β (TRIF), a TLR pathway adaptor protein. Requisite participation of TRIF in suppressing tumor progression was demonstrated with histopathologic evidence of upregulated IFN-regulatory factor 3 (IRF3), a downstream protein, and confirmed in a TRIF knockout syngeneic mouse model of metastatic breast cancer. Neither starch-coated polystyrene nanoparticles lacking iro', '02-May-2024', '25', '8', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1154F09', 'Data associated with: Size dependent thermodynamics and kinetics in electric field mediated colloidal crystal assembly.', 'https://doi.org/10.7281/T1154F09', 'From the study abstract We compare measurements and models of the system size dependent assembly of quasi-two dimensional (2D) colloidal crystals within interfacial quadrupole electrodes. Perturbation theory (PT) and Monte Carlo (MC) simulations are used to make thermodynamic predictions of the voltages required to obtain all particles within a crystalline phase for different system sizes. These results show good agreement with video microscopy (VM) measurements of colloidal crystals contain ing 75–300 particles. Colloidal assembly kinetic trajectories for the same system sizes are quantified from VM experiments using order parameters (reaction coordinates) to capture real-space local and global hexagonal ordering. These trajectories are fit with a Smoluchowski model to extract configuration dependent free energy and diffusivity landscapes (FEL, DL) that capture the microscopic details of assembly dynamics. Landscape features, such as the number and heights of barriers and local gradie', '25-Aug-2015', '80', '9', '35', '1', 'NA');
insert into dataset values ('doi:10.7281/T1154F09', 'Data associated with: Size dependent thermodynamics and kinetics in electric field mediated colloidal crystal assembly.', 'https://doi.org/10.7281/T1154F09', 'From the study abstract We compare measurements and models of the system size dependent assembly of quasi-two dimensional (2D) colloidal crystals within interfacial quadrupole electrodes. Perturbation theory (PT) and Monte Carlo (MC) simulations are used to make thermodynamic predictions of the voltages required to obtain all particles within a crystalline phase for different system sizes. These results show good agreement with video microscopy (VM) measurements of colloidal crystals contain ing 75–300 particles. Colloidal assembly kinetic trajectories for the same system sizes are quantified from VM experiments using order parameters (reaction coordinates) to capture real-space local and global hexagonal ordering. These trajectories are fit with a Smoluchowski model to extract configuration dependent free energy and diffusivity landscapes (FEL, DL) that capture the microscopic details of assembly dynamics. Landscape features, such as the number and heights of barriers and local gradie', '25-Aug-2015', '80', '9', '36', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/XGVRX0', 'Data associated with the publication: Nanoscale boreceptor layers comprising carboxylated polythiophene for organic electrochemical transistor-based biosensors', 'https://doi.org/10.7281/T1/XGVRX0', 'From the publication abstract: We investigated the carboxylated conjugated polymer poly 3-(3-carboxypropyl)thiophene-2,5-diyl as a nanosized (200–350 nm) biomolecule receptor layer on the channel of organic electrochemical transistor (OECT) devices. Myelin basic protein, SARS-CoV-2 spike glycoprotein S1, and their antibodies (10 nm size scale) were alternately used in the attached molecule form as receptors and analytes. Sub-ng detection in buffer was observed, and response to S1 was also obtained in clinical serum. Changes in threshold voltage and current output from OECT transfer curves and measurements of open circuit potential between receptor layers and a reference electrode provided complementary responses and insight into the response mechanisms, guiding further development of electrochemical field-effect and voltammetric protein sensors based on polymeric active layers with nanoscale functionality.', '23-Jun-2022', '28', '9', '76', '1', 'NA');
