insert into dataset values ('doi:10.7281/T1/YPUEQT', 'Data associated with the publication: RNA compaction and iterative scanning for small RNA targets by the Hfq chaperone.', 'https://doi.org/10.7281/T1/YPUEQT', 'This dataset is related to a manuscript submitted to Nature Communications, describing a one-dimensional target search by small RNAs and Hfq, using single molecule total internal reflection fluorescence microscopy. RNA-guided enzymes must quickly search a vast sequence space for their targets. This search is aided by chaperones such as Hfq, a protein that mediates regulation by bacterial small RNAs (sRNAs). How RNA binding proteins enhance this search is little known. Using single-molecule Förster resonance energy transfer, we show that E. coli Hfq performs a one-dimensional scan in which compaction of the target RNA delivers sRNAs to sites distant from the location of Hfq recruitment. We also show that Hfq can transfer an sRNA between different target sites in a single mRNA, favoring the most stable duplex. We propose that compaction and segmental transfer, combined with repeated cycles of base pairing, enable the kinetic selection of optimal sRNA targets. Finally, we show that RNA co', '01-Feb-2024', '17', '9', '151', '1', 'NA');
