insert into dataset values ('doi:10.7281/T1/5QMDY6', 'Data associated with the publication: Co-transcriptional folding of the glmS ribozyme enables a rapid response to metabolite', 'https://doi.org/10.7281/T1/5QMDY6', 'This dataset is related to a manuscript submitted to Nucleic Acids Research, describing co-transcriptional folding of the Bacillus subtilis glmS ribozyme, using single molecule total internal reflection fluorescence microscopy. The glmS ribozyme riboswitch, located in the 5’ UTR of the Bacillus subtilis glmS mRNA, regulates cell wall biosynthesis through ligand-induced self-cleavage and decay of the glmS mRNA. Although self-cleavage of the refolded glmS ribozyme has been studied extensively, the kinetics of ribozyme folding and ligand binding during transcription is not understood. Here, we combine TIRF single-molecule assays with kinetic modeling to show that self-cleavage can occur during transcription before the ribozyme is fully synthesized. Moreover, co-transcriptional folding of the RNA at a physiological elongation rate allows the ribozyme core itself to become reactive. DMS footprinting further revealed how slow sequential folding favors formation of the native core structure t', '25-Aug-2023', '23', '10', '151', '1', 'NA');
