insert into dataset values ('doi:10.7281/T1WD3XHM', 'Data associated with: Smooth-Muscle-Like cells derived from human embryonic stem cells support and augment cord-like structures in vitro', 'https://doi.org/10.7281/T1WD3XHM', 'From the publication abstract: Engineering vascularized tissue is crucial for its successful implantation, survival, and integration with the host tissue. Vascular smooth muscle cells (v-SMCs) provide physical support to the vasculature and aid in maintaining endothelial viability. In this study, we show an efficient derivation of v-SMCs from human embryonic stem cells (hESCs), and demonstrate their functionality and ability to support the vasculature in vitro. Human ESCs were differentiated in monolayers and supplemented with platelet-derived growth factor-BB (PDGF-BB) and transforming growth factor-beta 1 (TGF-β1). Human ESC-derived smooth-muscle-like cells (SMLCs) were found to highly express specific smooth muscle cell (SMC) markers—including α-smooth muscle actin, calponin, SM22, and smooth muscle myosin heavy chain—to produce and secrete fibronectin and collagen, and to contract in response to carbachol. In vitro tubulogenesis assays revealed that these hESC-derived SMLCs interac', '25-Aug-2015', '41', '11', '41', '1', 'NA');
