insert into dataset values ('doi:10.7281/T1W66HPZ', 'Data associated with publication: Action enhances acoustic cues for 3-D target localization by echolocating bats.', 'https://doi.org/10.7281/T1W66HPZ', 'Under natural conditions, animals encounter a barrage of sensory information, from which they must select and interpret biologically relevant signals. Active sensing can facilitate this process by engaging motor systems in the sampling of sensory information. The echolocating bat serves as an excellent model to investigate the coupling between action and sensing, because it adaptively controls both the acoustic signals used to probe the environment, and movements to receive echoes at the auditory periphery. We report here that the echolocating bat controls the features of its sonar vocalizations in tandem with the positioning of the outer ears to maximize acoustic cues for target detection and localization. The bat’s adaptive control of sonar vocalizations and ear positioning occurs on a millisecond time-scale to capture spatial information from arriving echoes, as well as on a longer time-scale, to track target movement. Our results demonstrate that purposeful control over sound produ', '08-Sep-2016', '127', '10', '33', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/2QCZXM', 'Data associated with: Digital Administrative Atlas of Mexico in 1900/Atlas digital administrativo de México en 1900.', 'https://doi.org/10.7281/T1/2QCZXM', 'This dataset, comprising four layers of shapefiles and attendant .csv files, provides a tool for mapping Mexico in and around 1900. It includes polygon and points layers representing the municipalities, districts, and states included in the 1900 Mexican census. It can be used to visualize and analyze information related to late nineteenth and early twentieth century Mexico with greater accuracy than GIS layers representing contemporary Mexico. Esta base de datos, que incluye cuatro capas de archivos shape con sus correspondientes archivos csv, provee una herramienta para la cartografía de México en el año 1900. Incluye capas de polígonos y puntos que representan los municipios, distritos, y estados incluidos en el censo de México en 1900. Lo puede usar para visualizar y analizar información del siglo diecinueve y los primeros años del siglo veinte de México con más precisión de las capas SIG de México contemporaneo.', '06-Feb-2024', '2260', '11', '158', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/2QCZXM', 'Data associated with: Digital Administrative Atlas of Mexico in 1900/Atlas digital administrativo de México en 1900.', 'https://doi.org/10.7281/T1/2QCZXM', 'This dataset, comprising four layers of shapefiles and attendant .csv files, provides a tool for mapping Mexico in and around 1900. It includes polygon and points layers representing the municipalities, districts, and states included in the 1900 Mexican census. It can be used to visualize and analyze information related to late nineteenth and early twentieth century Mexico with greater accuracy than GIS layers representing contemporary Mexico. Esta base de datos, que incluye cuatro capas de archivos shape con sus correspondientes archivos csv, provee una herramienta para la cartografía de México en el año 1900. Incluye capas de polígonos y puntos que representan los municipios, distritos, y estados incluidos en el censo de México en 1900. Lo puede usar para visualizar y analizar información del siglo diecinueve y los primeros años del siglo veinte de México con más precisión de las capas SIG de México contemporaneo.', '06-Feb-2024', '2260', '11', '159', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/AVEV7M', 'Data associated with the publication: Small RNAs and Hfq capture unfolded RNA target sites during transcription', 'https://doi.org/10.7281/T1/AVEV7M', 'Small ribonucleoproteins (sRNPs) guide RNA folding, modification, splicing, and processing during transcription. The data associated with this manuscript examine how bacterial Hfq•DsrA sRNA complexes bind to actively elongating rpoS mRNA using single-molecule co-localization co-transcriptional assembly (smCoCoA). The results show that recruitment of Hfq upstream enabled dynamic sampling of rpoS transcripts for segments complementary to DsrA sRNA. Site-specific fluorophores on the DNA template reveal that Hfq•DsrA can target rpoS mRNA soon after the DsrA binding site is transcribed. The results suggest that sRNPs are able to capture a prospective target site before it is masked by folding of the nascent transcript, providing a kinetic advantage to co-transcripitonal targeting over post-transcriptional targeting. This dataset comprises metadata, EMCCD movies of smCoCoA experiments, and analyzed data used to create the figures in this manuscript.', '23-Mar-2023', '92', '12', '151', '1', 'NA');
