insert into dataset values ('doi:10.7281/T1/BDLMJG', 'Field notes, interview transcripts and other data associated with the dissertation titled ''Modernity’s garbage: Struggles over municipal solid waste in urban India''', 'https://doi.org/10.7281/T1/BDLMJG', 'This collection contains three primary types of data: (a) interview notes and transcripts with a range of stakeholders including informal waste sector actors (e.g. waste pickers), waste management firms, non-governmental organizations (NGOs), technical experts from a range of organizations, recycling companies, plastics industry, and municipal staff; (b) field notes from various conferences, symposia, and workshops related to waste management; and (c) comments from various organizations on the draft versions of the Municipal Solid Waste (Management and Handling) Rules.', '17-Jul-2018', '45', '12', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/H1ZPLI', 'Data associated with the publication: 2019–2020 H1N1 clade A5a.1 viruses have better in vitro fitness compared with the co circulating A5a.2 clade', 'https://doi.org/10.7281/T1/H1ZPLI', 'This dataset includes the raw data and analyses of glycan array binding assays, plaque assays, infectious virus growth curves, and serum neutralization assays from the above publication. These are in the format of Excel sheets, GraphPad Prism files, and for plaque assays pictures of the plaque wells. The data are organized according to the assays performed.', '06-Jul-2023', '16', '12', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/TLEBVW', 'Data associated with publication "Wind farms providing secondary frequency regulation: Evaluating the performance of model-based receding horizon control"', 'https://doi.org/10.7281/T1/TLEBVW', 'We investigate the capability of wind farm to track a power reference signal to help ensure reliable power grid operations. The wind farm controller is based on a simple dynamic wind farm model and tested using high-fidelity simulations. We find that the dynamic nature of the wind farm model is vital for tracking the power signal, and the controlled wind farm would pass industry performance tests in most cases. Simulation data output in the form of comma separated value files.', '20-Dec-2017', '48', '13', 'NA', '1', 'NA');
