insert into dataset values ('doi:10.7281/T1/MYBQC7', 'Data associated with the publication: Sub-Milankovitch signals in Northern Polar layered deposits of Mars', 'https://doi.org/10.7281/T1/MYBQC7', 'This data set contains shapefiles for layers and stratigraphic sections, three-dimensional layer orientations, and reconstructed stratigraphic sections of the Martian North Polar Layered Deposit, analyzed in the manuscript “Sub-Milankovitch Signals in Northern Polar Layered Deposits of Mars” by Sotzen et al.', '29-Apr-2024', '31', '13', '149', '1', 'NA');
