insert into dataset values ('doi:10.7281/T1PN93HH', 'Immigrant Incorporation in East Asian Democracies (IIEAD) Project: Focus Group Interviews in Japan [collection]', 'https://doi.org/10.7281/T1PN93HH', 'Immigrant Incorporation in East Asian Democracies (Cambridge University Press, 2020) is based on 31 months of fieldwork conducted in Japan, South Korea, and Taiwan from 2009 to 2016. This book examines how the civic legacies of past struggles for democracy shape current movements for immigrant rights. Examining three industrial democracies in Northeast Asia with overlapping immigration and citizenship policies, immigrant populations, and immigration histories, this book offers insights into the gaps between state policies and immigrant political behavior across similarly situated countries. In addition to comparing policy reforms, state-institutionalized rights for migrants, and immigrant incorporation policies, programs, and services, this project seeks to better understand the process of political incorporation through the lens of migrants themselves. In order to understand the incentives and disincentives for particular forms of political engagement as well as immigrant strategies f', '30-Oct-2020', '597', '17', '47', '1', 'NA');
insert into dataset values ('doi:10.7281/T1PN93HH', 'Immigrant Incorporation in East Asian Democracies (IIEAD) Project: Focus Group Interviews in Japan [collection]', 'https://doi.org/10.7281/T1PN93HH', 'Immigrant Incorporation in East Asian Democracies (Cambridge University Press, 2020) is based on 31 months of fieldwork conducted in Japan, South Korea, and Taiwan from 2009 to 2016. This book examines how the civic legacies of past struggles for democracy shape current movements for immigrant rights. Examining three industrial democracies in Northeast Asia with overlapping immigration and citizenship policies, immigrant populations, and immigration histories, this book offers insights into the gaps between state policies and immigrant political behavior across similarly situated countries. In addition to comparing policy reforms, state-institutionalized rights for migrants, and immigrant incorporation policies, programs, and services, this project seeks to better understand the process of political incorporation through the lens of migrants themselves. In order to understand the incentives and disincentives for particular forms of political engagement as well as immigrant strategies f', '30-Oct-2020', '597', '17', '48', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/PXCQCC', 'Data associated with “Direct Effects of CO2 Radiative Forcing on Ocean Heat Content and Circulation”', 'https://doi.org/10.7281/T1/PXCQCC', 'Output of atmospheric general circulation model (GCM) simulations are used to force an ocean-only GCM with comprehensive boundary conditions to examine the impact of direct atmospheric effects on ocean heat content. Perturbation simulations with prescribed response to quadrupling of atmospheric CO2 include altered surface winds, freshwater fluxes, and downwelling shortwave radiation.', '19-Jun-2019', '97', '14', '73', '1', 'NA');
