insert into dataset values ('doi:10.7281/T1/AUBBJD', 'Data associated with the publication: Scaling global warming impacts on ocean ecosystems: Results from a suite of Earth System Models', 'https://doi.org/10.7281/T1/AUBBJD', 'An important technique used by climate modelers to isolate the impacts of increasing greenhouse gasses on Earth System processes is to simulate the impact of an abrupt increase in carbon dioxide. The spatial pattern of change provides a “fingerprint” that is generally much larger than natural variability. Insofar as the response to radiative forcing is linear (the impact of quadrupling CO2 is twice the impact of doubling CO2) this fingerprint can then be used to estimate the impact of historical greenhouse gas forcing. However the degree to which biogeochemical cycles respond linearly to radiative forcing has rarely been tested. In this paper, we evaluate which ocean biogeochemical fields are likely to respond linearly to changing radiative forcing, which ones do not, and where linearity breaks down. We also demonstrate that the representation of lateral mixing by mesoscale eddies, which varies significantly across climate models, plays an important role in modulating the breakdown of', '28-Aug-2020', '63', '20', '123', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/AUBBJD', 'Data associated with the publication: Scaling global warming impacts on ocean ecosystems: Results from a suite of Earth System Models', 'https://doi.org/10.7281/T1/AUBBJD', 'An important technique used by climate modelers to isolate the impacts of increasing greenhouse gasses on Earth System processes is to simulate the impact of an abrupt increase in carbon dioxide. The spatial pattern of change provides a “fingerprint” that is generally much larger than natural variability. Insofar as the response to radiative forcing is linear (the impact of quadrupling CO2 is twice the impact of doubling CO2) this fingerprint can then be used to estimate the impact of historical greenhouse gas forcing. However the degree to which biogeochemical cycles respond linearly to radiative forcing has rarely been tested. In this paper, we evaluate which ocean biogeochemical fields are likely to respond linearly to changing radiative forcing, which ones do not, and where linearity breaks down. We also demonstrate that the representation of lateral mixing by mesoscale eddies, which varies significantly across climate models, plays an important role in modulating the breakdown of', '28-Aug-2020', '63', '20', '124', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/C304HZ', 'Data associated with the publication: X-ray computed tomography and fluoroscopy collected during cadaveric periacetabular osteotomy experiments.', 'https://doi.org/10.7281/T1/C304HZ', 'This dataset contains X-ray computed tomography (CT) and fluoroscopy data collected during the research and development of computer-integrated surgical systems for periacetabular osteotomy procedures. A minimum of two CT scans, preoperative and postoperative, are included for each of six cadaveric specimens. Fluoroscopy taken before, during and after, osteotomy is also included for each specimen. CT and fluoroscopy data of an artificial tracking fiducial object and a sawbones pelvis are included as well. All told, the original Digital Imaging and Communications in Medicine (DICOM) files from 19 CT scans and 2,659 fluoroscopic images are included. This report, along with a supplementary spreadsheet, contains a detailed explanation of the data. It is our hope that this documented dataset will accelerate the research and development of other new methods for image-guided interventions.', '30-Mar-2022', '673', '19', 'NA', '1', 'NA');
