insert into dataset values ('doi:10.7281/T1/OY2X8T', 'Data associated with the publication: Palmitoylation regulates neuropilin-2 localization and function in cortical neurons and conveys specificity to semaphorin signaling via palmitoyl acyltransferases', 'https://doi.org/10.7281/T1/OY2X8T', 'Neuropilins (Nrps) are S-palmitoylated in vitro and in vivo in the central nervous system. S-palmitoylation of select Nrp2 cysteines confers subcellular localization specificity and is required for semaphorin 3F-dependent dendritic spine pruning in cortical neurons. Distinct palmitoyl acyltransferases mediate Nrp2 and Nrp1 palmitoylation and function, imparting specificity to semaphorin signaling.', '29-Mar-2023', '69', '27', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/VNEEJB', 'Data associated with the publication: Geologic structure of the Vera Rubin ridge, Gale crater, Mars', 'https://doi.org/10.7281/T1/VNEEJB', 'This dataset contains supporting data for the publication “Geologic structure of the Vera Rubin ridge, Gale crater, Mars.” It contains three-dimensional topographic profiles of bedrock layers exposed at a number of sites visited by the Curiosity Mars rover at the Vera Rubin ridge in Gale crater.', '04-Apr-2023', '25', '25', '149', '1', 'NA');
