insert into dataset values ('doi:10.7281/T1JW8BSS', 'Immigrant Incorporation in East Asian Democracies (IIEAD) Project: Focus Group Interviews in South Korea [collection]', 'https://doi.org/10.7281/T1JW8BSS', 'Immigrant Incorporation in East Asian Democracies (Cambridge University Press, 2020) is based on 31 months of fieldwork conducted in Japan, South Korea, and Taiwan from 2009 to 2016. This book examines how the civic legacies of past struggles for democracy shape current movements for immigrant rights. Examining three industrial democracies in Northeast Asia with overlapping immigration and citizenship policies, immigrant populations, and immigration histories, this book offers insights into the gaps between state policies and immigrant political behavior across similarly situated countries. In addition to comparing policy reforms, state-institutionalized rights for migrants, and immigrant incorporation policies, programs, and services, this project seeks to better understand the process of political incorporation through the lens of migrants themselves. In order to understand the incentives and disincentives for particular forms of political engagement as well as immigrant strategies f', '30-Oct-2020', '427', '17', '47', '1', 'NA');
insert into dataset values ('doi:10.7281/T1JW8BSS', 'Immigrant Incorporation in East Asian Democracies (IIEAD) Project: Focus Group Interviews in South Korea [collection]', 'https://doi.org/10.7281/T1JW8BSS', 'Immigrant Incorporation in East Asian Democracies (Cambridge University Press, 2020) is based on 31 months of fieldwork conducted in Japan, South Korea, and Taiwan from 2009 to 2016. This book examines how the civic legacies of past struggles for democracy shape current movements for immigrant rights. Examining three industrial democracies in Northeast Asia with overlapping immigration and citizenship policies, immigrant populations, and immigration histories, this book offers insights into the gaps between state policies and immigrant political behavior across similarly situated countries. In addition to comparing policy reforms, state-institutionalized rights for migrants, and immigrant incorporation policies, programs, and services, this project seeks to better understand the process of political incorporation through the lens of migrants themselves. In order to understand the incentives and disincentives for particular forms of political engagement as well as immigrant strategies f', '30-Oct-2020', '427', '17', '48', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/YZKNJ6', 'Data associated with publication: CGPart: A part segmentation dataset based on 3D computer graphics models', 'https://doi.org/10.7281/T1/YZKNJ6', 'This archive stores the synthetic images with part annotations from CGPart. CGPart is a comprehensive part segmentation dataset that provides detailed annotations on 3D CAD models, synthetic images, and real test images (https://qliu24.github.io/#Projects ). CGPart involves five vehicle categories: car, motorbike, aeroplane, bus, and bicycle. For each category, we rendered 30 000 to 40 000 synthetic images by varying the rendering parameters and automatically generated the part segmentation ground-truth. Here, we crop the original images based on the object bounding boxes and resize the images to have longer edge equal 800 pixels. Content is in split 2GB .zip that can be recombined with 7-Zip or similar programs.', '22-Feb-2024', '7', '41', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/IVVFCM', 'Data associated with the publication: Human scent guides mosquito thermotaxis and host selection under naturalistic conditions', 'https://doi.org/10.7281/T1/IVVFCM', 'This archive contains raw videos of mosquito behavior in .h624 format, mosquito trajectories extracted from those videos in .txt or .csv format, weather data in .csv, as well as raw GC/MS files in .mzml format used in the publication.', '21-Apr-2023', '167', '144', '136', '1', 'NA');
