insert into dataset values ('doi:10.7281/T1/XTJ1YP', 'Retrospective land surface model hydrological simulations for Ethiopia 1981-2017', 'https://doi.org/10.7281/T1/XTJ1YP', 'This dataset includes daily output of a simulation performed with the Noah Land Surface Model v3.6. The simulation was performed at 0.05 degree resolution (nominally 5km) for all of Ethiopia for the period 1981-2017. Meteorological forcing was drawn from the NASA Modern Era Reanalysis for Research and Applications, version 2 (MERRA-2), downscaled based on local topography and supplemented with Climate Hazards Group InfraRed Precipitation with Stations v2 (CHIRPSv2) rainfall estimates. Simulation outputs include gridded downscaled meteorological fields, along with simulated surface water and energy fluxes and storages.', '17-Oct-2018', '478', '148', '59', '1', 'NA');
