insert into dataset values ('doi:10.7281/T1/XFNORD', 'Data associated with the publication: Iapetan subduction initiation recorded in the Leka Ophiolite Complex, Norway.', 'https://doi.org/10.7281/T1/XFNORD', 'Contents of this dataset includes whole rock major and trace element analyses by XRF and LA-ICP-MS, U-Pb isotope ratios and calculated dates from LA-ICP-MS analyses of zircon, and U-Pb isotope ratios and calculated dates from CA-ID-TIMS analyses of zircon.', '21-Dec-2023', '30', '5', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/AOTRD6', 'Data associated with the publication: Dendritic cell activation by iron oxide nanoparticles depends on the extracellular environment', 'https://doi.org/10.7281/T1/AOTRD6', 'This dataset contains all raw data associated with the study elucidating the mechanisms of nanoparticle-mediated activation of dendritic cells (DCs) when they were exposed to hydroxyethyl starch-coated bionized nanoferrite IONPs (BP) in vitro and in vivo. We observed no evidence of toxicity at doses up to 25 mg Fe/mouse, five-fold higher than those used in subsequent in vivo experiments. Although DCs cultured with BP revealed high levels of nanoparticle uptake, neither JAWSII dendritic cells nor bone marrow derived cells (BMDCs) showed significant changes in marker expression. To assess whether BP interactions in vivo produced different effects, we analyzed CD80, CD86, and MHC II expression of DCs recovered from the livers, spleens, bone marrows, and lymph nodes of mice injected once with BP (5 mg Fe). Interestingly, only DCs in spleens and bone marrows responded to BP exposure. DCs recovered from other tissues and organs showed no evidence of increased activation. These findings highl', '27-Jun-2024', '0', '10', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/0HWVS1', 'Data associated with the publication: Magnetic particle imaging-guided thermal simulations for magnetic particle hyperthermia', 'https://doi.org/10.7281/T1/0HWVS1', 'The datasets within correspond to the Nanomaterials article “Magnetic Particle Imaging-Guided Thermal Simulations for Magnetic Particle Hyperthermia”. In the article, we describe the development and verification of a clinically-translatable workflow for magnetic particle imaging-guided thermal simulations. The data comprise the verification experiments, where we performed heating trials with mouse cadavers injected with magnetic nanoparticles; such datasets include nanoparticle characterization, microCT and MPI scans, temperature measurements, and COMSOL simulation results.', '28-Jun-2024', '18', '8', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/VEORXP', 'Data associated with the publication: Auditory hair cells and spiral ganglion neurons regenerate synapses with refined release properties in vitro', 'https://doi.org/10.7281/T1/VEORXP', 'This study utilizes inner hair cell (IHC) optogenetic stimulation and spiral ganglion neuron (SGN) recordings, showing that, when P3-5 denervated organs of Corti are co-cultured with SGNs, newly formed IHC/SGN synapses are indeed functional, exhibiting glutamatergic excitatory postsynaptic currents. This shared dataset compiles all the raw patch clamp recordings performed from SGNs in response to hair cell stimulation, either from freshly excised cochlear explants or from co-cultures. We are also providing the MATLAB analysis performed for each of these SGN recordings. All EPSC parameters extracted from the MATLAB analysis are also gathered in excel spreadsheets accompanied with their statistical analysis in GraphPad prism. We are also providing all raw patch clamp recordings directly performed from IHCs in different conditions, from which we are sharing the analysis of cell membrane capacitance, membrane potential (Vm), potassium and light-induced currents.', '10-Jul-2024', '12', '5', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/FPN6MI', 'Data associated with the publication: The impact of human H3N2 influenza virus reassortment during 2017-18 on increased influenza cases and disease severity: enhanced virus replication and neuraminidase antibody immune evasion', 'https://doi.org/10.7281/T1/FPN6MI', 'During the 2017-18 influenza season in the United States, there was a high incidence of influenza illness and mortality. However, no apparent mutations were identified in the HA gene segment of dominant H3N2 viruses, and the severity of the season could not be solely attributed to a vaccine mismatch. Clinical samples from the Johns Hopkins Center of Excellence for Influenza Research and Surveillance network during the 2016-17 and 2017-18 influenza seasons were sequenced to target influenza A virus. Phylogenetic trees were constructed based on viral whole genome sequences. Representative viral isolates of the two seasons were characterized in immortalized cell lines and human nasal epithelial cell cultures, and demographic data and clinical outcomes of patients were analyzed. Unique H3N2 reassortment events were observed, resulting in two predominant strains in the 2017-18 season: HA clade 3C.2a2 and clade 3C.3a, which had novel gene segment constellations containing gene segments from', '03-Aug-2023', '4', '2', 'NA', '1', 'NA');
insert into dataset values ('doi:10.7281/T1/CCC69H', 'Data associated with the publication: Characterization of pubertal development of girls in rural Bangladesh', 'https://doi.org/10.7281/T1/CCC69H', 'This data archive consists of all the data used to produce the manuscript in PLoS One titled “Characterization of pubertal development of girls in rural Bangladesh”. This manuscript describes the timing and patterns of pubertal maturation of a population of 15,320 girls from a birth cohort aged 9 to 15 years at initial encounter and followed for a year.', '23-Mar-2021', '18', '1', '128', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/FN9EH6', 'Data associated with the PLoS ONE publication ''Evaluation of a strategy for enrolling the families of critically ill patients in research using limited human resources'' by Turnbull et al. 2017', 'https://doi.org/10.7281/T1/FN9EH6', 'We want to know if patient activation interventions can be adapted to help the friends and family members who choose to speak for incapacitated ICU patients. These friends and family members are called proxies. As a first step in this process, we conducted a Phase I study in the Medical Intensive Care Unit at Johns Hopkins Hospital, in Baltimore, Maryland. More information about this project can be accessed at www.piperscience.org/proxy-activation . This dataset includes data and codebook for the study associated with the cited PLOS one publication. Certain variables in the public access version of the data were broadened and variables detailing patient and proxy relationships are not included to reduce identity disclosure risk. These may be obtained by direct request with approval by investigators local IRBs. Rationale: Clinical trials of interventions aimed at the families of intensive care unit (ICU) patients have proliferated but recruitment for these trials can be challenging. Obj', '03-Apr-2017', '26', '2', '51', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/FN9EH6', 'Data associated with the PLoS ONE publication ''Evaluation of a strategy for enrolling the families of critically ill patients in research using limited human resources'' by Turnbull et al. 2017', 'https://doi.org/10.7281/T1/FN9EH6', 'We want to know if patient activation interventions can be adapted to help the friends and family members who choose to speak for incapacitated ICU patients. These friends and family members are called proxies. As a first step in this process, we conducted a Phase I study in the Medical Intensive Care Unit at Johns Hopkins Hospital, in Baltimore, Maryland. More information about this project can be accessed at www.piperscience.org/proxy-activation . This dataset includes data and codebook for the study associated with the cited PLOS one publication. Certain variables in the public access version of the data were broadened and variables detailing patient and proxy relationships are not included to reduce identity disclosure risk. These may be obtained by direct request with approval by investigators local IRBs. Rationale: Clinical trials of interventions aimed at the families of intensive care unit (ICU) patients have proliferated but recruitment for these trials can be challenging. Obj', '03-Apr-2017', '26', '2', '52', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/ZHG9BB', 'Data associated with the PLoS ONE publication ''A Brief Intervention for Preparing ICU Families to be Proxies: A Phase I Study'' by Turnbull et al. 2017', 'https://doi.org/10.7281/T1/ZHG9BB', 'Background: Family members of critically ill patients report high levels of conflict with clinicians, have poor understanding of prognosis, struggle to make decisions, and experience substantial symptoms of anxiety, depression, and post-traumatic stress regardless of patient survival status. Efficient interventions are needed to prepare these families to act as patient proxies. Objectives: To assess a brief “patient activation” intervention designed to set expectations and prepare families of adult intensive care unit (ICU) patients to communicate effectively with the clinical team. Design: Phase I study of acceptability and immediate side effects Setting and Participants: 122 healthcare proxies of 111 consecutive patients with a stay of ≥24 hours in the Johns Hopkins Hospital Medical ICU (MICU), in Baltimore, Maryland. Intervention: Reading aloud to proxies from a booklet (Flesch-Kincard reading grade level 3.8) designed with multidisciplinary input including from former MICU proxies', '28-Aug-2017', '62', '2', 'NA', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/IJO1FU', 'Data associated with Ragen, Pradal and Gnanadesikan, "Impact of parameterized lateral mixing on the transport of the Antarctic Circumpolar Current in a coupled climate model"', 'https://doi.org/10.7281/T1/IJO1FU', 'Contains annually averaged netCDF files of the ocean output used in this paper to examine the interaction between the lateral mixing coefficient ARedi and the strength of the Circumpolar Current. Paper demonstrates that increasing ARedi causes the current to weaken. This is a surprising result given that this coefficient does not, by itself, produce large changes in density as it mixes temperature and salinity along density surfaces. However, changes in convection and surface temperatures produce changes in winds that do produce a much larger change in the density structure which is then reflected in the Circumpolar Current strength. Uncertainty in the mixing coefficient can explain a small fraction of the differences in Circumpolar Current transport seen in contemporary climate models. Files show averages of a number of key variables averaged over last century of simulation.', '20-Mar-2020', '11', '2', 'NA', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/W2AG3A', 'Data associated with the publication: A clinical score for identifying active tuberculosis while awaiting microbiological results: development and validation of a multivariable prediction model in sub-Saharan Africa', 'https://doi.org/10.7281/T1/W2AG3A', 'This dataset includes parts of two studies: the Kharitode study and the STOMP-TB study. The Kharitode study is a cluster-randomized controlled trial of tuberculosis contact investigation against facility-based screening in Limpopo Province, South Africa. It includes participants above 15 years of age who presented with tuberculosis symptoms at the 28 primary health clinics randomized to facility-based screening between July 2016 and January 2018. The STOMP-TB study is population-based tuberculosis survey, conducted in Kampala, Uganda. It includes adult participants above 15 years of age who presented with tuberculosis symptoms at four healthcare facilities between May 2018 and December 2019.', '12-Nov-2020', '98', '2', '127', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/FFU0LR', 'Data associated with the publication: Anti-forensics under scrutiny: assessing the effectiveness of digital obfuscation in the cloud', 'https://doi.org/10.7281/T1/FFU0LR', 'To spur research of digital forensics in the cloud, this data set comprises virtual machine (VM) images that include anti-forensic techniques. We provisioned VMs using Amazon''s Elastic Compute Cloud (EC2); populated them with user activity; and applied various techniques to destroy, disrupt, and obfuscate the activity patterns. We then obtained the VM''s disk storage as "evidence" in a common forensics format.', '29-Apr-2024', '5', '3', 'NA', '2', 'NA');
insert into dataset values ('doi:10.7281/T1D798BQ', 'Data associated with publication "Dynamic modulation of visual and electrosensory gains for locomotor control"', 'https://doi.org/10.7281/T1D798BQ', 'Data files and source code associated with the statistical methods and plots from the publication. From the publication abstract: Animal nervous systems resolve sensory conflict for the control of movement. For example, the glass knifefish, Eigenmannia virescens, relies on visual and electrosensory feedback as it swims to maintain position within a moving refuge. To study how signals from these two parallel sensory streams are used in refuge tracking, we constructed a novel augmented reality apparatus that enables the independent manipulation of visual and electrosensory cues to freely swimming fish (N=5). We evaluated the linearity of multisensory integration, the change to the relative perceptual weights given to vision an d electrosense in relation to sensory salience, and the effect of the magnitude of sensory conflict on sensorimotor gain. First, we found that tracking behaviour obeys superposition of the sensory inputs, suggesting linear sensorimotor integration. In addition, fis', '01-Jun-2016', '66', '4', '1', '2', 'NA');
