insert into dataset values ('doi:10.7281/T1/ZPJZJC', 'Data associated with the publication: Influence of simplified microbial community biofilms on bacterial retention in porous media under conditions of stormwater biofiltration', 'https://doi.org/10.7281/T1/ZPJZJC', 'Porous media filters are used widely to remove bacteria from contaminated water, such as stormwater run-off. Biofilms that colonize filter media during normal function can significantly alter performance, but it is not clear how characteristics of individual populations colonizing porous media combine to affect bacterial retention. We assess how four bacterial strains isolated from stormwater and a laboratory strain, Pseudomonas aeruginosa PAO1, alter Escherichia coli retention in experimental sand columns under conditions of stormwater filtration relative to a clean-bed control. Our results demonstrate that these strains differentially affect E. coli retention, as was previously shown for a model colloid. To determine whether E. coli retention could be influenced by changes in relative abundance of strains within a microbial community, we selected two pairs of biofilm strains with the largest observed differences in E. coli retention and tested how changes in relative abundance of str', '13-Oct-2021', '10', '4', '106', '2', 'NA');
