insert into dataset values ('doi:10.7281/T1/HVRF8B', 'Data associated with the publication: Predicting Plastic Events and Quantifying the Local Yield Surface in 3D Model Glasses', 'https://doi.org/10.7281/T1/HVRF8B', 'By applying the local yield stress (LYS) method to probe local regions of three-dimensional computational glass models, we confirm high correlations between the measured local yield stress and the plastic events when the parameterization of the method is properly optimized. Here we apply only the local probing that aligns perfectly with the loading on the boundary on each of the 10x10x10 testing sites throughout the 3 glass samples with variations in the probing region size as 2.5, 3.75, 5, 7.5 and 10 atomic distance. A thorough investigation is conducted on the anisotropy of the local yield surface at the location of the first plastic event in one glass with variations in the direction, triaxiality, rotation and orientation during probing. It indicates that the first triggered region does not align perfectly with the loading on the boundary, but is well-predicted by projecting the shear applied at the boundary onto the local yield surface.', '25-Oct-2021', '19', '4', '129', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/9VJGPI', 'Data associated with the publication: Chemoreceptor co-expression in Drosophila melanogaster olfactory neurons.', 'https://doi.org/10.7281/T1/9VJGPI', 'This dataset contains the confocal files, single sensillum recordings, and processed data used to generate the Figures and Supplement Figures for Task et al eLife 2022. The eLife publication contains 8 figures (Figures 1-8) and 10 Figure Supplements (Figure 2 Figure Supplements 1-3; Figure 3 Figure Supplements 1-2; Figure 4 Figure Supplement 1; Figure 5 Figure Supplement 1; Figure 6 Figure Supplements 1-3). This dataset is organized by Figures, and each folder contains the data used to generate that particular figure. Subfolders are organized based on data types, such that confocal files (LSM format) and their processed images are collected. Similarly, electrophysiological recording data is organized based on which sensilla was being recorded. Additional notes or processed images are provided which were used to generate the figure as it appears in the publication. Confocal image data can be viewed in FIJI/ImageJ. Confocal file names include the objective lens used (ie, 63x) and a brief', '05-Sep-2023', '58', '10', 'NA', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/NL3HTW', 'Data associated with the publication: Abundant and Persistent Sulfide-oxidizing Microbial Populations are Responsive to Hypoxia in the Chesapeake Bay', 'https://doi.org/10.7281/T1/NL3HTW', 'The number, size and severity of aquatic low oxygen dead-zones are increasing worldwide. Microbial processes in low oxygen environments have important ecosystem-level consequences, such as denitrification, greenhouse gas production and acidification. To identify key microbial processes occurring in low oxygen bottom waters of the Chesapeake Bay, we sequenced both 16S rRNA genes and shotgun metagenomic libraries to determine the identity, functional potential and spatiotemporal distribution of microbial populations in the water column. Unsupervised clustering algorithms grouped samples into three clusters using water chemistry or microbial communities, with extensive overlap of cluster composition between methods. Clusters were strongly differentiated by temperature, salinity, and oxygen. Sulfide-oxidizing microorganisms were found to be enriched in the low-oxygen bottom water and predictive of hypoxic conditions. Metagenome assembled genomes demonstrate that some of these sulfide-oxidi', '16-May-2023', '94', '10', '106', '2', 'NA');
