insert into dataset values ('doi:10.7281/T1/C4RVLS', 'Data associated with the publication: Binocular 3D otolith-ocular reflexes: responses of chinchillas to natural and prosthetic stimulation after ototoxic injury and vestibular implantation.', 'https://doi.org/10.7281/T1/C4RVLS', 'The otolith end organs inform the brain about gravitational and linear accelerations, driving the otolith-ocular reflex (OOR) to stabilize the eyes during translational motion (e.g., moving forward without rotating) and head tilt with respect to gravity. We previously characterized OOR responses of normal chinchillas to whole-body tilt and translation and to prosthetic electrical stimulation targeting the utricle and saccule via electrodes implanted in otherwise normal ears. Here we extend that work to examine OOR responses to tilt and translation stimuli after unilateral intratympanic gentamicin injection and to natural/mechanical and prosthetic/electrical stimulation delivered separately or in combination to animals with bilateral vestibular hypofunction after right ear intratympanic gentamicin injection followed by surgical disruption of the left labyrinth at the time of electrode implantation. Unilateral intratympanic gentamicin injection decreased natural OOR response magnitude to', '09-Jan-2024', '124', '59', '139', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/1ECVB0', 'Data associated with the publication: Jordan, A.K. et al. (2020) Strength of Linkages Between Dust and Circulation Over North Africa: results from a coupled modeling system with active dust. Journal of Geophysical Research-Atmospheres', 'https://doi.org/10.7281/T1/1ECVB0', 'This archive contains output from NASA Unified Weather Research and Forecasting (NU-WRF) model simulations reported in Jordan et al. (2020). The simulations are designed to examine hypothesized dust-atmosphere feedbacks in Northern Africa, in which dust in the atmosphere might act to modify the atmospheric conditions relevant to lofting of dust from the surface. To test this hypothesis, NU-WRF simulations were performed that coupled the WRF atmospheric model with the Goddard Chemistry Aerosols Radiation and Transport (GOCART) model. These simulations were performed with dust emissions on (“Dust On”) and dust emissions off (“Dust Off”), using a dust emission scheme that is responsive to surface soil moisture conditions and near-surface meteorology. Simulations were performed for the pre-rainy and rainy season (March-October) for fifteen simulation years (2002-2016). Model output was stored every six hours of simulation time. For archiving purposes, we have aggregated to monthly time-of-', '09-Apr-2020', '5765', '1921', 'NA', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/SQJ7G0', 'Data associated with the publication: Recalde-Coronel G. C. et al. (2024) Contributions of initial conditions and meteorological forecast to subseasonal-to-seasonal hydrological forecast skill in western tropical South America. Journal of Hydrometeorology', 'https://doi.org/10.7281/T1/SQJ7G0', 'This archive contains data used in the publication Recalde-Coronel G. C. et al. (2024). The sub-seasonal to seasonal hydrological forecast systems (S2S-HFS) dataset contains monthly spatial meteorological forcing fields (e.g., Tair, Qair, Rain) and hydrological variables (e.g., evapotranspiration, surface runoff) for Western Tropical South America (WTSA) for ten ensemble members. WTSA includes Peru, Ecuador, Colombia, and portions of Venezuela, Brazil, Bolivia, and Chile. We conducted the S2S-HFS hindcast simulations from 2000 to 2017 using the Noah-Multi-parameterization (Noah-MP) land surface model in offline mode within NASA’s Land Information System. The S2S-HFS hydrological simulations consist of daily outputs at 10-km spatial resolution over WTSA (1°N–18°S, 82°–67°W). The S2S-HFS is run using the downscaled NASA Goddard Earth Observing System Model - sub-seasonal to seasonal (GEOS-S2SV1) dataset as a meteorological forcing, and the Western Tropical of South America Land Data Assi', '22-Apr-2024', '2', '2', '69', '2', 'NA');
insert into dataset values ('doi:10.7281/T1/SQJ7G0', 'Data associated with the publication: Recalde-Coronel G. C. et al. (2024) Contributions of initial conditions and meteorological forecast to subseasonal-to-seasonal hydrological forecast skill in western tropical South America. Journal of Hydrometeorology', 'https://doi.org/10.7281/T1/SQJ7G0', 'This archive contains data used in the publication Recalde-Coronel G. C. et al. (2024). The sub-seasonal to seasonal hydrological forecast systems (S2S-HFS) dataset contains monthly spatial meteorological forcing fields (e.g., Tair, Qair, Rain) and hydrological variables (e.g., evapotranspiration, surface runoff) for Western Tropical South America (WTSA) for ten ensemble members. WTSA includes Peru, Ecuador, Colombia, and portions of Venezuela, Brazil, Bolivia, and Chile. We conducted the S2S-HFS hindcast simulations from 2000 to 2017 using the Noah-Multi-parameterization (Noah-MP) land surface model in offline mode within NASA’s Land Information System. The S2S-HFS hydrological simulations consist of daily outputs at 10-km spatial resolution over WTSA (1°N–18°S, 82°–67°W). The S2S-HFS is run using the downscaled NASA Goddard Earth Observing System Model - sub-seasonal to seasonal (GEOS-S2SV1) dataset as a meteorological forcing, and the Western Tropical of South America Land Data Assi', '22-Apr-2024', '2', '2', '70', '2', 'NA');
