insert into dataset values ('doi:10.7281/T1/DTCK4M', 'Overuse Index reported by state', 'https://doi.org/10.7281/T1/DTCK4M', 'We examined overuse among Medicare beneficiaries at the state level by generating the Overuse Index, for each U.S. state and the District of Columbia. We previously created an Overuse Index that uses billing codes for diverse clinical services that act as indicators to reflect the latent tendency of a region to overuse health care resources relative to other regions. We newly operationalized our approach to first measure overuse among Medicare beneficiaries within hospitals and their associated outpatient clinics, before we apply the model to generate the Overuse Index at the levels of interest (health systems, regions, or states.) We accessed 100% of the inpatient and outpatient claims, and the Master Beneficiary Summary files of Medicare beneficiaries from July 2015 through December 2018 through the Center for Medicare and Medicaid Services’ (CMS) Virtual Research Data Center (VRDC). Seventeen indicator procedures contributed to the Overuse Index. This set included five new indicator', '09-Sep-2021', '138', '3', '133', '3', 'NA');
insert into dataset values ('doi:10.7281/T1/EAFMCT', 'Coded quotations associated with the publication “Men’s perceptions of HIV care engagement at the facility- and provider-levels: experiences in Cote d’Ivoire”', 'https://doi.org/10.7281/T1/EAFMCT', 'Men in sub-Saharan Africa have lower rates of HIV testing and are less likely to initiate treatment compared to women. Service delivery dimensions are a key factor in facilitating engagement along the HIV treatment continuum for men and women, yet male specific overall perceptions of the service delivery environment have received little attention in West Africa. This study draws on qualitative data collected in Côte d’Ivoire to explore provider-level and structural factors affecting men’s engagement in HIV testing and treatment through interviews and focus group discussions conducted with health workers and men living with HIV (some on ART) or whose HIV status was unknown. The data posted here is a subset of the larger dataset and includes coded quotations (deidentified) relevant to the topic of the manuscript.', '07-Dec-2018', '15', '1', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/BIJBI6', 'Data associated with the PLOS publication ''Evidence for Contamination with C. trachomatis in the Household Environment of Children with Active Trachoma: A cross-sectional study in Kongwa, Tanzania''', 'https://doi.org/10.7281/T1/BIJBI6', 'In a cross-sectional survey of households of children with active trachoma, we determined the presence of Chlamydia trachomatis on household objects and on family members based on sleeping and caretaking patterns.', '19-Dec-2019', '30', '1', '113', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/AZE8LU', 'Data associated with publication: Irrigation water demand sensitivity to climate variability across the Contiguous United States', 'https://doi.org/10.7281/T1/AZE8LU', 'The datasets include monthly time-varying greenness vegetation fraction and monthly output of simulation performed with the Noah-Multiparameterization Land Surface Model v3.6 within NASA Land Information System. The simulation is conducted for the period of 2002-2017 at 0.125° spatial resolution forced by the North America Land Data Assimilation System-Phase 2 (NLDAS-2) meteorological forcing fields. Data is provided in NETCDF format including monthly time-varying greenness vegetation fraction, irrigation water amount, groundwater storage, and LIS-formatted NLDAS-2 precipitation and 2-m air temperature.', '01-Dec-2020', '11', '1', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/7WS8AD', 'Data associated with the publication: Evaluation of underweight status may improve identification of the highest-risk patients during outpatient evaluation for pulmonary tuberculosis', 'https://doi.org/10.7281/T1/7WS8AD', 'This dataset is an anonymized subset of the data collected by the STOMP-TB study (A Comprehensive Snapshot of Tuberculosis Transmission in an Urban Ugandan Community). The included records are from patients who were diagnosed with pulmonary TB through routine care at one of four health facilities in Kampala, Uganda, or control patients who underwent TB evaluation with a negative result at the same facilities. The included variables were used for analysis of underweight status, characteristic TB symptoms, and probability of bacteriologically-confirmed TB in the publication “Evaluation of underweight status may improve identification of the highest-risk patients during outpatient evaluation for pulmonary tuberculosis” by PJ Kitonsa et al. (Plos One, accepted December 2020).', '03-Dec-2020', '19', '1', '125', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/7WS8AD', 'Data associated with the publication: Evaluation of underweight status may improve identification of the highest-risk patients during outpatient evaluation for pulmonary tuberculosis', 'https://doi.org/10.7281/T1/7WS8AD', 'This dataset is an anonymized subset of the data collected by the STOMP-TB study (A Comprehensive Snapshot of Tuberculosis Transmission in an Urban Ugandan Community). The included records are from patients who were diagnosed with pulmonary TB through routine care at one of four health facilities in Kampala, Uganda, or control patients who underwent TB evaluation with a negative result at the same facilities. The included variables were used for analysis of underweight status, characteristic TB symptoms, and probability of bacteriologically-confirmed TB in the publication “Evaluation of underweight status may improve identification of the highest-risk patients during outpatient evaluation for pulmonary tuberculosis” by PJ Kitonsa et al. (Plos One, accepted December 2020).', '03-Dec-2020', '19', '1', '126', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/GH4EF2', 'Data associated with publication: Dichlorinated dithienylethene-based copolymers for air-stable n-type conductivity and thermoelectricity', 'https://doi.org/10.7281/T1/GH4EF2', 'The data consists of spreadsheets and other forms of raw data for the different kinds of characterizations reported in the manuscript, and are the basis for the figures shown in the manuscript. The highest level of folders is labelled according to the physical property being measured or the technique being used. Where subfolders are present, they are labelled according to the compound being characterized. From the publication abstract: Two donor–acceptor (D–A) polymers are obtained by coupling difluoro‐ and dichloro‐substituted forms of the electron‐deficient unit BDOPV and the relatively weak donor moiety dichlorodithienylethene (ClTVT). The conductivity and power factors of doped devices are different for the chlorinated and fluorinated BDOPV polymers. A high electron conductivity of 38.3 and 16.1 S cm−1 are obtained from the chlorinated and fluorinated polymers with N‐DMBI, respectively, and 12.4 and 2.4 S cm−1 are obtained from the chlorinated and fluorinated polymers with CoCp2, r', '22-Feb-2021', '5', '1', '76', 'NA', 'NA');
