insert into dataset values ('doi:10.7281/T1/KCIPSB', 'Data associated with the publication: Carboxylic acid-functionalized conjugated polymer promoting diminished electronic drift and amplified proton sensitivity of remote gates compared to nonpolar surfaces in aqueous media', 'https://doi.org/10.7281/T1/KCIPSB', 'The original data for the publication. The data consists of spreadsheets showing the electronic characterizations of all the compositions, including different polymers and dopant levels, at different pH. The highest level of folders is labelled according to the type of device used. Then, subfolders are associated with different compositions or experimental conditions. The spreadsheets themselves contain raw electrical data for each combination. The spreadsheets are the sources of data used to construct the plots that report the observations and trends in the manuscript. Article abstract: A systematic analysis is used to understand electrical drift occurring in field‐effect transistor (FET) dissolved‐analyte sensors by investigating its dependence on electrode surface‐solution combinations in a remote‐gate (RG) FET configuration. Water at pH 7 and neat acetonitrile, having different dipoles and polarizabilities, are applied to the RG surface of indium tin oxide, SiO2, hexamethyldisilaza', '01-Feb-2021', '5', '1', '76', 'NA', 'NA');
