insert into dataset values ('doi:10.7281/T1/4WX5QC', 'Data associated with the publication: Design and synthesis of air-stable p-channel conjugated polymers for high signal-to-drift nitrogen dioxide and ammonia sensing', 'https://doi.org/10.7281/T1/4WX5QC', 'The data consists of all raw and processed data pertaining to the associated publication and Supporting Information. From the abstract: The development of high-performance-conjugated polymer-based gas sensors involves detailed structural tailoring such that high sensitivities are achieved without compromising the stability of the fabricated devices. In this work, we systematically developed a series of diketopyrrolopyrrole (DPP)-based polymer semiconductors by modifying the polymer backbone to achieve and rationalize enhancements in gas sensitivities and electronic stability in air. NO2- and NH3-responsive polymer-based organic field-effect transistors (OFETs) are described with improved air stability compared to all-thiophene conjugated polymers. Five DPP–fluorene-based polymers were synthesized and compared to two control polymers and used as active layers to detect a concentration of NO2 at least as low as 0.5 ppm. The hypothesis that the less electron-donating fluorene main-chain s', '19-Jul-2021', '3', '1', '76', 'NA', 'NA');
