insert into dataset values ('doi:10.7281/T1/4AJ8Y1', 'Data associated with the PLoS ONE publications ''A Brief Intervention for Preparing ICU Families to be Proxies: A Phase I Study'' and ''More than one in three proxies do not know their loved one’s current code status: An Observational Study in a Maryland ICU''', 'https://doi.org/10.7281/T1/4AJ8Y1', 'Rationale: The majority of ICU patients lack decision-making capacity at some point during their ICU stay. However the extent to which proxy decision-makers are engaged in decisions about their patient’s care is challenging to quantify. Objectives: To assess 1) whether proxies know their patient’s actual code status as recorded in the electronic medical record (EMR), and 2) whether code status orders reflect ICU patient preferences as reported by proxy decision-makers. Methods: We interviewed proxy decision-makers for 111 consecutively admitted adult ICU patients. Proxies were asked about the patient’s goals of care, preferred code status, and actual code status. Responses were compared to code status orders in the EMR at the time of interview. Characteristics of patients and proxies who correctly vs incorrectly identified actual code status were compared, as were characteristics of proxies who reported a preferred code status that did vs did not match actual code status. Measurements', '20-Apr-2018', '21', '2', '51', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/4AJ8Y1', 'Data associated with the PLoS ONE publications ''A Brief Intervention for Preparing ICU Families to be Proxies: A Phase I Study'' and ''More than one in three proxies do not know their loved one’s current code status: An Observational Study in a Maryland ICU''', 'https://doi.org/10.7281/T1/4AJ8Y1', 'Rationale: The majority of ICU patients lack decision-making capacity at some point during their ICU stay. However the extent to which proxy decision-makers are engaged in decisions about their patient’s care is challenging to quantify. Objectives: To assess 1) whether proxies know their patient’s actual code status as recorded in the electronic medical record (EMR), and 2) whether code status orders reflect ICU patient preferences as reported by proxy decision-makers. Methods: We interviewed proxy decision-makers for 111 consecutively admitted adult ICU patients. Proxies were asked about the patient’s goals of care, preferred code status, and actual code status. Responses were compared to code status orders in the EMR at the time of interview. Characteristics of patients and proxies who correctly vs incorrectly identified actual code status were compared, as were characteristics of proxies who reported a preferred code status that did vs did not match actual code status. Measurements', '20-Apr-2018', '21', '2', '52', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/MYJBMQ', 'Data associated with the publication: Enhanced molecular soping for high conductivity in polymers with volume freed for dopants', 'https://doi.org/10.7281/T1/MYJBMQ', 'From the publication abstract: We present two new polythiophene isomers, PQTC16-TT and PQTSC16-TT, with more separation and lower side chain density on the backbone compared with the typical polythiophenes, such as PQT(S)12 and PBTTT(S)12. The introduction of spacer subunits to separate the side chains improves the accommodation of dopant molecules close to the polymer backbone. Therefore, the lamellar structure and π–π stacking of polymers were negligibly disturbed by dopants; in fact, improved ordering and closer π-stacking were observed after chemical doping. Furthermore, the doping efficiency is significantly enhanced and the electrical conductivity is improved up to 330 S cm–1, still maintained at 200 S cm–1 at higher doping concentration, for the combination of PQTSC16-TT/NOBF4. We investigate how charge transfer is affected by the geometry of the dopant with respect to the polymer repeat unit. It is shown that the sulfurs in the side chains act as binding sites for dopants, resu', '24-Aug-2020', '8', '2', '76', 'NA', 'NA');
