insert into dataset values ('doi:10.7281/T1/BT02SS', 'Data associated with the publication: Charge trapping in polymer electrets with highly dilute blended arylamine donors', 'https://doi.org/10.7281/T1/BT02SS', 'The data consists of all raw and processed data pertaining to this publication. From the abstract: The nature of and the ability to control biasing across dielectrics is a key area of research for the design of more versatile organic field-effect transistors (OFETs). One important technique to achieve such control is the inclusion of donor or acceptor molecules in the dielectric to modulate charge trapping therein. In this work, we report the effects of the additive concentration on OFETs with two different arylamines blended in polystyrene (PS) dielectrics, N,N′-diphenyl-N,N′-di-p-tolylbenzene-1,4-diamine (MPDA) and 4-anilinotriphenylamine (PATPA), as well as a comparison between PATPA/PS blends and dielectrics where PATPA was chemically tethered to the PS matrix. Dielectrics included in OFETs were subject to charging, and their charging capacity and stability were extracted from the OFET threshold voltages. For both MPDA/PS and PATPA/PS, blends with additive mole fractions as low as', '19-Jul-2021', '5', '2', '16', 'NA', 'NA');
