insert into dataset values ('doi:10.7281/T1/QA0SFN', 'Data associated with the publication: A Synthesis of Quantitative Research on Programs For Struggling Readers in Elementary Schools', 'https://doi.org/10.7281/T1/QA0SFN', 'This article reviews research on the outcomes of diverse reading programs on the achievement of struggling readers in elementary schools. Sixty-five studies of 51 different programs met rigorous standards. Eighty-three percent were randomized experiments and 17% quasi-experiments. Outcomes were positive for one-to-one tutoring and were positive but not as large for one-to-small group tutoring. There were no differences in outcomes between teachers and teaching assistants as tutors. Whole-class approaches (mostly cooperative learning) and whole-class/whole-school approaches incorporating tutoring for struggling readers obtained outcomes for struggling readers as large as those found for all forms of tutoring, on average, and benefitted many more students. Technology-supported adaptive instruction did not have significant positive outcomes for struggling readers, however. In agreement with previous reviews, this synthesis found that substantial impacts can be obtained for struggling read', '23-Nov-2020', '77', '3', '119', 'NA', 'NA');
