insert into dataset values ('doi:10.7281/T1/T3SA2Z', 'Data associated with the publication: Carter, A.W. et al. (2020) Methods for estimating Wet Bulb Globe Temperature from remote and low-cost data: a comparative study in central Alabama. GeoHealth.', 'https://doi.org/10.7281/T1/T3SA2Z', 'This archive contains data used in the publication Carter et al. (2020). These include hourly estimates of Wet Bulb Global Temperature (WBGT) and relevant supporting variables recorded by Kestrel 5400 Heat Stress Tracker instruments installed at three sites in Alabama—downtown Birmingham, suburban Birmingham, and rural Wilcox County—and hourly temperature and relative humidity estimates recorded by a network of Maxim Integrated Products, Inc. Model DS1923 Hygrochron iButtons distributed around Birmingham and Wilcox County. Details of these measurement networks and information on how the measurements were used in WBGT calculations are provided in Carter et al. (2020).', '13-Apr-2020', '28', '3', '69', 'NA', 'NA');
