insert into dataset values ('doi:10.7281/T1/VZZOJB', 'Data associated with the publication: Clumped-isotope geothermometry and carbonate U–Pb geochronology of the Alta stock metamorphic aureole, Utah, USA: Insights on the kinetics of metamorphism in carbonates', 'https://doi.org/10.7281/T1/VZZOJB', 'This supporting information includes text detailing the specifics of thermal and clumped-isotope reordering models. Figures include a comparison of clumped-isotope data collected in different laboratories, field photos of outcrops within the forsterite zone, electron dispersive X-ray images and spectra for dated samples, and additional plots of clumped-isotope re-equilibration modeling, including replication of Figure 6 from main text for calcite, burial and exhumation kinetic modeling in the absence of contact metamorphism, results for “disordered” model of Hemingway and Henkes (2020), and Monte Carlo simulations of dolomite clumped-isotope re-equilibration kinetic parameters. Tables provide complete analytical data for clumped-isotope measurements, thermal model input parameters, and inter-laboratory comparison clumped-isotope data. The data set provides data for U–Pb analysis.', '02-Mar-2021', '37', '3', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/M4FJUL', 'Data associated with publication: Enhanced and unconventional responses in chemiresistive sensing devices for nitrogen dioxide and ammonia from carboxylated alkylthiophene polymers', 'https://doi.org/10.7281/T1/M4FJUL', 'The data consists of all raw and processed data pertaining to this publication. Data (Part 1) consists of compilation of semiconductor characteristics of polymers without gas exposure and with gas exposure (concentration range of ammonia and nitrogen dioxide). In addition, raw data for remote gate sensing are included. In Data (Part 2), 4 point conductivity measurements, GPC, XPS, and processed data compilations and figures are included. From the article abstract: A carboxylated thiophene polymer-based chemiresistive device in a field-effect transistor (FET) configuration with unusual and enhanced responses to the widespread pollutants nitrogen dioxide (NO2) and ammonia (NH3) is described. The device based on a polymeric thiophene carboxylic acid showed a dramatic and superlinear increase in drain current (ID) of over 15000% to a ramped exposure to 10 ppm NO2 over several minutes, while its ethyl ester counterpart had significantly lower response. Devices incorporating either an ester', '18-Mar-2021', '10', '3', '76', 'NA', 'NA');
