insert into dataset values ('doi:10.7281/T1/PXEROL', 'Data associated with: Study to Understand Fall Reduction and Vitamin D in You (STURDY) randomized clinical trial', 'https://doi.org/10.7281/T1/PXEROL', 'This is the limited access database for the Study to Understand Fall Reduction and Vitamin D in You (STURDY) randomized response-adaptive clinical trial. The database includes baseline, treatment and post randomization data. This Database includes a set of files pertaining to the full study population (688 randomized participants plus screenees who were not randomized) and a set of files pertaining to the burn-in cohort (the 406 participants randomized prior to the first adjustment of the randomization probabilities). The Database also includes files that support the analyses included in the primary outcome paper published by the Annals of Internal Medicine (2021;174:(2):145-156). Each data file in the Database corresponds to a specific data collection form or type of data. This documentation notebook includes a SAS PROC CONTENTS listing for each SAS file and a copy of the relevant form if applicable. Each variable on each SAS data file has an associated SAS label. Several STURDY docum', '02-Mar-2022', '38', '3', '132', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/KOSYGQ', 'Data associated with the PlosONE publication “Implicit measures of receptive vocabulary knowledge in individuals with severe autism”', 'https://doi.org/10.7281/T1/KOSYGQ', 'Implicit measures of cognition are essential for assessing knowledge in individuals with severe autism because such individuals are often unable to make reliable overt behavioral responses. Here we test whether three implicit measures – eye movement monitoring (EM), pupillary dilation (PD), and event-related potentials (ERPs) – can reliably estimate vocabulary knowledge in individuals with severe autism. Five adults with severe autism were tested in a repeated-measures design with two tasks. High-frequency ‘known’ words (e.g. bus, airplane) and low-frequency ‘unknown’ words (e.g. ackee, cherimoya) were presented in a visual-world task (during which EM and PD data were collected) and a picture-word congruity task (during which ERP data were collected). Using a case study approach with single-subject analyses, we demonstrate that these implicit measures can provide estimates of receptive vocabulary knowledge in the majority of these participants. However, participants differed with respe', '29-Jun-2017', '13', '4', '57', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/7WXPIN', 'Data Associated with publication "Vertical transport of sediment-associated metals and cyanobacteria by ebullition in a stratified lake"', 'https://doi.org/10.7281/T1/7WXPIN', 'The purpose of this collection is to make available to the public the material necessary to validate the research findings for the article listed in "Related Publications." Bubbles adsorb and transport particulate matter both in industrial and marine systems. While methane-containing bubbles emitted from anoxic sediments are found extensively in aquatic ecosystems, relatively little attention has been paid to the possibility that such bubbles transport particle-associated chemical or biological material from sediments to surface waters of freshwater lakes. We quantified transport of particulate material from sediments to the surface by bubbles in Upper Mystic Lake, MA and in a 15 m tall experimental column. Vertical particle transport was positively correlated with the volume of gas bubbles released from the sediment. Particles transported by bubbles originated almost entirely in the sediment, rather than being scavenged from the water column. Concentrations of arsenic, chromium, lead,', '08-Oct-2019', '29', '4', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/N1X6I4', 'Tax Law NLP Resources', 'https://doi.org/10.7281/T1/N1X6I4', 'Resources helpful those doing research using NLP and tax law. This includes: A version of BERT-base-cased trained on 900M tokens from the case.law corpus. A curated corpus of IRS private letter rulings and Tax Court memorandum and summary opinions scraped from the IRS and Tax Court websites and OCR’ed and corrected as necessary. A 500-dimension word2vec vector representation of tax-law terms (including multi-term collocations) trained on this corpus plus tax-specific cases from the case.law corpus.', '04-Feb-2021', '356', '4', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/LJ9FLW', 'Data associated with the publication: Compositional measurements of Saturn''s upper atmosphere and rings from Cassini INMS: An extended analysis of measurements from Cassini''s grand finale orbits', 'https://doi.org/10.7281/T1/LJ9FLW', 'These data include the cleaned mass spectra from Cassini INMS orbits 288, 290, 291, 292, and 293. This includes averaged mass spectra for each orbit as well as binned mass spectra that are divided into altitudinal regions to retrieve density profiles for species as detailed in the corresponding publication. The species fragmentation pattern database used for analysis and mixing ratio profile results are also included.', '19-Apr-2022', '11', '2', '64', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/LJ9FLW', 'Data associated with the publication: Compositional measurements of Saturn''s upper atmosphere and rings from Cassini INMS: An extended analysis of measurements from Cassini''s grand finale orbits', 'https://doi.org/10.7281/T1/LJ9FLW', 'These data include the cleaned mass spectra from Cassini INMS orbits 288, 290, 291, 292, and 293. This includes averaged mass spectra for each orbit as well as binned mass spectra that are divided into altitudinal regions to retrieve density profiles for species as detailed in the corresponding publication. The species fragmentation pattern database used for analysis and mixing ratio profile results are also included.', '19-Apr-2022', '11', '2', '65', 'NA', 'NA');
