insert into dataset values ('doi:10.7281/T1/2DKJB2', 'Data associated with the publication: Ion channel selectivity through ion modulated changes of selectivity filter pKa values', 'https://doi.org/10.7281/T1/2DKJB2', 'This dataset contains simulations and parameter files associated with the publication "Ion channel selectivity through ion modulated changes of selectivity filter pKa values." Simulation files are in NetCDF format and parameter files are in parm7 format. See README document for more details.', '15-Jun-2023', '6', '4', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/4RZTRN', 'Data associated with publication "IL10 deficiency promotes alveolar enlargement and lymphoid dysmorphogenesis in the aged murine lung"', 'https://doi.org/10.7281/T1/4RZTRN', 'The connection between aging-related immune dysfunction and the lung manifestations of aging is poorly understood. A detailed characterization of the aging IL10-deficient murine lung, a model of accelerated aging and frailty, reconciles features of both immunosenescence and lung aging in a coherent model. Airspace enlargement developed in the middle-aged (12-month old) and aged (20-22-month old) IL10-deficient lung punctuated by an expansion of macrophages and alveolar cell apoptosis. Compared to wild-type (WT) controls, the IL10-deficient lungs from young (4-month old) mice showed increased oxidative stress which was enhanced in both genotypes by aging. Active caspase 3 staining was increased in the alveolar epithelial cells of aged WT and mutant lungs but was greater in the IL10-deficient milieu. Lung macrophages were increased in the aged IL10-deficient lungs with exuberant expression of MMP12. IL10 treatment of naïve and M2-polarized bone marrow derived WT macrophages reduced MMP12', '05-Nov-2021', '20', '6', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/RECXQW', 'Data associated with the publication: Remote sensing vegetation constraints enhance the estimation of anthropogenic irrigation water use', 'https://doi.org/10.7281/T1/RECXQW', 'The datasets include processed monthly ALEXI evapotranspiration (ET) product and monthly output of simulation performed with the Noah-Multiparameterization Land Surface Model v4.0.1 within NASA Land Information System. The simulation is conducted for the period of 2003-2019 at 0.125° spatial resolution forced by the North America Land Data Assimilation System-Phase 2 (NLDAS-2) meteorological forcing fields. Data is provided in NETCDF format including monthly irrigation water amount, surface soil moisture, ET, and gross primary production (GPP).', '10-Jan-2022', '20', '6', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/L4QB1Z', 'Data associated with the publication: The behavior of carboxylated and hydroxylated polythiophene as bioreceptor layer: anti-human IgG and human IgG interaction detection based on organic electrochemical transistors', 'https://doi.org/10.7281/T1/L4QB1Z', 'The data consists of graphs and spreadsheets showing the device responses for different combinations of receptor polymers with anti-IGG receptor in electrochemical transistors. The data are organized according to the manuscript figures that they support. The files are the sources of data used to construct the plots that report the observations and trends in the manuscript.', '19-Apr-2022', '16', '7', '76', 'NA', 'NA');
