insert into dataset values ('doi:10.7281/T1/X4MXHC', 'Data associated with the publication: Towards effective drought monitoring in the Middle East and North Africa (MENA) region: Implications from assimilating leaf area index and soil moisture into the Noah-MP land surface model for Morocco', 'https://doi.org/10.7281/T1/X4MXHC', 'The datasets include monthly output of simulations performed with the Noah-Multiparameterization Land Surface Model v4.0.1 within NASA Land Information System. The simulations are conducted for different periods within 2003-2019 at 0.05° spatial resolution forced by the GDAS and IMERG meteorological forcing fields. Data is provided in NETCDF format including irrigation fraction and land cover type data, simulation output for monthly leaf area index, root zone soil moisture, evaporation, transpiration, evapotranspiration, net primary product, and gross primary product.', '07-Apr-2022', '17', '8', 'NA', 'NA', 'NA');
