insert into dataset values ('doi:10.7281/T1/K08BJZ', 'Data associated with the publication: Major trends and environmental correlates of spatiotemporal shifts in the distribution of genes compared to a biogeochemical model simulation in the Chesapeake Bay', 'https://doi.org/10.7281/T1/K08BJZ', 'Microorganisms mediate critical biogeochemical transformations that affect the productivity and health of aquatic ecosystems. Metagenomic sequencing can be used to identify how genes change in response to environmental variables. However, relatively few studies directly compare gene changes to biogeochemical model predictions of corresponding processes, especially in dynamic estuarine ecosystems. We aim to understand the major drivers of spatiotemporal shifts in microbial genes and genomes within the water column of the Chesapeake and highlight the largest discrepancies of these observations with our model predictions. We used previously published shotgun metagenomic datasets, collected across multiple months, sites, and water column positions within Chesapeake Bay in 2017, and a metatranscriptomic dataset collected at one site in the Bay in 2010-2011. We found the largest changes in the relative abundance of genes involved in carbon, nitrogen, and sulfur metabolism associated with var', '06-Sep-2022', '65', '9', '106', 'NA', 'NA');
