insert into dataset values ('doi:10.7281/T1/FTCWPF', 'Data associated with publication Wilusz et al. ‘Using particle tracking to understand flow paths, age distributions, and the paradoxical origins of the inverse storage effect in an experimental catchment’', 'https://doi.org/10.7281/T1/FTCWPF', 'This data archive contains modeling code, inputs, and outputs for the paper “Using Particle Tracking to understand flowpaths, age distributions, and the paradoxical origins of the inverse storage effect in an experimental catchment.” The paper was prepared by D.C. Wilusz, C.J. Harman, W. P. Ball, R. M. Maxwell, and A. R. Buda. The paper DOI is 10.1029/2019WR025140. The data archive is split into four zipped folders: 101_Calibration: contains the inputs, processing code, and outputs for the model calibration; 102_ParFlow_CLM_Final_Run: contains the inputs, processing code, and outputs for the final run of the calibrated model; 103_Flowpath_Tracking: contains the inputs, processing code, and outputs for particle tracking in the final model; and 104_Data_Analysis_and_Plotting: contains the inputs and code used to generate paper figures, and copies of the figures. The archive contains a document "README.pdf" that describes the contents of each of the four folders in more detail.', '22-Apr-2020', '319', '11', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/QVAHMD', 'Federal court case event and coreference data', 'https://doi.org/10.7281/T1/QVAHMD', 'This contains much of the intermediate data and final data for the paper “Improved Induction of Narrative Chains via Cross-Document Relations” in StarSem 2022. The raw data came from the federal cases dataset at the excellent Caselaw Access Project (https://case.law) from Harvard’s Law Library.', '18-May-2022', '34', '11', 'NA', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/P69KYX', 'Data Axle Reference Solutions U.S. Business Location Data', 'https://doi.org/10.7281/T1/P69KYX', 'Data Axle Reference Solutions, formerly ReferenceUSA, contains two directories--residential and business. Records include over 12 million U.S. businesses and 120 million U.S. residents. Businesses include private, public, and non-profit organizations, regardless of employee size or sales. This dataset of Data Axle’s business database provides 52 attributes about tens of millions of businesses across the United States for almost every business from the Fortune 500 down to mom-and-pop shops and work-from-home freelancers. The Data Axle business database is available in its entirety for the years 2017 to 2020. The data can be downloaded in a single commas separated values (.csv) file for each year of interest. This file is approximately 5 GB in size after de-compressing the .zip archive. To load the .csv in memory requires a minimum of 32 GB of RAM. To access the Data Axle data on low-memory systems, the .csv file for each year as been split into subsets by US Census defined geographic re', '05-Apr-2022', '71', '18', '122', 'NA', 'NA');
insert into dataset values ('doi:10.7281/T1/YQDI0F', 'Data associated with: Retrospective land surface model simulations of Western Tropical South America', 'https://doi.org/10.7281/T1/YQDI0F', 'Western Tropical South America (WTSA) is a climatically and hydrologically diverse region that is underserved by in situ meteorological and hydrological monitoring networks. In this context, retrospective simulations performed with advanced land surface models (LSMs) can provide a valuable complement to historical observation networks, providing consistent and physically-based estimates of land surface hydrologic states and fluxes. This data archive contains the output of simulations performed with the Noah MultiParameterization (Noah-MP) LSM and the Hydrological Modeling and Analysis Platform (HyMAP) for a region that encompasses WTSA from the Pacific Coast through the Western Amazon. The period covered by these simulations is January 2002 - September 2019, and the primary purpose of the dataset has been to develop an environmentally-informed Malaria Early Warning System (MEWS) for the region. In presenting these results in a public archive we aim to preserve and share the results of', '06-Apr-2021', '202', '20', '69', 'NA', 'NA');
