insert into collection values ('51', 'Partnership for ICU Patient-family Engagement Research (PIPER) Proxy Activation Study', '31-Mar-2017', 'Pilot study of a proxy activation booklet for the medical intensive care unit. We want to know if patient activation interventions can be adapted to help the friends and family members who choose to speak for incapacitated ICU patients. These friends and family members are called proxies. As a first step in this process, we conducted a Phase I study in the Medical Intensive Care Unit at Johns Hopkins Hospital, in Baltimore, Maryland. More information about this project, led by Alison E. Turnbull, DVM, MPH, PhD at Johns Hopkins University School of Medicine, can be accessed at www.piperscience.org/proxy-activation', 'jhu', 'doi:10.7281/T1/4AJ8Y1', '2', '21');
insert into collection values ('52', 'Partnership for ICU Patient-family Engagement Research (PIPER) Proxy Activation Study', '31-Mar-2017', 'Pilot study of a proxy activation booklet for the medical intensive care unit. We want to know if patient activation interventions can be adapted to help the friends and family members who choose to speak for incapacitated ICU patients. These friends and family members are called proxies. As a first step in this process, we conducted a Phase I study in the Medical Intensive Care Unit at Johns Hopkins Hospital, in Baltimore, Maryland. More information about this project, led by Alison E. Turnbull, DVM, MPH, PhD at Johns Hopkins University School of Medicine, can be accessed at www.piperscience.org/proxy-activation', 'jhu', 'doi:10.7281/T1/FN9EH6', '2', '26');
