insert into collection values ('68', 'The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Survey-Nepal Publication Data', '24-Oct-2018', 'The PoSHAN surveys were designed to be nationally representative and implemented as an annual assessment of community, household, individual conditions in 21 sub-districts in Nepal from 2013-2016. The aim of the study was to determine a) the links among agriculture, nutrition, health, and b) how exposure to a range of policy and program interventions may influence household food security, poverty, and the diets, health and nutrition of young children, their mothers and nulliparous women of reproductive age. This archive is for datasets associated with publications based on the PoSHAN surveys. The complete survey datasets can be found here; [link]', 'jhu', 'doi:10.7281/T1/VAQP5N', '4', '34');
insert into collection values ('69', 'Hydroclimate Research Group', '24-Aug-2018', 'The overarching purpose of our research group is to advance understanding of hydroclimate dynamics and of the manner in which hydroclimatic processes interact with ecological and human systems. In the process, we aim to develop tools for improved monitoring and prediction of regional atmospheric processes, landscape hydrology, and, in collaboration with many wonderful colleagues, coupled climate / environment / human systems relevant to human health, food and water security, and preservation of biodiversity.', 'jhu', 'doi:10.7281/T1/JYAHTN', '4', '14');
