insert into collection values ('74', 'The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Study Data Archive', '23-Apr-2019', 'The Feed the Future Innovation Lab for Nutrition, with funding from the USAID, conducted a series of four annual surveys – The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Surveys – in Nepal from 2013-2016. The aim of the surveys was to assess nutritional status, diet and morbidity of preschool aged children and their mothers, and recently married, nulliparous women, and household food security, agricultural practices, participation in services and programs, among other factors, and examine associations between agricultural practices and food security, nutritional status, diet and health. The broader goal was guide policy and program interventions that may influence household food security, poverty, and the diets, health and nutrition of pre-school children and their mothers. The PoSHAN surveys were conducted in 21 sub-district units (Village Development Committees, VDCs), in 21 districts, 7 each across the Mountains, Hills and Terai (plains), sampled systematicall', 'jhu', 'NA', 'NA', 'NA');
insert into collection values ('75', 'Engaging Men in the HIV Treatment Continuum (Côte d’Ivoire)', '07-Dec-2018', 'This project contains formative research and evaluation data related to a USAID-funded project designed to engage men in Côte d’Ivoire in HIV testing and the treatment continuum. Funding was given under two USAID projects: Health Communication Capacity Collaborative (HC3) and Breakthrough ACTION.', 'jhu', 'NA', 'NA', 'NA');
