insert into collection values ('102', 'The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Study Data Archive', '23-Apr-2019', 'The Feed the Future Innovation Lab for Nutrition, with funding from the USAID, conducted a series of four annual surveys – The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Surveys – in Nepal from 2013-2016. The aim of the surveys was to assess nutritional status, diet and morbidity of preschool aged children and their mothers, and recently married, nulliparous women, and household food security, agricultural practices, participation in services and programs, among other factors, and examine associations between agricultural practices and food security, nutritional status, diet and health. The broader goal was guide policy and program interventions that may influence household food security, poverty, and the diets, health and nutrition of pre-school children and their mothers. The PoSHAN surveys were conducted in 21 sub-district units (Village Development Committees, VDCs), in 21 districts, 7 each across the Mountains, Hills and Terai (plains), sampled systematicall', 'jhu', 'doi:10.7281/T1/EM61IB', '5', '241');
insert into collection values ('103', 'The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Study Data Archive', '23-Apr-2019', 'The Feed the Future Innovation Lab for Nutrition, with funding from the USAID, conducted a series of four annual surveys – The Policy and Science for Health, Agriculture and Nutrition (PoSHAN) Surveys – in Nepal from 2013-2016. The aim of the surveys was to assess nutritional status, diet and morbidity of preschool aged children and their mothers, and recently married, nulliparous women, and household food security, agricultural practices, participation in services and programs, among other factors, and examine associations between agricultural practices and food security, nutritional status, diet and health. The broader goal was guide policy and program interventions that may influence household food security, poverty, and the diets, health and nutrition of pre-school children and their mothers. The PoSHAN surveys were conducted in 21 sub-district units (Village Development Committees, VDCs), in 21 districts, 7 each across the Mountains, Hills and Terai (plains), sampled systematicall', 'jhu', 'doi:10.7281/T1/UMDMQK', '5', '279');
insert into collection values ('104', 'Partnership for ICU Patient-Family Engagement Research (PIPER)', '16-Apr-2019', 'The Partnership for ICU Patient-Family Engagement Research (PIPER) , led by Alison E. Turnbull, DVM, MPH, PhD at Johns Hopkins University School of Medicine, is a multidisciplinary group of researchers, clinicians, ICU families, and survivors investigating ways to ensure that ICU patients and their families are appropriately engaged in decision-making about patient care. The PIPER data archive shares datasets associated with publications for the Proxy Activation Study and MOLST project.', 'jhu', 'NA', 'NA', 'NA');
