insert into collection values ('114', 'PIPER group – communication research', '01-Apr-2020', 'This randomized trialed compared how the family members of people with advanced chronic obstructive pulmonary disease (COPD) requiring home oxygen interpreted prognostic statements make in video recordings of a senior intensivist. The primary outcome was recorded on a 0 – 100 scale. Secondary outcomes included difference in belief, and participant confidence in their ability to interpret the physician.', 'jhu', 'doi:10.7281/T1/VWQ4J3', '2', '33');
