insert into collection values ('119', 'Evidence-Based Education', '28-Aug-2020', 'The Center for Research and Reform in Education (CRRE) is a research center within the Johns Hopkins School of Education. Established in 2004, our major goal is to improve the quality of education for disadvantaged children in grades pre-K to 12 through high-quality research and evaluation studies and the dissemination of evidence-based research. This project contains data related to systematic reviews conducted by the team and disseminated through the BEE, Evidence for ESSA, and various academic conferences and journals.', 'jhu', 'doi:10.7281/T1/QA0SFN', '3', '77');
