insert into collection values ('125', 'STOMP-TB study (Strategies for Treating, Observing, Managing and Preventing Tuberculosis)', '12-Nov-2020', 'This study (NIH R01 HL138728, PI David Dowdy) seeks to create a comprehensive snapshot of tuberculosis prevalence and transmission within a single community in Kampala, Uganda. Data include data from people diagnosed with TB through active, community-based case-finding in this community, from people diagnosed with TB through routine care in local health facilities, from TB-negative controls, and from the contacts of TB cases.', 'jhu', 'doi:10.7281/T1/7WS8AD', '1', '19');
insert into collection values ('126', 'STOMP-TB study (Strategies for Treating, Observing, Managing and Preventing Tuberculosis)', '12-Nov-2020', 'This study (NIH R01 HL138728, PI David Dowdy) seeks to create a comprehensive snapshot of tuberculosis prevalence and transmission within a single community in Kampala, Uganda. Data include data from people diagnosed with TB through active, community-based case-finding in this community, from people diagnosed with TB through routine care in local health facilities, from TB-negative controls, and from the contacts of TB cases.', 'jhu', 'doi:10.7281/T1/VSW3JU', '4', '87');
insert into collection values ('127', 'TB Modeling and Translational Epidemiology', '05-Oct-2020', 'This Dataverse contains data from studies related to the JHSPH TB Modeling and Translational Epidemiology group. Projects include studies of TB transmission, case detection, diagnosis, treatment, and prevention, primarily performed in Uganda and South Africa.', 'jhu', 'doi:10.7281/T1/W2AG3A', '2', '98');
insert into collection values ('128', 'JiVitA Maternal and Child Health Research Project', '26-Feb-2021', 'The JiVitA Maternal and Child Health Research Project is one of the largest population health and nutrition intervention research organizations in South Asia, operating in an area of 435 sq km and population of >600,000 covering 18 rural unions in the District of Gaibandha in northwest Bangladesh. Started in 2000, JiVitA (derived from the Bangla word jibhitau = alive), is dedicated to assessing practical nutrition and health care interventions to reduce maternal, infant, childhood morbidity and mortality, and improve growth, health and development throughout adolescence into the reproductive years. The overarching goal of JiVitA is to guide public health policy in Bangladesh and South Asia with evidence. JiVitA is a Project of the Center for Human Nutrition in the Department of International Health of the Johns Hopkins University, registered with the Government of Bangladesh Non-Governmental Organization Affairs Bureau, Dhaka Bangladesh. Major funders include the Bill & Melinda Gates F', 'jhu', 'doi:10.7281/T1/CCC69H', '1', '18');
