insert into collection values ('132', 'STURDY Randomized Clinical Trial', '02-Mar-2022', 'This dataverse contains de-identified data for the Study to Understand Fall Reduction and Vitamin D in You (STURDY) randomized response-adaptive clinical trial. This study has been registered on ClinicalTrials.gov, identifier NCT02166333. This Database includes a set of files pertaining to the full study population (688 randomized participants plus screenees who were not randomized) and a set of files pertaining to the burn-in cohort (the 406 participants randomized prior to the first adjustment of the randomization probabilities). The Database also includes files that support the analyses included in the primary outcome paper published by the Annals of Internal Medicine (2021;174:(2):145-156). Several STURDY documents, including the final versions of the screening and trial consent statements, the Protocol, and the Manual of Procedures, are included with this documentation notebook to assist with understanding and navigation of STURDY data. Notes on analysis questions and issues are a', 'jhu', 'doi:10.7281/T1/PXEROL', '3', '38');
insert into collection values ('133', 'Algorithms, SAS code, and documentation supporting the Overuse of Healthcare', '09-Sep-2021', 'Algorithms, SAS code, and documentation supporting the Overuse Index. The Overuse Index was initially operationalized using Medicare data from 2008; it was later run in the IBM Marketscan data, and then subsequently modified and updated to ICD-10 codes and run in 100% Medicare data from 2016-2018. PI: Jodi Segal, MD, MPH. Johns Hopkins University', 'jhu', 'doi:10.7281/T1/DTCK4M', '3', '138');
