insert into collection values ('148', 'Kolodkin Lab', '30-Nov-2023', 'The Kolodkin Lab at Johns Hopkins University School of Medicine, Department of Neuroscience Research in our laboratory is focused on understanding how neuronal connectivity is established during embryonic and postnatal development. We investigate the functions of guidance cues and their receptors in axon guidance, dendritic morphology, and synapse formation and function. Current projects investigate the origins of laminar organization in the CNS, including regulation of neurite stratification in the mouse retina, and also how retinal ganglion cell axons establish connections to retinorecipient targets in the brain: with a particular interest in direction-selective visual system circuits. In addition, we study cellular and molecular mechanisms that regulate laminar organization of neuronal processes in the mouse neocortex. See more at: https://www.kolodkinlab.com/', 'jhu', 'NA', 'NA', 'NA');
