insert into collection values ('157', 'JHU CCVL (Computational Cognition, Vision, and Learning) Data Archive', '26-Apr-2024', 'The main goal of the CCVL (Computational Cognition, Vision, and Learning) research group is to develop mathematical models of vision and cognition. These models are intended primarily for designing artificial (computer) vision systems. Learning is required for extracting knowledge from data. Practical applications include vision for the disabled. These models also serve as computational models of biological vision which can be tested by behavioral methods and, in collaborative projects, with invasive, and non-invasive neuroscience techniques. We also study how humans and animals perform cognitive tasks such as learning and reasoning. In addition, we also use machine learning for interpreting medical images and studying brain function. See additional CCVL project datasets at https://ccvl.jhu.edu/datasets/. Alan Yuille, Bloomberg Distinguished Professor, Research Group Director.', 'jhu', 'NA', 'NA', 'NA');
insert into collection values ('158', 'Atlás digital de México histórico/Digital Atlas of Historical Mexico', '13-Dec-2023', 'Mexican geography has changed considerably over the past centuries. Whether looking at administrative organization, economic activity, infrastructure, or the environment, contemporary maps of the country cannot adequately represent historical places and spaces. This project collects historical GIS projects that seek to provide alternate means of visualizing and analyzing Mexican space using digital mapping. For more, see https://mx.digital/atlas/', 'jhu', 'doi:10.7281/T1/2QCZXM', '11', '2260');
insert into collection values ('159', 'Atlás digital de México histórico/Digital Atlas of Historical Mexico', '13-Dec-2023', 'Mexican geography has changed considerably over the past centuries. Whether looking at administrative organization, economic activity, infrastructure, or the environment, contemporary maps of the country cannot adequately represent historical places and spaces. This project collects historical GIS projects that seek to provide alternate means of visualizing and analyzing Mexican space using digital mapping. For more, see https://mx.digital/atlas/', 'jhu', 'doi:10.7281/T1/B1QTXI', '5', '1644');
insert into collection values ('160', 'AbdomenAtlas', '26-Apr-2024', 'AbdomenAtlas is a fully annotated CT dataset, comprising 22,682 CT volumes that include per-voxel annotations for 149 anatomical structures and all types of tumors. This dataset has been sourced from 102 hospitals across 20 countries. AbdomentAtlas is a project of the CCVL (Computational Cognition, Vision, and Learning) research group, Johns Hopkins University. See additional CCVL project datasets at https://ccvl.jhu.edu/datasets/', 'jhu', 'doi:10.7281/T1/7ELIJW', '18', '144');
insert into collection values ('161', 'Sedimentary Geobiology Group', '27-Mar-2024', 'The Sedimentary Geobiology Group is a multi-disciplinary group that studies how geochemical and morphological patterns in modern sedimentary systems capture information about ecological diversity (who is there?), biological activity (what are they doing?), and environmental conditions (how do they affect their surroundings and vice versa?). Insights from the modern are then used to interpret geochemical and morphological patterns in the geological record in order to explore the coupled evolution of life and the Earth surface environment.', 'jhu', 'doi:10.7281/T1/EHSEV2', '4', '9');
insert into collection values ('162', 'Sedimentary Geobiology Group', '27-Mar-2024', 'The Sedimentary Geobiology Group is a multi-disciplinary group that studies how geochemical and morphological patterns in modern sedimentary systems capture information about ecological diversity (who is there?), biological activity (what are they doing?), and environmental conditions (how do they affect their surroundings and vice versa?). Insights from the modern are then used to interpret geochemical and morphological patterns in the geological record in order to explore the coupled evolution of life and the Earth surface environment.', 'jhu', 'doi:10.7281/T1/NU0VS7', '8', '16');
