insert into collection values ('164', 'ARTIST Simulations', '19-Jul-2024', 'Codes include simulations used to predict reacted reporter kinetics and dose-response curve of IFN-O1-dART, reacted reporter kinetics, and dose-response curves of the comparator. Eqns S1, S2, are in the Supplementary Information Section 2.1, and Eqn S5 is in Section 2.2. Eqns S9, S10, S11 are in the Supplementary Information Section 6.2. LOD and Sensitivity analysis are in Supplementary Information Section 3. Codes were written and run using Jupyter Notebook.', 'jhu', 'doi:10.7281/T1/IRL0IE', '4', '17');
